INSERT INTO `facts` (`id`, `on`, `date`, `story`) VALUES
(2, '1', '2004-03-30', 'Решение Совета директров о созыве годового собрания\r\n\r\n<br>Информация о принятых Советом директоров \r\n<br>Прио-Внешторгбанка (открытое акционерное общество) решениях:\r\n<br>о созыве годового общего собрания акционеров, утверждении \r\n<br>повестки дня годового общего собрания акционеров Прио-Внешторгбанка (ОАО), \r\n<br>о рекомендациях по размеру выплачиваемых дивидендов  \r\n<br>по акциям Прио-Внешторгбанка (ОАО)\r\n<br>\r\n<br>Полное фирменное наименование эмитента: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>Место нахождения: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>ИНН: 6227001779.\r\n<br>Уникальный код эмитента, присваиваемый регистрирующим органом: 1026200000111.\r\n<br>Адрес странице в сети “Интернет”, используемый эмитентом для опубликования информации: www.priovtb.com\r\n<br>Дата проведения заседания совета директоров эмитента, на котором принято соответствующее решение: 29.03.2004 г.\r\n<br>Дата составления и номер протокола заседания совета директоров эмитента, на котором принято соответствующее решение: № 2 от 29.03.2004 г.\r\n<br>Содержание решений, принятых советом директоров эмитента:\r\n<br>1.	Провести годовое общее собрание акционеров Банка “24” апреля 2004 года. Место проведения собрания: г. Рязань, пос. Солотча, ул. Монастырская, д. 8. Начало регистрации 11-00, начало собрания - 12-00.\r\n<br>2.	Утвердить следующую повестку годового общего собрания акционеров:\r\n<br>1)	Утверждение годового отчета, годовой бухгалтерской отчетности, в том числе отчета о прибылях и убытках (счетов прибылей и убытков) Банка. \r\n<br>2)	Отчет Ревизионной комиссии Банка.\r\n<br>3)	Утверждение изменений и дополнений, вносимых в Устав, и новой редакции внутренних положений, регламентирующих деятельность органов Банка.\r\n<br>4)	Поручение Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией изменений и дополнений, вносимых в Устав Банка.\r\n<br>5)	Определение количественного состава Совета директоров Банка - пять человек. \r\n<br>6)	Избрание членов Совета директоров Банка\r\n<br>		- Ганишин Виктор Алексеевич,\r\n<br>		- Ларионов Николай Михайлович,\r\n<br>		- Мазаев Владимир Александрович,\r\n<br>		- Маслова Наталья Владимировна,\r\n<br>		- Черкашина Татьяна Арсентьевна.\r\n<br>7)	Определение количественного состава и избрание членов Ревизионной комиссии Банка - три человека:\r\n<br>		- Нечипоренко Мария Степановна, главный бухгалтер ООО “Амальгата”;\r\n<br>		- Ковзан Юлия Борисовна, главный бухгалтер ООО “БИК-Сервис”;\r\n<br>		- Куркина Юлия Евгеньевна, главный бухгалтер ООО “Амальгата”.\r\n<br>8)	Определение количественного и персонального состава Счетной комиссии Банка. Предлагается избрать Счетную комиссию в количестве 4 человек:\r\n<br>		- Терентьева Наталья Григорьевна,\r\n<br>		- Лядова Елена Ивановна,\r\n<br>		- Гусева Юлия Викторовна,\r\n<br>		- Орехова Ирина Васильевна.\r\n<br>9)	Утверждение аудитора Банка: аудиторско - консультационная фирма “МИАН” г. Москва.\r\n<br>10)	 Определение размера выплачиваемых членам ревизионной комиссии вознаграждений. \r\n<br>11)	Распределение прибыли, в том числе выплата (объявление) дивидендов по результатам финансового года. \r\n<br>3.	Считать нецелесообразным выплату дивидендов за 2003 год по обыкновенным акциям Банка, по привилегированным акциям Банка выплатить 15 процентов от номинальной стоимости. \r\n<br>\r\n<br>Председатель Правления \r\n<br>Прио-Внешторгбанка (ОАО)							Н.М. Ларионов\r\n<br>'),
(3, '1', '2004-03-31', 'Изменение доли членов Совета директоров\r\n<br>\r\nСведения об изменении размера доли участия лиц,  являющихся членами Совета директоров Прио-Внешторгбанка (открытое акционерное общество),\r\n<br>членами Правления и занимающего должность единоличного исполнительного органа\r\n<br>Прио-Внешторгбанка (ОАО) и об изменении размера долей принадлежащих\r\n<br>указанным лицам обыкновенных акций Прио-Внешторгбанка (ОАО).\r\n<br>\r\n<br>Полное фирменное наименование эмитента: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>Место нахождения: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>ИНН: 6227001779.\r\n<br>Уникальный код эмитента, присваиваемый регистрирующим органом: 1026200000111.\r\n<br>Адрес странице в сети “Интернет”, используемый эмитентом для опубликования информации: www.priovtb.com\r\n<br>Фамилия, имя и должность лица: Ганишин Виктор Алексеевич, Член Совета директоров, Председатель Совета директоров Прио-Внешторгбанка (ОАО).\r\n<br>Полное фирменное наименование и место нахождения организации, в уставном капитале которой изменилась доля данного лица: Прио-Внешторгбанк (открытое акционерное общество), 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>Размер доли данного лица в уставном капитале соответствующей организации до изменения: 16,48 %\r\n<br>Размер доли принадлежащих данному лицу обыкновенных акций до изменения: 16,48%\r\n<br>Размер доли данного лица в уставном капитале соответствующей организации после изменения:18,69% \r\n<br>Размер доли принадлежащих данному лицу обыкновенных акций после изменения:18,69%\r\n<br>Дата, в которую эмитент узнал об изменении доли указанного лица в уставном капитале соответствующей организации: 30.03.2004 г.\r\n<br>Фамилия, имя и должность лица: Ларионов Николай Михайлович, член Совета, член Правления, Председатель Правления Прио-Внешторгбанка (ОАО).\r\n<br>Полное фирменное наименование и место нахождения организации, в уставном капитале которой изменилась доля данного лица: Прио-Внешторгбанк (открытое акционерное общество), 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>Размер доли данного лица в уставном капитале соответствующей организации до изменения:17,95%\r\n<br>Размер доли принадлежащих данному лицу обыкновенных акций до изменения:17,95%\r\n<br>Размер доли данного лица в уставном капитале соответствующей организации после изменения:19,22%\r\n<br>Размер доли принадлежащих данному лицу обыкновенных акций после изменения:19,22%\r\n<br>Дата, в которую эмитент узнал об изменении доли указанного лица в уставном капитале соответствующей организации: 30.03.2004 г.\r\n<br>Фамилия, имя и должность лица: Мазаев Владимир Александрович, член Совета директоров Прио-Внешторгбанка (ОАО).\r\n<br>Полное фирменное наименование и место нахождения организации, в уставном капитале которой изменилась доля данного лица: Прио-Внешторгбанк (открытое акционерное общество), 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>Размер доли данного лица в уставном капитале соответствующей организации до изменения:17,99%\r\n<br>Размер доли принадлежащих данному лицу обыкновенных акций до изменения:17,99%\r\n<br>Размер доли данного лица в уставном капитале соответствующей организации после изменения:19,98%\r\n<br>Размер доли принадлежащих данному лицу обыкновенных акций после изменения:19,98%\r\n<br>Дата, в которую эмитент узнал об изменении доли указанного лица в уставном капитале соответствующей организации: 30.03.2004 г.\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО)							Н.М. Ларионов\r\n<br>'),
(4, '1', '2004-03-30', 'Сведения о датах закрытия реестра\r\n<br>\r\n<center>Сообщение о существенном факте </center><br>“Сведения о датах закрытия реестра Прио-Внешторгбанка \r\n<br>(открытое акционерное общество)»\r\n<br>\r\n<br>1. Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2. Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3. Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4. Уникальный код эмитента, присваиваемый регистрирующим органом: 1026200000111.\r\n<br>5. Код существенного факта: 0800212В29032004.\r\n<br>6. Адрес страницы в сети “Интернет”, используемый эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com.\r\n<br>7. Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: газета “Рязанские ведомости”.\r\n<br>8. Вид, категория (тип), серия и иные идентификационные признаки именных ценных бумаг: обыкновенные бездокументарные именные акции Прио-Внешторгбанка (ОАО), государственный регистрационный номер 10200212В, привилегированные бездокументарные именные акции Прио-Внешторгбанка (ОАО), государственный регистрационный номер 20100212В.\r\n<br>9. Цель, для которой составляется список владельцев именных ценных бумаг: участие в годовом общем собрании акционеров Прио-Внешторгбанка (ОАО) и выплата дивидендов за 2003 г.\r\n<br>10. Дата на которую составляется список владельцев именных ценных бумаг: 31.03.2004 г.\r\n<br>11. Дата составления протокола заседания Совета директоров Прио-Внешторгбанка (ОАО) на котором принято решение о дате составления списка владельцев именных ценных бумаг эмитента: 29.03.2004 г.\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО) 							Н.М. Ларионов\r\n<br>'),
(5, '1', '2004-03-31', 'Изменение доли 5 -процентников\r\n<br>\r\nСведения об изменении в составе акционеров \r\n<br>Прио-Внешторгбанка (открытое акционерное общество),\r\n<br>владеющих не менее чем 5 процентами акций Прио-Внешторгбанка (ОАО)\r\n<br>\r\n<br>Полное фирменное наименование эмитента: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>Место нахождения: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>ИНН: 6227001779.\r\n<br>Уникальный код эмитента, присваиваемый регистрирующим органом: 1026200000111.\r\n<br>Адрес странице в сети “Интернет”, используемый эмитентом для опубликования информации: www.priovtb.com\r\n<br>Фамилия, имя, отчество акционера эмитента: Ганишин Виктор Алексеевич.\r\n<br>Доля принадлежавших указанному лицу обыкновенных акций эмитента до изменения: 16,48%\r\n<br>Доля принадлежащих указанному лицу обыкновенных акций эмитента после изменения: 18,69%\r\n<br>Дата, в которую эмитент узнал об изменении доли принадлежащих указанному лицу обыкновенных акций эмитента: 30.03.2004 г.\r\n<br>Фамилия, имя, отчество акционера эмитента: Ларионов Николай Михайлович.\r\n<br>Доля принадлежавших указанному лицу обыкновенных акций эмитента до изменения: 17,95%\r\n<br>Доля принадлежащих указанному лицу обыкновенных акций эмитента после изменения: 19,22%\r\n<br>Дата, в которую эмитент узнал об изменении доли принадлежащих указанному лицу обыкновенных акций эмитента: 30.03.2004 г.\r\n<br>Фамилия, имя, отчество акционера эмитента: Мазаев Владимир Александрович.\r\n<br>Доля принадлежавших указанному лицу обыкновенных акций эмитента до изменения: 17,99%\r\n<br>Доля принадлежащих указанному лицу обыкновенных акций эмитента после изменения: 19,98%\r\n<br>Дата, в которую эмитент узнал об изменении доли принадлежащих указанному лицу обыкновенных акций эмитента: 30.03.2004 г.\r\n<br>\r\n<br>Председатель Правления \r\n<br>Прио-Внешторгбанка (ОАО) 							Н.М. Ларионов\r\n<br>'),
(7, '1', '2004-04-07', 'Увеличение чистой прибыли\r\n<br>\r\n\r\nСообщение о существенном факте «Сведения о фактах, повлекших \r\n<br>разовое увеличение прибыли или убытков эмитента более чем на 10 процентов»</B></center>\r\n<br>\r\n<br>1.	Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2.	Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3.	Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4.	Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5.	Код существенного факта: 0300212В06042004.\r\n<br>6.	Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com\r\n<br>7.	Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости».\r\n<br>9.	Факт (факты), повлекший разовое увеличение прибыли или убытков эмитента более чем на 10 процентов: увеличение чистой прибыли за первый квартал 2004 года по сравнению с итогами деятельности в четвертом квартале 2003 года произошло за счет изменения величины резервов на возможные потери, переоценки балансовых счетов, прочих статей доходов и расходов.\r\n<br>10.	Дата появления факта (фактов), повлекшего за собой разовое увеличение прибыли или убытков эмитента более чем на 10 процентов: 06.04.2003\r\n<br>11.	Значение прибыли эмитента за отчетный период (4 квартал 2003 года), предшествующий отчетному периоду, в котором появился соответствующий факт -  \r\n<br>2 336 тыс. руб.\r\n<br>12.	Значение прибыли эмитента за отчетный период (1 квартал 2004 года), в котором появился соответствующий факт – 5 196 тыс. руб.\r\n<br>12.	Изменение прибыли (убытков) эмитента в абсолютном и процентном отношении: \r\n<br>2 860 тыс. руб. или  122,4 %.\r\n<br>\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО)				 		Н.М. Ларионов\r\n<br>\r\n<br>Главный бухгалтер		                                              				 \r\n<br>Прио-Внешторгбанка (ОАО)						М.В. Волков\r\n<br>\r\n<br>07 апреля 2004 года\r\n<br>\r\n<br>'),
(8, '1', '2004-04-07', 'Увеличение стоимости активов\r\n<br>\r\n<center><B>Сообщение о существенном факте «Сведения о фактах, повлекших \r\n<br>разовое увеличение или уменьшение стоимости активов эмитента \r\n<br>более чем на 10 процентов»</B></center>\r\n<br>\r\n<br>1.	Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2.	Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3.	Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4.	Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5.	Код существенного факта: 0200212В06042004.\r\n<br>6.	Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com.\r\n<br>7.	Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости».\r\n<br>8.	Факт (факты), повлекший разовое увеличение или уменьшение стоимости активов эмитента более чем на 10 процентов: увеличение стоимости активов на 01.04.04 г. по сравнению с 01.01.2004 г. произошло за счет расширения объемов текущей деятельности, обусловленного, главным образом, увеличением остатков привлеченных средств клиентов и перераспределения ресурсов между филиалами, что вызвало увеличение остатков на счетах межфилиальных оборотов.\r\n<br>9.	Дата появления факта (фактов), повлекшего разовое увеличение или уменьшение стоимости активов эмитента более чем на 10 процентов: 06.04.2004.\r\n<br>10.	Стоимость активов эмитента на дату окончания отчетного периода (месяца, квартала, года), предшествующего отчетному периоду, в котором появился соответствующий факт (факты) (01.01.2004 г.): 1 926 449 тыс. руб.\r\n<br>11.	Стоимость активов эмитента на дату окончания отчетного периода (месяца, квартала, года) в котором появился соответствующий факт (факты) (01.04.2004 г.): 2 282 410 тыс. руб.\r\n<br>12.	Изменение стоимости активов эмитента в абсолютном и процентном отношении: \r\n<br>355 961 тыс. руб. или 18,5%.\r\n<br>\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО)				 		Н.М. Ларионов\r\n<br>\r\n<br>Главный бухгалтер		                                              				 \r\n<br>Прио-Внешторгбанка (ОАО)						М.В. Волков\r\n<br>\r\n<br>07 апреля 2004 года\r\n<br>'),
(9, '1', '2004-04-26', 'Исполнение обязательств по выплате дивидендов\r\n<br>\r\nСообщение о существенном факте "Сведения о начисленных и (или) выплаченных доходах по ценным бумагам эмитента"\r\n<br>\r\n<br>1.Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2.Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3.Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4.Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5.Код существенного факта: 060212В26042004.\r\n<br>6.Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com.\r\n<br>7.Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости».\r\n<br>8.Вид, категория (тип), серия и иные идентификационные признаки ценных бумаг: привилегированные бездокументарные именные акции Прио-Внешторгбанка (ОАО).\r\n<br>9.Государственный регистрационный номер выпуска (дополнительного выпуска) ценных бумаг, дата государственной регистрации: 20100212В.\r\n<br>10.Наименование регистрирующего органа, осуществившего государственную регистрацию выпуска (дополнительного выпуска) ценных бумаг: Главное управление Центрального банка Российской Федерации по Рязанской области.\r\n<br>11.Орган управления эмитента, принявший решение о выплате (объявлении) дивидендов по акциям эмитента или определении размера (порядка определения размера) процента (купона) по облигациям эмитента, дата принятия указанного решения и дата составления протокола собрания (заседания) указанного органа, на котором принято указанное решение: годовое общее собрание акционеров Прио-Внешторгбанка (ОАО) (Протокол от 26.04.2004 г.)\r\n<br>12.Общий размер дивидендов, начисленных на акции эмитента определенной категории (типа), и размер дивиденда, начисленного на одну акцию определенной категории (типа): общий размер процентов и (или) иного дохода, подлежащего (подлежавшего) выплате по облигациям эмитента определенного выпуска (серии), и размер процентов и (или) иного дохода, подлежащего (подлежавшего) выплате по одной облигации эмитента определенного выпуска (серии): Общий размер дивидендов - 2250 рублей, размер дивиденда на одну акцию 0,15 % от номинальной стоимости или 15 копеек на одну привилегированную бездокументарную именную акцию. \r\n<br>13.Форма выплаты доходов по ценным бумагам эмитента (денежные средства, иное имущество): денежные средства.\r\n<br>14.Дата, в которую обязательство по выплате доходов по ценным бумагам эмитента (дивиденды по акциям, доходы (проценты, номинальная стоимость) по облигациям) должно быть исполнено, а в случае, если обязательство по выплате доходов по ценным бумагам должно быть исполнено эмитентом в течение определенного срока (периода времени) - дата окончания этого срока: 23.06.2004 г.\r\n<br>15.Общий размер дивидендов, выплаченных по акциям эмитента определенной категории (типа); общий размер процентов и (или) иного дохода, выплаченного по облигациям эмитента определенного выпуска (серии): 2250 рублей.\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО) 				Н.М. Ларионов\r\n<br>\r\n<br>26 апреля 2004 года\r\n<br>');
