(10, '1', '2004-04-26', 'Решения годового собрания\r\n<br>\r\nСообщение о существенном факте "Сведения о решениях общих собраний"\r\n<br>\r\n<br>1.Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2.Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3.Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4.Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5.Код существенного факта: 100212В26042004.\r\n<br>6.Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com.\r\n<br>7.Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости».\r\n<br>8.Вид общего собрания (годовое, внеочередное) - годовое.\r\n<br>9.Форма проведения общего собрания: очная.\r\n<br>10.Дата и место проведения общего собрания: 24 апреля 2004 года, г. Рязань, пос. Солотча, ул. Монастырская, 8.\r\n<br>11.Кворум общего собрания: 31 691 687 голосов, что составляет 90, 6772 % от общего количества обыкновенных акций. \r\n<br>12.Вопросы, поставленные на голосование, и итоги голосования по ним:\r\n<br>1.Увердить годовой отчет, годовую бухгалтерскую отчетность, в том числе отчет о прибылях и убытках (счета прибылей и убытков) Банка. Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 691 687 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. По результатам голосования РЕШЕНИЕ ПРИНЯТО. \r\n<br>2.Утвердить изменения и дополнения, вносимые в Устав, и новую редакцию внутренних положений, регламентирующих деятельность органов Банка. Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 691 687 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется три четверти голосов. По результатам голосования РЕШЕНИЕ  ПРИНЯТО.\r\n<br>3. Поручить Председателю Совета директоров Банка Ганишину Виктору Алексеевичу подписать ходатайства и другие документы, связанные с регистрацией изменений и дополнений, вносимых в устав Банка. Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 691 687 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. По результатам голосования РЕШЕНИЕ  ПРИНЯТО.\r\n<br>4. Определить количественный состав Совета директоров Банка - пять человек. Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 691 687 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. По результатам голосования РЕШЕНИЕ  ПРИНЯТО.\r\n<br>5. Избрать в члены Совета директоров Банка:\r\n<br>- Ганишина Виктора Алексеевича,\r\n<br>- Ларионова Николая Михайловича,\r\n<br>- Мазаева Владимира Александровича,\r\n<br>- Черкашину Татьяну Арсентьевну,\r\n<br>- Масловау Наталью Владимировну. \r\n<br>Голоса распределились следующим образом:\r\n<br>- Ганишин Виктор Алексеевич - подано 31 691 687 голосов;\r\n<br>- Ларионов Николай Михайлович - подано 31 691 687 голосов;\r\n<br>- Мазаев Владимир Александрович - подано 31 691 687 голосов;\r\n<br>- Черкашина Татьяна Арсентьевна - подано 31 691 687 голосов;\r\n<br>- Маслова Наталья Владимировна - подано 31 691 687 голосов.\r\n<br>По результатам голосования приняты следующие решения: в члены Совета директоров Банка избраны следующие лица:\r\n<br>- Ганишин Виктор Алексеевич,\r\n<br>- Ларионов Николай Михайлович,\r\n<br>- Мазаев Владимир Александрович,\r\n<br>- Черкашина Татьяна Арсентьевна,\r\n<br>- Маслова Наталья Владимировна.\r\n<br>6. Определить количественный состав членов Ревизионной комиссии Банка - три человека и избрать:\r\n<br>1. Нечипоренко Марию Степановну, главный бухгалтер ООО «Амальгата»;\r\n<br>2. Ковзан Юлию Борисовну, главный бухгалтер ООО «БИК-Сервис»;\r\n<br>3. Куркину Юлию Евгеньевну, главный бухгалтер ООО «Амальгата».\r\n<br>Голоса, принадлежащие членам Совета директоров Банка, членам Правления Банка, Председателю Правления Банка, не участвовали в подсчете голосов при подведении итогов голосования по седьмому вопросу.\r\n<br>Голоса распределились следующим образом:\r\n<br>-Нечипоренко Мария Степановна\r\n<br>-«ЗА» подано 10 745 061 голоса, что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет;\r\n<br>- Ковзан Юлия Борисовна \r\n<br>-«ЗА» подано 10 745 061 голоса, что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет;\r\n<br>- Куркина Юлия Евгеньевна \r\n<br>- «ЗА» подано 10 745 061 голоса, что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет;\r\n<br>По результатам голосования в члены Ревизионной комиссии Банка избраны следующие лица:\r\n<br>- Нечипоренко Мария Степановна;\r\n<br>- Ковзан Юлия Борисовна;\r\n<br>- Куркина Юлия Евгеньевна.\r\n<br>7. Определить количественный состав Счетной комиссии Банка в количестве  пять человек и избрать:\r\n<br>- Терентьеву Наталью Григорьевну,\r\n<br>- Лядову Елену Ивановну,\r\n<br>- Маркову Наталию Аркадьевну,\r\n<br>- Гусеву Юлию Викторовну,\r\n<br>- Орехову Ирину Васильевну. \r\n<br>Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 691 687 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. По результатам голосования РЕШЕНИЕ ПРИНЯТО.\r\n<br>8. Утвердить аудитором Банка: аудиторско-консультационную фирму "МИАН" г. Москва. Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 691 687 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. По результатам голосования РЕШЕНИЕ ПРИНЯТО.\r\n<br>9. Определить размер выплачиваемых членам ревизионной комиссии вознаграждений: членам Ревизионной комиссии - три тысячи рублей в год, Председателю Ревизионной комиссии пять тысяч рублей в год. Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 691 687 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. 	По результатам голосования РЕШЕНИЕ ПРИНЯТО.\r\n<br>10. Утвердить распределение прибыли по результатам финансового года. Дивиденды за 2003 год по обыкновенным акциям Банка не выплачивать, по привилегированным акциям Банка выплатить 15 процентов от номинальной стоимости акции. Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 691 687 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. По результатам голосования РЕШЕНИЕ ПРИНЯТО.\r\n<br>13.Формулировки решений, принятых общим собранием:\r\n<br>1.Утвердить годовой отчет, годовую бухгалтерскую отчетность, в том числе отчет о прибылях и убытках (счета прибылей и убытков) Банка. \r\n<br>2.Утвердить изменения и дополнения, вносимые в Устав, и новую редакцию внутренних положений, регламентирующих деятельность органов Банка.\r\n<br>3.Поручить Председателю Совета директоров Банка Ганишину Виктору Алексеевичу подписать ходатайства и другие документы, связанные с регистрацией изменений и дополнений, вносимых в устав Банка.\r\n<br>4.Определить количественный состав Совета директоров Банка - пять человек. \r\n<br>5.Избрать в члены Совета директоров Банка:\r\n<br>-Ганишина Виктора Алексеевича,\r\n<br>-Ларионова Николая Михайловича,\r\n<br>-Мазаева Владимира Александровича,\r\n<br>-Черкашину Татьяну Арсентьевну,\r\n<br>-Масловау Наталью Владимировну. \r\n<br>6.Определить количественный состав членов Ревизионной комиссии Банка - три человека и избрать:\r\n<br>1. Нечипоренко Марию Степановну, главный бухгалтер ООО «Амальгата»;\r\n<br>2. Ковзан Юлию Борисовну, главный бухгалтер ООО «БИК-Сервис»;\r\n<br>3. Куркину Юлию Евгеньевну, главный бухгалтер ООО «Амальгата».\r\n<br>7. Определить количественный состав Счетной комиссии Банка в количестве  пять человек и избрать:\r\n<br>- Терентьеву Наталью Григорьевну,\r\n<br>- Лядову Елену Ивановну,\r\n<br>- Маркову Наталию Аркадьевну,\r\n<br>- Гусеву Юлию Викторовну,\r\n<br>- Орехову Ирину Васильевну. \r\n<br>8. Утвердить аудитором Банка: аудиторско-консультационную фирму "МИАН" г. Москва. \r\n<br>9. Определить размер выплачиваемых членам ревизионной комиссии вознаграждений: членам Ревизионной комиссии - три тысячи рублей в год, Председателю Ревизионной комиссии пять тысяч рублей в год. \r\n<br>10. Утвердить распределение прибыли по результатам финансового года. Дивиденды за 2003 год по обыкновенным акциям Банка не выплачивать, по привилегированным акциям Банка выплатить 15 процентов от номинальной стоимости акции. \r\n<br>\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО)		 		Н.М. Ларионов\r\n<br>\r\n<br>26 апреля 2004 года\r\n<br>'),
(11, '1', '2004-05-19', 'Исполнение обязательств по выплате дивидендов\r\n<br>\r\nСообщение о существенном факте "Сведения о сроках исполнения\r\n<br>обязательств эмитента перед владельцами ценных бумаг"\r\n<br>\r\n<br>1.Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2.Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3.Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4.Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5.Код существенного факта: 090212В19052004.\r\n<br>6.Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com.\r\n<br>7.Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости».\r\n<br>8.Вид, категория (тип), серия и иные идентификационные признаки ценных бумаг: привилегированные бездокументарные именные акции Прио-Внешторгбанка (ОАО).\r\n<br>9.Государственный регистрационный номер выпуска (дополнительного выпуска) ценных бумаг и дата государственной регистрации: 20100212В.\r\n<br>10.Содержание обязательства эмитента, а для денежного обязательства или иного обязательства, которое может быть выражено в денежном выражении - также размер такого обязательства в денежном выражении: Общий размер дивидендов - 2250 рублей, размер дивиденда на одну акцию 0,15 % от номинальной стоимости или 15 копеек на одну привилегированную бездокументарную именную акцию. \r\n<br>11.Дата, в которую обязательство должно быть исполнено, а в случае, если обязательство должно быть исполнено эмитентом в течение определенного срока (периода времени) - дата окончания этого срока: 23.06.2004 г.\r\n<br>12.Факт исполнения обязательства или неисполнения обязательства (дефолт) эмитента: дивиденды выплачены 19 мая 2004 года.\r\n<br>13.В случае неисполнения эмитентом обязательства - причина такого неисполнения, а для денежного обязательства или иного обязательства, которое может быть выражено в денежном выражении - также размер такого обязательства в денежном выражении, в котором оно не исполнено: дивиденды выплачены.\r\n<br>\r\n<br>Исполняющий обязанности \r\n<br>Председателя Правления,\r\n<br>Первый заместитель\r\n<br>Председателя Правления\r\n<br>Прио-Внешторгбанка (ОАО) 				А.А. Язев\r\n<br>\r\n<br>19 мая 2004 года\r\n<br>'),
(12, '1', '2004-05-31', 'Решение Совета директоров о досрочном прекращении полномочий Председателя правления\r\n<br>\r\n<center>Информация о принятых Советом директоров \r\n<br>Прио-Внешторгбанка (открытое акционерное общество) решениях:\r\n<br>о досрочном прекращении полномочий Председателя Правления Прио-Внешторгбанка (ОАО) и об образовании единоличного исполнительного органа Прио-Внешторгбанка (ОАО).</center>\r\n<br>Полное фирменное наименование эмитента: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>Место нахождения: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>ИНН: 6227001779.\r\n<br>Уникальный код эмитента, присваиваемый регистрирующим органом: 1026200000111.\r\n<br>Адрес странице в сети “Интернет”, используемый эмитентом для опубликования информации: www.priovtb.com\r\n<br>Дата проведения заседания совета директоров эмитента, на котором принято соответствующее решение: 31.05.2004 г.\r\n<br>Дата составления и номер протокола заседания совета директоров эмитента, на котором принято соответствующее решение: № 4 от 31.05.2004 г.\r\n<br>Содержание решений, принятых советом директоров эмитента:\r\n<br>1. Перевести Ларионова Николая Михайловича с его согласия на должность заместителя Председателя Совета директоров Банка, действующего на постоянной основе, с 1 июня 2004 года, освободив его от должности Председателя Правления Банка.\r\n<br>	2. Избрать с 1 июня 2004 года Председателем Правления Банка Волкова Михаила Владимировича, освободив его от должности главного бухгалтера Банка.\r\n<br>Фамилия, имя, отчество соответствующего лица: Волков Михаил Владимирович.\r\n<br>Доля участия данного лица в уставном капитале банка - 0,78 %, доля принадлежащих данному лицу обыкновенных акций банка: 0,77%.\r\n<br>Доля участия данного лица в уставном капитале дочерних и зависимых обществ эмитента, а в случае, когда дочерними и/или зависимыми обществами эмитента являются акционерные общества, - также доля принадлежащих данному лицу обыкновенных акций дочерних и/или зависимых обществ эмитента: дочерние и зависимые общества отсутствуют.\r\n<br>Доля обыкновенных акций эмитента и/или его дочерних и зависимых обществ, которая может быть приобретена данным лицом в результате осуществления прав по предоставленным данному лицу опционам эмитента и/или его дочерних и зависимых обществ: опционы дочерних и зависимых обществ отсутствуют.\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>Председатель Правления \r\n<br>Прио-Внешторгбанка (ОАО)					М.В. Волков\r\n<br>\r\n<br>01 июня 2004 года\r\n<br>'),
(13, '1', '2004-07-06', 'Уменьшение стоимости активов\r\n<br>Сообщение о существенном факте «Сведения о фактах, повлекших \r\n<br>разовое увеличение или уменьшение стоимости активов эмитента \r\n<br>более чем на 10 процентов»</center>\r\n<br>1.Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2.Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3.Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4.Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5.Код существенного факта: 0200212В06072004.\r\n<br>6.Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com.\r\n<br>7.Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости».\r\n<br>8.Факт (факты), повлекший разовое увеличение или уменьшение стоимости активов эмитента более чем на 10 процентов: уменьшение стоимости активов на 01.07.2004 г. по сравнению с 01.06.2004 г. произошло за счет уменьшения остатков на счетах межфилиальных оборотов, что обусловлено обычным перераспределением ресурсов между филиалами; уменьшения остатков на счетах в банках-корреспондентах, что обусловлено возвратов нескольких крупных депозитов клиентов-юридических лиц в связи с истечением срока действия, а также сворачивания счетов доходов и расходов, полученных и произведенных в течение 2 квартала. \r\n<br>Уменьшение стоимости активов на 01.07.2004 г. по сравнению с 01.04.2004 г. произошло за счет уменьшения остатков на счетах межфилиальых оборотов, что обусловлено обычным перераспределением ресурсов между филиалами и уменьшения остатков на счетах в банках-корреспондентах, что обусловлено возвратом нескольких крупных депозитов клиентов-юридических лиц в связи с истечением срока действия. \r\n<br>9.Дата появления факта (фактов), повлекшего разовое увеличение или уменьшение стоимости активов эмитента более чем на 10 процентов: 06.07.2004.\r\n<br>10.Стоимость активов эмитента на дату окончания отчетного периода (месяца, квартала, года), предшествующего отчетному периоду, в котором появился соответствующий факт (факты): 01.06.2004 г. - 2 440 931 тыс. руб., 01.04.2004 г. - 2 282 410 тыс. руб.\r\n<br>11.Стоимость активов эмитента на дату окончания отчетного периода (месяца, квартала, года) в котором появился соответствующий факт (факты) (01.07.2004 г.): 2 054 544 тыс. руб.\r\n<br>12.Изменение стоимости активов эмитента в абсолютном и процентном отношении: \r\n<br>по сравнению с 01.06.2004 г. - 386 387 тыс. руб. или 15,8%, по сравнению с 01.04.2004 г. - 227 866 тыс. руб. или 10,0%.\r\n<br>\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО)			М.В. Волков \r\n<br>\r\n<br>Главный бухгалтер                                    	 \r\n<br>Прио-Внешторгбанка (ОАО)			В.И. Коробко\r\n<br>\r\n<br>7 июля 2004 года'),
(14, '1', '2004-08-02', 'Расторжение договора с регистратором и утверждение нового регистратора\r\n<br>\r\nИнформация о принятых Советом директоров \r\n<br>Прио-Внешторгбанка (открытое акционерное общество) решениях:  о расторжении договора с регистратором,осуществляющим ведение реестров владельцев именных ценных бумаг эмитента, и об утверждении регистратора и условий договора с ним. </center>Полное фирменное наименование эмитента: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>Место нахождения: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>ИНН: 6227001779.\r\n<br>Уникальный код эмитента, присваиваемый регистрирующим органом: 1026200000111.\r\n<br>Адрес странице в сети “Интернет”, используемый эмитентом для опубликования информации: www.priovtb.com\r\n<br>Дата проведения заседания Совета директоров эмитента, на котором принято соответствующее решение: 02.08.2004 г.\r\n<br>Дата составления и номер протокола заседания Совета директоров эмитента, на котором принято соответствующее решение: № 5 от 02.08.2004 г.\r\n<br>Содержание решений, принятых советом директоров эмитента:\r\n<br>1. Расторгнуть по соглашению сторон со «02» сентября 2004 года договор на ведение и хранение реестра владельцев именных эмиссионных ценных бумаг ЦДФРЯЗ/ПВБ - №1 от «09» ноября 1999 года, заключенный между Банком и ОАО «Центральный Московский Депозитарий».\r\n<br>2. Утвердить нового регистратора – ЗАО «Учетная система» (лицензия на осуществление деятельности по ведению реестра, выданная ФКЦБ России 27.04.2004 г. № 10-000-1-00317, ОГРН 1037725008562). Место нахождения: г. Москва, 2-й Рощинский проезд, д.8, стр. 4.\r\n<br>Почтовый адрес: 105066, г. Москва, ул. Ольховская, д. 22 тел. (095) 263- 8180, 264-5623, 785-8110.\r\n<br>Утвердить условия договора с ЗАО «Учетная система» . Дата заключения  договора - 16.08.2004 года.\r\n<br>\r\n<br>\r\n<br>\r\n<br>Исполняющий обязанности\r\n<br>Председателя Правления, \r\n<br>Первый заместитель Председателя \r\n<br>Правления Прио-Внешторгбанка (ОАО)				А.А.Язев\r\n<br>\r\n<br>02 августа 2004 года\r\n<br>'),
(15, '1', '2004-10-07', 'Уменьшение стоимости активов\r\n<br>\r\nСообщение о существенном факте «Сведения о фактах, повлекших \r\n<br>разовое увеличение или уменьшение стоимости активов эмитента \r\n<br>более чем на 10 процентов»\r\n<br>1.Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2.Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3.Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4.Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5Код существенного факта: 0200212В06102004.\r\n<br>6.Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com.\r\n<br>7.Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости».\r\n<br>8.Факт (факты), повлекший разовое увеличение или уменьшение стоимости активов эмитента более чем на 10 процентов: уменьшение стоимости активов на 01.10.04 г. по сравнению с 01.09.2004 г. произошло за счет сворачивания счетов доходов и расходов на финансовые результаты.\r\n<br>9.Дата появления факта (фактов), повлекшего разовое увеличение или уменьшение стоимости активов эмитента более чем на 10 процентов: 06.10.2004.\r\n<br>10.Стоимость активов эмитента на дату окончания отчетного периода (месяца, квартала, года), предшествующего отчетному периоду, в котором появился соответствующий факт (факты) (01.09.2004 г.): 2 119 897 тыс. руб.\r\n<br>11.Стоимость активов эмитента на дату окончания отчетного периода (месяца, квартала, года) в котором появился соответствующий факт (факты) (01.10.2004 г.): 1 887 192 тыс. руб.\r\n<br>12.Изменение стоимости активов эмитента в абсолютном и процентном отношении: \r\n<br>-232 705 тыс. руб. или -11,0%.\r\n<br>\r\n<br>\r\n<br>Председатель Правления                         \r\n<br>Прио-Внешторгбанка (ОАО)			  <br>М.В. Волков 	 		\r\n<br>\r\n<br>Главный бухгалтер\r\n<br>Прио-Внешторгбанка (ОАО)		          <br>В.И.Коробко\r\n<br>\r\n<br>06 октября 2004 года\r\n<br>'),
(16, '1', '2004-10-08', 'Увеличение чистой прибыли\r\n<br>\r\nСообщение о существенном факте «Сведения о фактах, повлекших \r\n<br>разовое увеличение прибыли или убытков эмитента более чем на 10 процентов»\r\n<br>\r\n<br>1.Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2.Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3.Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4.Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5.Код существенного факта: 0300212В06102004.\r\n<br>6.Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактахwww.priovtb.com\r\n<br>7.Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости».\r\n<br>8.Факт (факты), повлекший разовое увеличение прибыли или убытков эмитента более чем на 10 процентов: увеличение чистой прибыли за третий квартал 2004 года по сравнению с итогами деятельности во втором квартале 2004 года произошло за счет:\r\n<br>-роста чистых процентных и аналогичных доходов, обусловленных сокращением объемов процентов, уплаченных по привлеченным средствам, а также увеличением полученных процентных доходов;\r\n<br>-сокращения прочих операционных расходов, прежде всего расходов по оплате труда. \r\n<br>9.Дата появления факта (фактов), повлекшего за собой разовое увеличение прибыли или убытков эмитента более чем на 10 процентов 06.10.2004.\r\n<br>10.Значение прибыли эмитента за отчетный период (2 квартал 2004 года), предшествующий отчетному периоду, в котором появился соответствующий факт -5 127 тыс. руб.\r\n<br>11.Значение прибыли эмитента за отчетный период (3 квартал 2004 года), в котором появился соответствующий факт -15 502 тыс. руб.\r\n<br>12.Изменение прибыли (убытков) эмитента в абсолютном и процентном отношении: 10 375 тыс. руб. или  202,4 %.\r\n<br>\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО)				<br>М.В.Волков\r\n<br>\r\n<br>\r\n<br>Главный бухгалтер		                                         Прио-Внешторгбанка (ОАО)		                В.И. Коробко		\r\n<br>\r\n<br>06 октября 2004 года\r\n<br>'),
(17, '1', '2004-12-06', 'Увеличение стоимости активов\r\n<br>Сообщение о существенном факте «Сведения о фактах, повлекших<br>разовое увеличение или уменьшение стоимости активов эмитента \r\n<br>более чем на 10 процентов»\r\n<br</center>>\r\n<br>1. Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2. Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3. Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4. Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5. Код существенного факта: 0200212В06122004.\r\n<br>6. Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com.\r\n<br>7. Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости».\r\n<br>8. Факт (факты), повлекший разовое увеличение или уменьшение стоимости активов эмитента более чем на 10 процентов: увеличение  стоимости активов на 01.12.04 г. по сравнению с 01.11.2004 г. произошло за счет роста остатков на счетах в Банке России, обусловленного, главным образом,    увеличением остатков привлеченных денежных средств; перераспределения ресурсов между филиалами, что вызвало увеличение остатков на счетах межфилиальных оборотов. \r\n<br>9. Дата появления факта (фактов), повлекшего разовое увеличение или уменьшение стоимости активов эмитента более чем на 10 процентов: 06.12.2004.\r\n<br>10. Стоимость активов эмитента на дату окончания отчетного периода (месяца, квартала, года), предшествующего отчетному периоду, в котором появился соответствующий факт (факты) (01.11.2004 г.): 1 989 422 тыс. руб.\r\n<br>11. Стоимость активов эмитента на дату окончания отчетного периода (месяца, квартала, года) в котором появился соответствующий факт (факты) (01.12.2004 г.): 2 470 577 тыс. руб.\r\n<br>12. Изменение стоимости активов эмитента в абсолютном и процентном отношении: \r\n<br>481 155 тыс. руб. или 24,2 %.\r\n<br>\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО)		М.В. Волков\r\n<br>\r\n<br>\r\n<br>Главный бухгалтер			В.И. Коробко		 \r\n<br>Прио-Внешторгбанка (ОАО)						\r\n<br>\r\n<br>06 декабря 2004 года\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>');
