(18, '1', '2005-01-14', 'Увеличение стоимости активов\r\n<br>\r\nСообщение о существенном факте «Сведения о фактах, повлекших \r\n<br>разовое увеличение или уменьшение стоимости активов эмитента \r\n<br>более чем на 10 процентов»\r\n<br>\r\n<br>1. Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2. Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3. Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4. Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5. Код существенного факта: 0200212В14012005.\r\n<br>6. Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com.\r\n<br>7. Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости».\r\n<br>8. Факт (факты), повлекший разовое увеличение или уменьшение стоимости активов эмитента более чем на 10 процентов: увеличение стоимости активов на 01.01.05 г. по сравнению с 01.01.2004 г. и 01.10.2004 г. произошло за счет: \r\n<br>- роста кредитного портфеля и остатков на счетах в Банке России, обусловленного главным образом, увеличением остатков привлеченных средств клиентов;\r\n<br>- перераспределения ресурсов между филиалами, что вызвало увеличение остатков на счетах межфилиальных оборотов.\r\n<br>9. Дата появления факта (фактов), повлекшего разовое увеличение или уменьшение стоимости активов эмитента более чем на 10 процентов: 14.01.2005.\r\n<br>10. Стоимость активов эмитента на дату окончания отчетного периода (месяца, квартала, года), предшествующего отчетному периоду, в котором появился соответствующий факт (факты) (01.01.2004 г.): 1 926 449 тыс. руб; (01.10.2004 г.): 1 887 192 тыс. руб.\r\n<br>11. Стоимость активов эмитента на дату окончания отчетного периода (месяца, квартала, года) 