(19, '1', '2005-01-14', 'Уменьшение чистой прибыли\r\n<br>\r\nО существенном факте «Сведения о фактах, повлекших \r\n<br>разовое увеличение прибыли или убытков эмитента более чем на 10 процентов»\r\n<br>\r\n<br>1. Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2. Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3. Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4. Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5. Код существенного факта: 0300212В14012005.\r\n<br>6. Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com .\r\n<br>7. Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости».\r\n<br>8. Факт (факты), повлекший разовое увеличение прибыли или убытков эмитента более чем на 10 процентов: уменьшение чистой прибыли за четвертый квартал 2004 года по сравнению с итогами деятельности в третьем квартале 2004 года произошло за счет увеличения величины резервов на возможные потери, ростом прочих операционных расходов (прежде всего эксплуатационных расходов) и сокращением чистых комиссионных доходов. Основными причинами роста прибыли за 2004 г. по сравнению с 2003 г. являются:\r\n<br>- рост чистых и аналогичных доходов, обусловленных опережающим ростом полученных процентных доходов;\r\n<br>- рост чистых комиссионных доходов,  обусловленных опережающим ростом комиссионных доходов.\r\n<br>9.  Дата появления факта (фактов), повлекшего за собой разовое увеличение прибыли или убытков эмитента более чем на 10 процентов 14.01.2005 г.\r\n<br>10. Значение прибыли эмитента за отчетный период, предшествующий отчетному периоду, в котором появился соответствующий факт: за 3 квартал 2004 года  15 502 тыс. руб., за 2003 год – 18 022 тыс. руб.\r\n<br>11. Значение прибыли эмитента за отчетный период, в котором появился соответствующий факт: 4 квартал 2004 года 11 336 тыс. руб., 2004 г. 37 161 тыс. руб.\r\n<br>12. Изменение прибыли (убытков) эмитента в абсолютном и процентном отношении:\r\n<br>- в 4 квартале 2004 г. по сравнению с 3 кварталом: - 4 166 тыс. руб. или – 26,9 %.\r\n<br>- в 2004 по сравнению с 2003 г.: + 19 138 тыс. руб. или + 106,2 %.\r\n<br>\r\n<br>\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО)      М.В. Волков \r\n<br>\r\n<br>\r\n<br>Главный бухгалтер   	      В.И. Коробко		 \r\n<br>Прио-Внешторгбанка (ОАО)						\r\n<br>\r\n<br>14 января 2005 года\r\n<br>'),
