>\r\n<br>\r\n<br>Главный бухгалтер		       В.И.Коробко		 \r\n<br>Прио-Внешторгбанка (ОАО)						\r\n<br>\r\n<br>06 апреля 2005 года\r\n<br>'),
(21, '1', '2005-04-13', 'Сведения о датах закрытия реестра \r\n<br>\r\nСообщение о существенном факте \r\n<br>“Сведения о датах закрытия реестра Прио-Внешторгбанка \r\n<br>(открытое акционерное общество)»\r\n<br>\r\n<br>1. Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2. Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3. Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4. Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5. Код существенного факта: 0800212В13042005.\r\n<br>6. Адрес страницы в сети “Интернет”, используемый эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com.\r\n<br>7. Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: газета “Рязанские ведомости”.\r\n<br>8. Вид, категория (тип), серия и иные идентификационные признаки именных ценных бумаг: обыкновенные бездокументарные именные акции Прио-Внешторгбанка (ОАО), государственный регистрационный номер 10200212В, привилегированные бездокументарные именные акции Прио-Внешторгбанка (ОАО), государственный регистрационный номер 20100212В.\r\n<br>9. Цель, для которой составляется список владельцев именных ценных бумаг: участие в годовом общем собрании акционеров Прио-Внешторгбанка (ОАО) и выплата дивидендов за 2004 г.\r\n<br>10. Дата на которую составляется список владельцев именных ценных бумаг: 14.04.2005 г.\r\n<br>11. Дата составления протокола заседания Совета директоров Прио-Внешторгбанка (ОАО) на котором принято решение о дате составления списка владельцев именных ценных бумаг эмитента: 13.04.2005 г.\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО) 		М.В. Волков\r\n<br>\r\n<br>13 апреля 2005 года.\r\n<br>\r\n<br>'),
(22, '1', '2005-04-13', 'Решение Совета директоров о созыве годового собрания\r\n<br>\r\nИнформация о принятых Советом директоров Прио-Внешторгбанка (открытое акционерное общество) решениях:о созыве годового общего собрания акционеров, утверждении повестки дня годового общего собрания акционеров Прио-Внешторгбанка (ОАО). \r\n<br>\r\n<br>Полное фирменное наименование эмитента: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>Место нахождения: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>ИНН: 6227001779.\r\n<br>Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>Адрес странице в сети “Интернет”, используемый эмитентом для опубликования информации: www.priovtb.com\r\n<br>Дата проведения заседания совета директоров эмитента, на котором принято соответствующее решение: 13.04.2005 г.\r\n<br>Дата составления и номер протокола заседания совета директоров эмитента, на котором принято соответствующее решение: № 3 от 13.04.2005 г.\r\n<br>Содержание решений, принятых советом директоров эмитента:\r\n<br>1. Провести годовое общее собрание акционеров Банка “21” мая 2005 года. Место проведения собрания: г. Рязань, пос. Солотча, ул. Монастырская, д.8. Начало регистрации 11-00, начало собрания - 12-00.\r\n<br>2. Утвердить следующую повестку годового общего собрания акционеров:\r\n<br>1. Утверждение годового отчета, годовой бухгалтерской отчетности, в том числе отчета о прибылях и убытках (счетов прибылей и убытков) Банка. \r\n<br>Отчет Ревизионной комиссии Банка.\r\n<br>2. Утверждение изменений и дополнений, вносимых в Устав:\r\n<br>- в части касающейся закрытых филиалов;\r\n<br>- в части дополнения компетенции Совета директоров.\r\n<br>Утверждение новой редакции «Положения о Правлении и Председателе Правления Прио-Внешторгбанка (ОАО)»\r\n<br>3. О внесении изменений и дополнений в Устав Прио-Внешторгбанка (ОАО) в части, касающейся изменения наименования Банка таким образом, чтобы из него было исключено слово «Внешторгбанк».\r\n<br>4. Поручение Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией изменений и дополнений, вносимых в Устав Банка.\r\n<br>5. Избрание членов Совета директоров Банка\r\n<br>- Ганишин Виктор Алексеевич,\r\n<br>- Дерещин Андрей Алексеевич,\r\n<br>- Ларионов Николай Михайлович,\r\n<br>- Мазаев Владимир Александрович,\r\n<br>- Маслова Наталья Владимировна,\r\n<br>- Черкашина Татьяна Арсентьевна.\r\n<br>6. Определение количественного состава и избрание членов Ревизионной комиссии Банка – три человека:\r\n<br>- Нечипоренко Мария Степановна – начальник отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r\n<br>- Ковзан Юлия Борисовна - главный бухгалтер отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r\n<br>- Куркина Юлия Евгеньевна - главный бухгалтер отдела ведения бухгалтерского учета и отчетности ООО «Амальгата».\r\n<br>7. Определение размера выплачиваемых членам Ревизионной комиссии вознаграждений. \r\n<br>8. Утверждение аудитора Банка: аудиторско - консультационная фирма «МИАН» г. Москва.\r\n<br>9. Распределение прибыли, в том числе выплата (объявление) дивидендов по результатам финансового года.\r\n<br> \r\n<br>\r\n<br>Председатель Правления \r\n<br>Прио-Внешторгбанка (ОАО)	    М.В. Волков\r\n<br>\r\n<br>13 апреля 2005 года.\r\n<br>'),
(23, '1', '2005-05-27', 'Решения годового собрания\r\n<br>\r\nСообщение о существенном факте "Сведения о решениях общих собраний"\r\n<br>\r\n<br>1. Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2. Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3. Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4. Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5. Код существенного факта: 1000212В26052005.\r\n<br>6. Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com.\r\n<br>7. Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости», «Приложение к Вестнику ФСФР»\r\n<br>8. Вид общего собрания (годовое, внеочередное) - годовое.\r\n<br>9. Форма проведения общего собрания: очная.\r\n<br>10. Дата и место проведения общего собрания: 21 мая 2005 года, г. Рязань, пос. Солотча, ул. Монастырская, 8.\r\n<br>11. Кворум общего собрания: 33 503 155 голосов, что составляет 95,86 % от общего количества обыкновенных акций. \r\n<br>12. Вопросы, поставленные на голосование, и итоги голосования по ним:\r\n<br>\r\n<br>1.Утвердить годовой отчет, годовую бухгалтерскую отчетность, в том числе отчет о прибылях и убытках (счета прибылей и убытков) Банка. Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 670 441 голос, что составляет 94,529 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>	- «ПРОТИВ» - нет;\r\n<br>	- «ВОЗДЕРЖАЛСЯ» - подано 1 832 714 голосов, что составляет 5,471 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций.\r\n<br>	Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>	\r\n<br>2. Утвердить изменения и дополнения, вносимые в Устав:\r\n<br>- в части касающейся закрытых филиалов;\r\n<br>- в части дополнения компетенции Совета директоров.\r\n<br>Утвердить новую редакцию «Положения о Правлении и Председателе Правления Прио-Внешторгбанка (ОАО)».\r\n<br>Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 670 441 голос, что составляет 94,529 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>	- «ПРОТИВ» - нет;\r\n<br>	- «ВОЗДЕРЖАЛСЯ» - подано 1 832 714 голосов, что составляет 5,471 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется три четверти голосов.\r\n<br>	\r\n<br>3. Внести изменения и дополнения в Устав Прио-Внешторгбанка (ОАО) в части, касающейся изменения наименования Банка таким образом, чтобы из него было исключено слово «Внешторгбанк».Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 1 832 714 голосов, что составляет 5,471 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>	- «ПРОТИВ» - 31 565 438 голосов, что составляет 94,216 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>	- «ВОЗДЕРЖАЛСЯ» - 105003 голоса, что составляет 0,313 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций.\r\n<br>	Для принятия решения по данному вопросу повестки дня требуется три четверти голосов.\r\n<br>	\r\n<br>4. Поручить Председателю Совета директоров Банка Ганишину Виктору Алексеевичу подписать ходатайства и другие документы, связанные с регистрацией изменений и дополнений, вносимых в устав Банка.Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 670 441 голос, что составляет 94,529 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>	- «ПРОТИВ» - нет;\r\n<br>	- «ВОЗДЕРЖАЛСЯ» - подано 1 832 714 голосов, что составляет 5,471 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>	\r\n<br>5. Избрать в члены Совета директоров Банка:\r\n<br>- Ганишина Виктора Алексеевича,\r\n<br>- Дерещина Андрея Алексеевича,\r\n<br>- Ларионова Николая Михайловича,\r\n<br>- Мазаева Владимира Александровича,\r\n<br>- Маслову Наталью Владимировну,\r\n<br>- Черкашину Татьяну Арсентьевну\r\n<br>голоса распределились следующим образом:\r\n<br>- Ганишин Виктор Алексеевич - подано 44 518 575 голосов;\r\n<br>- Дерещин Андрей Алексеевич – подано 9 163 570 голосов;\r\n<br>- Ларионов Николай Михайлович - подано 44 924 405 голосов;\r\n<br>	- Мазаев Владимир Александрович - подано 28 792 075 голосов;\r\n<br>- Черкашина Татьяна Арсентьевна – подано 11 325 575 голосов;\r\n<br>- Маслова Наталья Владимировна – подано 28 791 575 голосов.\r\n<br>\r\n<br>6. Определить количественный состав членов Ревизионной комиссии Банка – три человека и избрать:\r\n<br>- Нечипоренко Марию Степановну – начальник отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r\n<br>- Ковзан Юлию Борисовну - главный бухгалтер отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r\n<br>- Куркину Юлию Евгеньевну - главный бухгалтер отдела ведения бухгалтерского учета и отчетности ООО «Амальгата».\r\n<br>Голоса, принадлежащие членам Совета директоров Банка, членам Правления Банка, Председателю Правления Банка, не участвовали в подсчете голосов при подведении итогов голосования по шестому вопросу. \r\n<br>При подведении итогов голосования по шестому вопросу повестки дня, голоса распределились следующим образом:\r\n<br>- Нечипоренко Мария Степановна\r\n<br>- «ЗА» подано 10 883 022 голоса, что составляет 85,587 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>	- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» подано 1 832 714 голосов, что составляет 14,413 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>-  Ковзан Юлия Борисовна \r\n<br>- «ЗА» подано 10 883 022 голоса, что составляет 85,587 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>	- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» подано 1 832 714 голосов, что составляет 14,413 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>                  -     Куркина Юлия Евгеньевна \r\n<br>- «ЗА» подано 10 883 022 голоса, что составляет 85,587 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>	- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» подано 1 832 714 голосов, что составляет 14,413 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня.\r\n<br>\r\n<br>7. Определить размер выплачиваемых членам ревизионной комиссии вознаграждений: членам Ревизионной комиссии – три тысячи рублей в год, Председателю Ревизионной комиссии пять тысяч рублей в год.Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 670 441 голос, что составляет 94,529 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>	- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - подано 1 832 714 голосов, что составляет 5,471 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>\r\n<br>8. Утвердить аудитором Банка: аудиторско-консультационную фирму "МИАН" г. Москва. Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 670 441 голос, что составляет 94,529 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>	- «ПРОТИВ» - нет;\r\n<br>	- «ВОЗДЕРЖАЛСЯ» - подано 1 832 714 голосов, что составляет 5,471 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>\r\n<br>9. Утвердить распределение прибыли по результатам финансового года. Дивиденды за 2004 год по обыкновенным акциям Банка не выплачивать, по привилегированным акциям Банка выплатить 15 процентов от номинальной стоимости акции. Голоса распределились следующим образом:\r\n<br>- «ЗА» подано 31 565 438 голосов, что составляет 94,216 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>	- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - подано 1 937 717 голосов, что составляет 5,784 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>\r\n<br>13. Формулировки решений, принятых общим собранием:\r\n<br>\r\n<br>1. Утвердить годовой отчет, годовую бухгалтерскую отчетность, в том числе отчет о прибылях и убытках (счета прибылей и убытков) Банка. \r\n<br>\r\n<br>2. Утвердить изменения и дополнения, вносимых в Устав:\r\n<br>- в части касающейся закрытых филиалов;\r\n<br>- в части дополнения компетенции Совета директоров.\r\n<br>Утвердить новую редакцию «Положения о Правлении и Председателе Правления Прио-Внешторгбанка (ОАО)».\r\n<br>\r\n<br>3. Поручить Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией изменений и дополнений, вносимых в Устав Банка.\r\n<br>\r\n<br> 4. Избрать в члены Совета директоров Банка:\r\n<br>- Ганишина Виктора Алексеевича,\r\n<br>- Ларионова Николая Михайловича,\r\n<br>- Мазаева Владимира Александровича,\r\n<br>- Черкашину Татьяну Арсентьевну,\r\n<br>- Маслову Наталью Владимировну. \r\n<br>Предоставить Председателю Правления Банка Волкову Михаилу Владимировичу право подписания уведомления об избрании членов Совета директоров Банка.\r\n<br>\r\n<br>5. В члены Ревизионной комиссии Банка избраны следующие лица:\r\n<br>- Нечипоренко Мария Степановна \r\n<br>-    Ковзан Юлия Борисовна \r\n<br>- Куркина Юлия Евгеньевна \r\n<br>\r\n<br>6. Определить размер выплачиваемых членам ревизионной комиссии вознаграждений: членам Ревизионной комиссии – три тысячи рублей в год, Председателю Ревизионной комиссии пять тысяч рублей в год.\r\n<br>\r\n<br>7. Утвердить аудитором Банка: аудиторско-консультационную фирму "МИАН" г. Москва. \r\n<br>\r\n<br>8. Утвердить распределение прибыли по результатам финансового года. Дивиденды за 2004 год по обыкновенным акциям Банка не выплачивать, по привилегированным акциям Банка выплатить 15 процентов от номинальной стоимости акции. \r\n<br>\r\n<br>Итоги голосования на общем годовом собрании акционеров подводились 26 мая 2005 года (протокол №3 заседания счетной комиссии).\r\n<br>\r\n<br>\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО)		М.В. Волков\r\n<br>\r\n<br>27 мая 2005 года\r\n<br>\r\n<br>'),
(24, '1', '2005-05-27', 'Исполнениеи обязательств по выплате дивидендов\r\n<br>\r\nСообщение о существенном факте "Сведения о начисленных и (или) выплаченных доходах по ценным бумагам эмитента"\r\n<br>\r\n<br>1. Полное фирменное наименование эмитента с указанием организационно-правовой формы: Прио-Внешторгбанк (открытое акционерное общество).\r\n<br>2. Место нахождения эмитента: 390023, г. Рязань, ул. Есенина, д. 82/26.\r\n<br>3. Присвоенный эмитенту налоговыми органами идентификационный номер налогоплательщика: 6227001779.\r\n<br>4. Уникальный код эмитента, присваиваемый регистрирующим органом: 00212В.\r\n<br>5. Код существенного факта: 0600212В26052005.\r\n<br>6. Адрес страницы в сети "Интернет", используемой эмитентом для опубликования сообщений о существенных фактах: www.priovtb.com.\r\n<br>7. Название периодического печатного издания, используемого эмитентом для опубликования сообщений о существенных фактах: «Рязанские ведомости», «Приложение к Вестнику ФСФР».\r\n<br>8. Вид, категория (тип), серия и иные идентификационные признаки ценных бумаг: привилегированные бездокументарные именные акции Прио-Внешторгбанка (ОАО).\r\n<br>9. Государственный регистрационный номер выпуска (дополнительного выпуска) ценных бумаг, дата государственной регистрации: 20100212В.\r\n<br>10. Наименование регистрирующего органа, осуществившего государственную регистрацию выпуска (дополнительного выпуска) ценных бумаг: Главное управление Центрального банка Российской Федерации по Рязанской области.\r\n<br>11. Орган управления эмитента, принявший решение о выплате (объявлении) дивидендов по акциям эмитента или определении размера (порядка определения размера) процента (купона) по облигациям эмитента, дата принятия указанного решения и дата составления протокола собрания (заседания) указанного органа, на котором принято указанное решение: годовое общее собрание акционеров Прио-Внешторгбанка (ОАО), дата принятия решения 21.05.2005 г., дата составления протокола 26.05.2005 г.\r\n<br>12. Общий размер дивидендов, начисленных на акции эмитента определенной категории (типа), и размер дивиденда, начисленного на одну акцию определенной категории (типа): общий размер процентов и (или) иного дохода, подлежащего (подлежавшего) выплате по облигациям эмитента определенного выпуска (серии), и размер процентов и (или) иного дохода, подлежащего (подлежавшего) выплате по одной облигации эмитента определенного выпуска (серии): Общий размер дивидендов – 2250 рублей, размер дивиденда на одну акцию 15 % от номинальной стоимости или 15 копеек на одну привилегированную бездокументарную именную акцию. \r\n<br>13. Форма выплаты доходов по ценным бумагам эмитента (денежные средства, иное имущество): денежные средства.\r\n<br>14. Дата, в которую обязательство по выплате доходов по ценным бумагам эмитента (дивиденды по акциям, доходы (проценты, номинальная стоимость) по облигациям) должно быть исполнено, а в случае, если обязательство по выплате доходов по ценным бумагам должно быть исполнено эмитентом в течение определенного срока (периода времени) - дата окончания этого срока: 20.07.2005 г.\r\n<br>15. Общий размер дивидендов, выплаченных по акциям эмитента определенной категории (типа); общий размер процентов и (или) иного дохода, выплаченного по облигациям эмитента определенного выпуска (серии): 2250 рублей по привилегированным бездокументарным именным акциям.\r\n<br>\r\n<br>Председатель Правления\r\n<br>Прио-Внешторгбанка (ОАО) 			М.В. Волков\r\n<br>\r\n<br>27 мая 2005 года\r\n<br>');
