(25, '1', '2005-06-07', 'Решение Совета директоров об образовании единоличного и/или коллегиального исполнительных органов\r\n<br>\r\nСообщение о сведениях,\r\n<br> которые могут оказать существенное влияние на стоимость ценных бумаг\r\n<br>акционерного общества\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Информация о принятом Советом директоров Прио-Внешторгбанка (ОАО)                                                                                            решении: об образовании единоличного и/или коллегиального исполнительных органов.\r\n<br>2.2. Дата проведения заседания Совета директоров Банка, на котором принято соответствующее решение	07 июня 2005 г.\r\n<br>2.3. Дата составления и номер протокола заседания Совета директоров Банка, на котором принято соответствующее решение	07 июня 2005г. № 4\r\n<br>2.4. Содержание решений, принятых Советом директоров Банка: п. 4. Избрать Председателем Правления Банка Волкова Михаила Владимировича; п. 5. Определить численный состав Правления Банка в количестве восьми членов; п. 6. Утвердить следующий состав Правления Банка: 1.	Волков М.В.2.	Язев А.А.3.	Силкина Е.Н.         4.	Еременко Ю.И.5.	Анашкина Л.М.6.	Мясников А.А.7.	Терентьева Н.Г.8.	Мельников С.В.;Назначить первым заместителем Председателя Правления Банка Язева А.А., заместителями Председателя Правления Банка Силкину Е.Н., Анашкину Л.М., Еременко Ю.И., Мясникова А.А.\r\n<br>2.5. Дополнительные сведения: Фамилия, имя, отчество лица, утвержденного членом Правления Банка, избранного Председателем Правления Банка: Волков Михаил Владимирович,доля участия данного лица в уставном капитале Банка: 0,77 %,доля принадлежащих данному лицу обыкновенных акций Банка: 0,77 %.Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного первым заместителем Председателя Правления Банка: Язев Алексей Алексеевич,доля участия данного лица в уставном капитале Банка: 0,75 %,доля принадлежащих данному лицу обыкновенных акций Банка 0,75 %.Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка:Силкина Елена Николаевна,доля участия данного лица в уставном капитале Банка: 0,04 %,доля принадлежащих данному лицу обыкновенных акций Банка 0,04 %.Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка: Еременко Юрий Иванович,доля участия данного лица в уставном капитале Банка: доли не имеет,доля принадлежащих данному лицу обыкновенных акций Банка: доли не имеет.Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка: Анашкина Людмила Михайловна,доля участия данного лица в уставном капитале Банка: доли не имеет,доля принадлежащих данному лицу обыкновенных акций Банка: доли не имеет.\r\n<br>Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка: Мясников Алексей Александрович,доля участия данного лица в уставном капитале Банка: 0, 00043 %, доля принадлежащих данному лицу обыкновенных акций Банка: 0, 00043 %.Фамилия, имя, отчество лица, утвержденного членом Правления Банка:Терентьева Наталья Григорьевна,доля участия данного лица в уставном капитале Банка: 0,00005 %,доля принадлежащих данному лицу обыкновенных акций Банка: 0,00005 %.Фамилия, имя, отчество лица, утвержденного членом Правления Банка:Мельников Сергей Владимирович,доля участия данного лица в уставном капитале Банка: доли не имеет,доля принадлежащих данному лицу обыкновенных акций Банка: доли не имеет. Доля участия указанных лиц в уставном капитале дочерних и зависимых обществ акционерного общества, а в случае, когда такими дочерними и /или зависимыми обществами являются акционерные общества, -также доля принадлежащих указанным лицам обыкновенных акций дочерних и /или зависимых обществ акционерного общества: дочерние и/или зависимые общества Банка отсутствуют.Доля обыкновенных акций акционерного общества и/или его дочерних и зависимых обществ, которая может быть приобретена указанными лицами в результате осуществления прав по предоставленным указанным лицам опционам эмитента и/или его дочерних и зависимых обществ: опционы Банка и/или его дочерних и зависимых обществ отсутствуют.\r\n<br>\r\n<br>3. Подпись\r\n<br>3.1. Председатель Правления       Прио-Внешторгбанка (ОАО)           _________________         М.В. Волков 3.2. Дата “ 07 ” июня 2005г.                              М.П.\r\n<br>\r\n<br>'),
