(34, '1', '2006-03-15', 'Сведения о датах закрытия реестра\r\n<br>\r\n<br>Сообщение о существенном факте\r\n<br>“Сведения о датах закрытия реестра эмитента”\r\n<br>\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента\r\n<br>390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	\r\n<br>“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>1.9. Код существенного факта 	0800212В15032006\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Вид, категория (тип), серия и иные идентификационные признаки именных ценных бумаг: обыкновенные бездокументарные именные акции Прио-Внешторгбанка (ОАО), государственный регистрационный номер 10200212В; привилегированные бездокументарные именные акции Прио-Внешторгбанка (ОАО), государственный регистрационный номер 20100212В.\r\n<br>2.2  Цель, для которой составляется список владельцев именных ценных бумаг: участие в годовом общем собрании акционеров Прио-Внешторгбанка (ОАО) и выплата дивидендов за 2005 г.\r\n<br>2.3.  Дата на которую составляется список владельцев именных ценных бумаг: 16.03.2006 г.\r\n<br>2.4. Дата составления протокола заседания Совета директоров Прио-Внешторгбанка (ОАО) №3 на котором принято решение о дате составления списка владельцев именных ценных бумаг эмитента: 15.03.2006 г.\r\n<br>\r\n<br>3. Подписи\r\n<br>3.1. Председатель Правления       Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков \r\n<br>3.2. Дата “ 