(35, '1', '2006-03-15', 'Решение Совета директоров о созыве годового собрания\r\n\r\n<br>Сообщение о сведениях, \r\n<br>которые могут оказать существенное влияние на стоимость ценных бумаг\r\n<br> акционерного общества\r\n<br>\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	\r\n<br>390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>Информация о принятых Советом директоров Прио-Внешторгбанка (открытое акционерное общество) решениях: \r\n<br>о созыве годового общего собрания акционеров, \r\n<br>утверждении повестки дня годового общего собрания акционеров Прио-Внешторгбанка (ОАО), \r\n<br>о рекомендациях по размеру выплачиваемого дивиденда по акциям:\r\n<br>Дата проведения заседания совета директоров эмитента, на котором принято соответствующее решение: 15.03.2006 г.\r\n<br>Дата составления и номер протокола заседания совета директоров эмитента, на котором принято соответствующее решение: № 3 от 15.03.2006 г.\r\n<br>Содержание решений, принятых советом директоров эмитента:\r\n<br>1. Провести годовое общее собрание акционеров Банка «22» апреля 2006 года. Место проведения собрания: г. Рязань, пос. Солотча, ул. Монастырская, д. 8. Начало регистрации 11-00, начало собрания - 12-00.\r\n<br>2. Утвердить следующую повестку годового общего собрания акционеров:\r\n<br>1.	Утверждение годового отчета, годовой бухгалтерской отчетности, в том числе отчета о прибылях и убытках (счетов прибылей и убытков) Банка. \r\n<br>2.	Утверждение устава Банка в новой редакции.\r\n<br>3.	Поручение Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией новой редакции устава Банка.\r\n<br>4.	Избрание членов Совета директоров Банка\r\n<br>- Ганишин Виктор Алексеевич,\r\n<br>- Ларионов Николай Михайлович,\r\n<br>- Мазаев Владимир Александрович,\r\n<br>- Маслова Наталья Владимировна,\r\n<br>- Черкашина Татьяна Арсентьевна.\r\n<br>5.	Определение количественного состава и избрание членов Ревизионной комиссии Банка – три человека:\r\n<br>-	Нечипоренко Мария Степановна – начальник отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r\n<br>-	 Куличкова Галина Михайловна - заместитель начальника отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r\n<br>-	Ковзан Юлия Борисовна - главный бухгалтер отдела ведения бухгалтерского учета и отчетности ООО «Амальгата».\r\n<br>6.	Определение размера выплачиваемых членам Ревизионной комиссии вознаграждений. \r\n<br>7.	Определение количественного и персонального состава Счетной комиссии Банка.\r\n<br>8.	Утверждение аудитора Банка: аудиторско - консультационная фирма «МИАН» г. Москва.\r\n<br>9.	Распределение прибыли, в том числе выплата (объявление) дивидендов по результатам финансового года. \r\n<br>10.	Одобрение сделки, в совершении которой имеется заинтересованность.\r\n<br>3. Предложить годовому общему собранию акционеров: считать нецелесообразным выплату дивидендов за 2005 год по обыкновенным акциям Банка, по привилегированным акциям Банка выплатить 15 процентов от номинальной стоимости.\r\n<br>\r\n<br>3. Подписи\r\n<br>3.1. Председатель Правления       Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков \r\n<br>3.2. Дата “ 15 ” марта 2006г.                              М.П.                                                      \r\n<br>\r\n<br>'),
(36, '1', '2006-04-06', 'Уменьшение чистой прибыли\r\n<br>\r\nСообщение о существенном факте\r\n<br>“Сведения о фактах, повлекших разовое увеличение (уменьшение) чистой\r\n<br>прибыли или чистых убытков эмитента более чем на 10 процентов”\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>1.9. Код существенного факта	0300212В06042006\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Факты, повлекшие разовое уменьшение более чем на 10 процентов чистой прибыли эмитента за 1 кв 2006г. по сравнению с 4 кв. 2005 г.: \r\n<br>-	рост процентных расходов, обусловленный выплатой процентов по окончании срока действия вкладов «Лидер» (вклад, посвященный 15-летию Банка), \r\n<br>-	рост административно-управленческих расходов, связанный с повышением с 01.01.2006 г. заработной платы  сотрудникам Банка и выплатой премии по итогам 2005 года. \r\n<br>2.2. Дата появления факта, повлекшего за собой разовое увеличение чистой прибыли эмитента более чем на 10 процентов: “06” апреля 2006г.\r\n<br>2.3. Значение чистой прибыли эмитента за отчетный период, предшествующий отчетному периоду, в котором появился соответствующий факт (4 квартал 2006г.): 42 746 тыс.руб. \r\n<br>2.4. Значение чистой прибыли эмитента за отчетный период, в котором появились соответствующие факты (1 квартал 2006г.): 10 709 тыс.руб.\r\n<br>2.5. Изменение чистой прибыли эмитента в абсолютном и процентном отношении: уменьшение  на 32 037 тыс.руб. или на 74,9%.\r\n<br>\r\n<br>3. Подписи\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         М.В. Волков 3.2. Дата “ 06 ” апреля 2006г.                              М.П.\r\n<br>3.3. Главный бухгалтер       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         В. И. Коробко 3.4. Дата “ 06 ” апреля 2006г.                              \r\n<br>\r\n<br>'),
(37, '1', '2006-04-25', 'Принятие решения о выплате дивидендов\r\n<br>\r\nСообщение о существенном факте\r\n<br>“Сведения о начисленных и (или) выплаченных доходах по ценным бумагам эмитента”\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>1.9. Код существенного факта 	0600212В25042006\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Вид, категория (тип), серия и иные идентификационные признаки ценных бумаг: акции привилегированные именные бездокументарные.\r\n<br>2.2.	Государственный регистрационный номер выпуска ценных бумаг: 20100212В, дата государственной регистрации: 25.12.1992г. зарегистрирован выпуск в объеме 5000 руб. и 29.03.1996г. зарегистрирован выпуск в объеме 10000 руб.\r\n<br>2.3.	Наименование регистрирующего органа, осуществившего государственную регистрацию выпуска ценных бумаг: Главное управление Центрального Банка Российской Федерации по Рязанской области.\r\n<br>2.4.	Орган управления, принявший решение о выплате дивидендов по акциям: годовое общее собрание акционеров Прио-Внешторгбанка (ОАО).\r\n<br>2.5.	Дата принятия решения о выплате дивидендов по акциям: 22.04.2006г.\r\n<br>2.6.	Дата составления протокола годового общего собрания акционеров Прио-Внешторгбанка (ОАО), на котором принято решение о выплате дивидендов по акциям: 25.04.2006г.\r\n<br>2.7.	Общий размер дивидендов, начисленных на акции привилегированные именные бездокументарные: 2250 рублей; размер дивиденда, начисленного на одну акцию привилегированную именную бездокументарную: 15 % от номинальной стоимости или 15 копеек на одну акцию.\r\n<br>2.8.	Форма выплаты доходов по ценным бумагам: денежные средства.\r\n<br>2.9.	Дата окончания срока, в течение которого обязательство по выплате дивидендов по акциям должно быть исполнено: 21.06.2006г.                                      \r\n<br>\r\n<br>3. Подпись\r\n<br>3.1. Председатель Правления       Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков                                                                            (подпись)\r\n<br>3.2. Дата “25” апреля 2006г.                              М.П.\r\n<br>\r\n<br>'),
(38, '1', '2006-04-25', 'Решения годового собрания акционеров\r\n<br>\r\nСообщение о существенном факте\r\n<br>“Сведения о решениях общих собраний”\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>1.9. Код существенного факта 	1000212В25042006\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1.  Вид общего собрания: годовое.\r\n<br>2.2.	Форма проведения общего собрания: очная.\r\n<br>2.3.	Дата и место проведения общего собрания: 22 апреля 2006г., г. Рязань, пос. Солотча, ул. Монастырская, д. 8.\r\n<br>2.4.	Кворум общего собрания: 31 889 112 голосов, что составляет 91,24 % от общего количества обыкновенных акций. \r\n<br>2.5.	Вопросы, поставленные на голосование и итоги голосования по ним:\r\n<br>1.	Утвердить годовой отчет, годовую бухгалтерскую отчетность, в том числе отчет о прибылях и убытках (счета прибылей и убытков) Банка. Голоса распределились следующим образом:\r\n<br>-	«ЗА» подано 31 889 112 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>-	«ПРОТИВ» - нет;\r\n<br>-	«ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>2.	Утвердить новую редакцию Устава Банка. Голоса распределились следующим образом:\r\n<br>-	«ЗА» подано 31 889 112 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>-	«ПРОТИВ» - нет;\r\n<br>-	«ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется три четверти голосов.\r\n<br>3.	Поручить Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией новой редакции устава Банка. Голоса распределились следующим образом:\r\n<br>-	«ЗА» подано 31 889 112 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>-	«ПРОТИВ» - нет;\r\n<br>-	«ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>4.	Избрать в члены Совета директоров Банка:\r\n<br>-	Ганишина Виктора Алексеевича,\r\n<br>-	Ларионова Николая Михайловича,\r\n<br>-	Мазаева Владимира Александровича,\r\n<br>-	Маслову Наталью Владимировну,\r\n<br>-	Черкашину Татьяну Арсентьевну.                \r\n<br>В подсчете результатов голосования по четвертому вопросу принимали участие 11 бюллетеней, количество голосов: 159 445 560, голоса распределились следующим образом:\r\n<br>-	Ганишин Виктор Алексеевич - подано 44 470 028 голосов;\r\n<br>-	Ларионов Николай Михайлович - подано 45 306 248 голосов;	\r\n<br>-	Мазаев Владимир Александрович - подано 46 479 428 голосов;\r\n<br>-	Черкашина Татьяна Арсентьевна – подано 11 578 928 голосов;\r\n<br>-	Маслова Наталья Владимировна – подано 11 610 928 голосов.\r\n<br>5.	Определить количественный состав членов Ревизионной комиссии Банка – три человека и избрать:\r\n<br>-	Нечипоренко Марию Степановну – начальника отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r\n<br>-	Куличкову Галину Михайловну - заместителя начальника отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r\n<br>-	Ковзан Юлию Борисовну - главного бухгалтера отдела ведения бухгалтерского учета и отчетности ООО «Амальгата».\r\n<br>Голоса, принадлежащие членам Совета директоров Банка, членам Правления Банка, Председателю Правления Банка, не участвовали в подсчете голосов при подведении итогов голосования по пятому вопросу. Голоса распределились следующим образом:\r\n<br>Нечипоренко Мария Степановна\r\n<br>-	«ЗА» подано 11 031 372 голоса, что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>-	«ПРОТИВ» - нет;\r\n<br>-	«ВОЗДЕРЖАЛСЯ» - нет;\r\n<br>Куличкова Галина Михайловна\r\n<br>-	«ЗА» подано 11 031 372 голоса, что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>-	 «ПРОТИВ» - нет;\r\n<br>-	«ВОЗДЕРЖАЛСЯ» - нет;\r\n<br>Ковзан Юлия Борисовна \r\n<br>-	«ЗА» подано 11 031 372 голоса, что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>-	«ПРОТИВ» - нет;\r\n<br>-	«ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>6.	Определение размера  выплачиваемых членам ревизионной комиссии вознаграждений. Голоса распределились следующим образом:\r\n<br>-	«ЗА» подано 31 889 112 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>-	«ПРОТИВ» - нет;\r\n<br>-	«ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>7.	Избрать Счетную комиссию Банка в количестве  4 человек:\r\n<br>-	Гусеву Юлию Викторовну,\r\n<br>-	Лядову Елену Ивановну,\r\n<br>-	Маркову Наталию Аркадьевну,\r\n<br>-	Орехову Ирину Васильевну.\r\n<br>Голоса распределились следующим образом:\r\n<br>-	«ЗА» подано 31 889 112 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>-	«ПРОТИВ» - нет;\r\n<br>-	«ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>8.	Утвердить аудитором Банка: аудиторско-консультационную фирму "МИАН" г. Москва. Голоса распределились следующим образом:\r\n<br>-	«ЗА» подано 31 889 112 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>-	«ПРОТИВ» - нет;\r\n<br>-	«ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>9.	Распределить прибыль, в том числе выплата (объявление) дивидендов по результатам финансового года. Голоса распределились следующим образом:\r\n<br>-	«ЗА» подано 31 889 112 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>-	«ПРОТИВ» - нет;\r\n<br>-	«ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>10.	Одобрить сделку, в совершении которой имеется заинтересованность. Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов лиц, не заинтересованных в совершении обществом сделки. Число голосов, которыми по указанному вопросу обладали все лица, включенные в список лиц, имеющих право на участие в общем собрании, не заинтересованные в совершении обществом сделки, составляет 14 639 816. Число голосов, которыми по указанному вопросу обладали все лица, не заинтересованные в совершении обществом сделки, принявшие участие в общем собрании, составляет 11 578 928. Кворум имеется. Голоса распределились следующим образом:\r\n<br>-	«ЗА» подано 11 578 928 голосов, что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня; \r\n<br>-	«ПРОТИВ» - нет;\r\n<br>-	«ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>2.6.	Формулировки решений, принятых общим собранием:\r\n<br>1.	Утвердить годовой отчет, годовую бухгалтерскую отчетность, в том числе отчет о прибылях и убытках (счетов прибылей и убытков) Банка.\r\n<br>2.	Утвердить устав Банка в новой редакции.\r\n<br>3.	Поручить Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией новой редакции устава Банка.\r\n<br>4.	В члены Совета директоров Банка избраны следующие лица: \r\n<br>-	Ганишин Виктор Алексеевич,\r\n<br>-	Ларионов Николай Михайлович,\r\n<br>-	Мазаев Владимир Александрович,\r\n<br>-	Черкашина Татьяна Арсентьевна,\r\n<br>-	Маслова Наталья Владимировна.              \r\n<br>Предоставить Председателю Правления Банка Волкову Михаилу Владимировичу право подписания уведомления об избрании членов Совета директоров Банка.\r\n<br>5.	В члены Ревизионной комиссии Банка избраны следующие лица:\r\n<br>-	Нечипоренко Мария Степановна;\r\n<br>-	Куличкова Галина Михайловна;\r\n<br>-	Ковзан Юлия Борисовна.\r\n<br>6.	Определить размер выплачиваемых членам Ревизионной комиссии вознаграждений: членам Ревизионной комиссии – три тысячи рублей в год, Председателю Ревизионной комиссии пять тысяч рублей в год.\r\n<br>7.	Избрана Счетная комиссия Банка в количестве 4 человек:\r\n<br>-	Гусева Юлия Викторовна,\r\n<br>-	Лядова Елена Ивановна,\r\n<br>-	Маркова Наталия Аркадьевна,\r\n<br>-	Орехова Ирина Васильевна.\r\n<br>8.	Утвердить аудитора Банка: аудиторско - консультационную фирму «МИАН» г. Москва.\r\n<br>9.	Утвердить предложение по распределению прибыли Банка за 2005 год. Считать нецелесообразным выплату дивидендов за 2005 год по обыкновенным акциям Банка, по привилегированным акциям Банка выплатить 15 процентов от номинальной стоимости.\r\n<br>10.	Одобрить заключение договора аренды недвижимого имущества между ООО «Санта» и Банком на следующих условиях: нежилое помещение Н2, лит. Б, назначение – торговое, общая площадь 73, 2 кв.м., кадастровый (или условный) номер объекта: 62-62-013792005-167, расположенного по адресу: г. Рязань, ул. Первомайский проспект, д. 34, срок договора аренды – 5 лет.Ежемесячная арендная плата на 2006 год в размере 750 (Семьсот пятьдесят) рублей за 1 кв.м. В 2007 году и последующих годах ежемесячная арендная плата будет рассчитываться по формуле:                 \r\n<br>S =  Т х К , где\r\n<br>S- ставка арендной платы  в 2007 году и последующих годах;\r\n<br>Т- ставка арендной платы, действовавшая в соответствии с настоящим договором по состоянию на декабрь предшествующего года;\r\n<br>К- годовой индекс инфляции ( индекс потребительских цен), сообщаемый Федеральной службой государственной статистики РФ.                                    \r\n<br>\r\n<br>3. Подпись\r\n<br>3.1. Председатель Правления       Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков                                                                            (подпись)\r\n<br>3.2. Дата “25” апреля 2006г.                              М.П.\r\n<br>\r\n<br>'),
(39, '1', '2006-05-05', 'Истечение срока полномочий Правления\r\n<br>\r\nСообщение о сведениях,\r\n<br> которые могут оказать существенное влияние на стоимость ценных бумаг\r\n<br>акционерного общества \r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Об истечении срока полномочий единоличного и/или членов коллегиального исполнительных органов.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Волков Михаил Владимирович,\r\n<br>должность данного лица: Председатель Правления, \r\n<br>доля участия данного лица в уставном капитале Банка: 0,77 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,77 %,\r\n<br>дата истечения полномочий данного лица “05” мая 2006г. \r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Язев Алексей Алексеевич,\r\n<br>должность данного лица: член Правления, Первый заместитель Председателя Правления, \r\n<br>доля участия данного лица в уставном капитале Банка: 0,75 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,75 %,\r\n<br>дата истечения полномочий данного лица “05” мая 2006г.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Силкина Елена Николаевна,\r\n<br>должность данного лица: член Правления, заместитель Председателя Правления – начальник операционного управления, \r\n<br>доля участия данного лица в уставном капитале Банка: 0, 04 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,04 %,\r\n<br>дата истечения полномочий данного лица “05” мая 2006г.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Еременко Юрий Иванович,\r\n<br>должность данного лица: член Правления, заместитель Председателя Правления, \r\n<br>доля участия данного лица в уставном капитале Банка: доли не имеет,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: доли не имеет,\r\n<br>дата истечения полномочий данного лица “05” мая 2006г.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Анашкина Людмила Михайловна,\r\n<br>должность данного лица: член Правления, заместитель Председателя Правления, директор Московского филиала, \r\n<br>доля участия данного лица в уставном капитале Банка: доли не имеет,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: доли не имеет,\r\n<br>дата истечения полномочий данного лица “05” мая 2006г.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Мясников Алексей Александрович,\r\n<br>должность данного лица: член Правления, заместитель Председателя Правления – начальник управления международных операций, \r\n<br>доля участия данного лица в уставном капитале Банка: 0,00043 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,00043 %,\r\n<br>дата истечения полномочий данного лица “05” мая 2006г.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Терентьева Наталья Григорьевна,\r\n<br>должность данного лица: член Правления – начальник управления ценных бумаг и пассивных операций,\r\n<br>доля участия данного лица в уставном капитале Банка: 0,00008 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,00005 %.\r\n<br>дата истечения полномочий данного лица “05” мая 2006г.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Мельников Сергей Владимирович,\r\n<br>должность данного лица: