(40, '1', '2006-05-05', 'Решение Совета директоров об образовании единоличного и коллегиального исполнительных органов\r\n<br>\r\nСообщение о сведениях,\r\n<br> которые могут оказать существенное влияние на стоимость ценных бумаг\r\n<br>акционерного общества\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Информация о принятом Советом директоров Прио-Внешторгбанка (ОАО)                                                                   решении: \r\n<br>об образовании единоличного и/или коллегиального исполнительных органов.\r\n<br>2.2. Дата проведения заседания Совета директоров Банка, на котором принято соответствующее решение	\r\n<br>05 мая 2006 г.\r\n<br>2.3. Дата составления и номер протокола заседания Совета директоров Банка, на котором принято соответствующее решение	\r\n<br>05 мая 2006г. № 5\r\n<br>2.4. Содержание решений, принятых Советом директоров Банка: \r\n<br>п. 4. Избрать Председателем Правления Банка Волкова Михаила Владимировича; п. 5. Определить численный состав Правления Банка в количестве восьми членов; \r\n<br>п. 6. Утвердить следующий состав Правления Банка: \r\n<br>1.	Волков М.В.\r\n<br>2.	Язев А.А.\r\n<br>3.	Силкина Е.Н.         \r\n<br>4.	Еременко Ю.И.\r\n<br>5.	Анашкина Л.М.\r\n<br>6.	Мясников А.А.\r\n<br>7.	Терентьева Н.Г.\r\n<br>8.	Мельников С.В.;\r\n<br>Назначить первым заместителем Председателя Правления Банка Язева А.А., заместителями Председателя Правления Банка Силкину Е.Н., Анашкину Л.М., Еременко Ю.И., Мясникова А.А.\r\n<br>2.5. Дополнительные сведения: \r\n<br>Фамилия, имя, отчество лица, утвержденного членом Правления Банка, избранного Председателем Правления Банка: \r\n<br>Волков Михаил Владимирович,\r\n<br>доля участия данного лица в уставном капитале Банка: 0,77 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,77 %.\r\n<br>Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного первым заместителем Председателя Правления Банка: \r\n<br>Язев Алексей Алексеевич,\r\n<br>доля участия данного лица в уставном капитале Банка: 0,75 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка 0,75 %.\r\n<br>Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка:\r\n<br>Силкина Елена Николаевна,\r\n<br>доля участия данного лица в уставном капитале Банка: 0,04 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка 0,04 %.\r\n<br>Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка: \r\n<br>Еременко Юрий Иванович,\r\n<br>доля участия данного лица в уставном капитале Банка: доли не имеет,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: доли не имеет.\r\n<br>Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка: \r\n<br>Анашкина Людмила Михайловна,\r\n<br>доля участия данного лица в уставном капитале Банка: доли не имеет,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: доли не имеет.\r\n<br>Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка: \r\n<br>Мясников Алексей Александрович,\r\n<br>доля участия данного лица в уставном капитале Банка: 0, 00043 %, \r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0, 00043 %.\r\n<br>Фамилия, имя, отчество лица, утвержденного членом Правления Банка:\r\n<br>Терентьева Наталья Григорьевна,\r\n<br>доля участия данного лица в уставном капитале Банка: 0,00008 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,00005 %.\r\n<br>Фамилия, имя, отчество лица, утвержденного членом Правления Банка:\r\n<br>Мельников Сергей Владимирович,\r\n<br>доля участия данного лица в уставном капитале Банка: доли не имеет,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: доли не имеет. Доля участия указанных лиц в уставном капитале дочерних и зависимых обществ акционерного общества, а в случае, когда такими дочерними и /или зависимыми обществами являются акционерные общества, -также доля принадлежащих указанным лицам обыкновенных акций дочерних и /или зависимых обществ акционерного общества: \r\n<br>дочерние и/или зависимые общества Банка отсутствуют.\r\n<br>Доля обыкновенных акций акционерного общества и/или его дочерних и зависимых обществ, которая может быть приобретена указанными лицами в результате осуществления прав по предоставленным указанным лицам опционам эмитента и/или его дочерних и зависимых обществ: \r\n<br>опционы Банка и/или его дочерних и зависимых обществ отсутствуют.\r\n<br>\r\n<br>3. Подпись\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           \r\n<br>_________________         М.В. Волков \r\n<br>3.2. Дата “ 05 ” мая 2006г.                              М.П.\r\n<br>\r\n<br>'),
