(45, '1', '2006-12-27', 'Изменение доли 5-процентника\r\n<br>\r\n\r\nСообщение о сведениях, \r\n<br>которые могут оказать существенное влияние на стоимость ценных бумаг\r\n<br> акционерного общества\r\n<br>\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>О появлении в составе акционеров Прио-Внешторгбанка (открытое акционерное общество) акционера, владеющего не менее, чем 5 процентами обыкновенных акций, а также об изменении доли акционера, владеющего не менее, чем 5 процентами обыкновенных акций, если при этом такая доля становится ниже 5 процентов обыкновенных акций.\r\n<br>Полное фирменное наименование: Банк внешней торговли (открытое акционерное общество).\r\n<br>Доля принадлежавших указанному лицу обыкновенных акций акционерного общества до изменения – 5,24 %.\r\n<br>Доля принадлежащих указанному лицу обыкновенных акций акционерного общества после изменения – 0 %. \r\n<br>Дата, в которую эмитент узнал об изменении доли принадлежащих указанному лицу обыкновенных акций эмитента: 27.12.2006 г.\r\n<br>Фамилия, имя, отчество: Кучава Эдуард Амиранович.\r\n<br>Доля принадлежавших указанному лицу обыкновенных акций акционерного общества до изменения – 0 %.\r\n<br>Доля принадлежащих указанному лицу обыкновенных акций акционерного общества после изменения - 5,24 %.\r\n<br>Дата, в которую эмитент узнал о появлении в составе акционеров указанного лица: 27.12.2006 г.\r\n<br>\r\n<br>3. Подписи\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “ 27 ” декабря 2006 г.                              М.П.                                                      \r\n<br>\r\n<br>'),
