(47, '1', '2007-01-12', 'Увеличение стоимости активов\r\n<br>Сообщение о существенном факте\r\n<br>“Сведения о фактах, повлекших разовое увеличение или уменьшение\r\n<br>стоимости активов эмитента более чем на 10 процентов”\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>1.9. Код существенного факта 	0200212В12012007\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Факты, повлекшие разовое увеличение более чем на 10 процентов: \r\n<br>- стоимости активов эмитента на 01.01.2007 г. по сравнению с 01.10.2006 г. - увеличение остатков денежных средств на счетах в Банке России и рост кредитного портфеля;\r\n<br>- стоимости активов эмитента на 01.01.2007 г. по сравнению с 01.01.2006 г. - рост кредитного портфеля; рост торгового портфеля ценных бумаг.\r\n<br>Данные факты  обусловлены ростом привлеченных средств клиентов.\r\n<br>2.2. Дата появления фактов, повлекших разовое увеличение стоимости активов эмитента более чем на 10 процентов: “12” января 2007 г.\r\n<br>2.3. Стоимость активов эмитента на дату окончания отчетных периодов, предшествующих отчетному периоду, в котором появились соответствующие факты: \r\n<br>на  01.10.2006 г. -  4 030 247 тыс. руб.                                          \r\n<br>на 01.01.2006 г. – 3 621 077 тыс. руб. \r\n<br>2.4. Стоимость активов эмитента на дату окончания отчетного периода (01.01.2007 г.), в котором появились соответствующие факты:     \r\n<br>4 549 595 тыс. руб.\r\n<br>2.5. Изменение стоимости активов эмитента в абсолютном и процентном отношении: \r\n<br>увеличение по сравнению с 01.10.2006 г. \r\n<br>на 519 348 тыс. руб. или 12,9 %.\r\n<br>увеличение по сравнению с 01.01.2006 г. \r\n<br>на 928 518 тыс. руб. или 25,6 %.\r\n<br>\r\n<br>3. Подписи\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “ 12 ” января 2007г.                              М.П.\r\n<br>3.3. Главный бухгалтер       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         В. И. Коробко 3.4. Дата “ 12 ” января 2007г.                              \r\n<br>\r\n<br>'),
(48, '1', '2007-01-18', 'Снижение чистой прибыли\r\n<br>Сообщение о существенном факте\r\n<br>“Сведения о фактах, повлекших разовое увеличение (уменьшение) чистой\r\n<br>прибыли или чистых убытков эмитента более чем на 10 процентов”\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>1.9. Код существенного факта	0300212В18012007\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Факты, повлекшие разовое снижение чистой прибыли более чем на 10 процентов:\r\n<br>-	рост расходов на создание резервов на возможные потери по ссудам, что обусловлено существенным  ростом кредитного портфеля с незначительным увеличением степени риска возможных потерь.\r\n<br>На 1.01.2006 г.  \r\n<br>кредитный портфель – 2 201 млн. руб.,  резерв – 95 млн. руб. (4,3%);\r\n<br>На 1.01.2007 г. \r\n<br>кредитный портфель – 2 965 млн. руб.,  резерв – 171 млн. руб. (5,8%);\r\n<br>2.2. Дата появления факта, повлекшего за собой разовое уменьшение чистой прибыли эмитента более чем на 10 процентов: “18” января  2007 г.\r\n<br>2.3. Значение чистой прибыли эмитента за отчетный период, предшествующий отчетному периоду, в котором появился соответствующий факт (2005 г.):\r\n<br>111 579 тыс. руб.                                         \r\n<br>2.4. Значение чистой прибыли эмитента за отчетный период, в котором появился соот