(50, '1', '2007-01-12', 'Решение Совета директоров о досрочном прекращении полномочий члена Правления\r\n<br>Сообщение о сведениях,\r\n<br> которые могут оказать существенное влияние на стоимость ценных бумаг\r\n<br>акционерного общества\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Информация о принятом Советом директоров Прио-Внешторгбанка (ОАО)                                                                   решении: о досрочном прекращении полномочий члена коллегиального исполнительного органа.\r\n<br>2.2. Дата проведения заседания Совета директоров Банка, на котором принято соответствующее решение	12 января 2007 г.\r\n<br>2.3. Дата составления и номер протокола заседания Совета директоров Банка, на котором принято соответствующее решение	12 января 2007 г. № 1\r\n<br>2.4. Содержание решений, принятых Советом директоров Банка: \r\n<br>1. Освободить от должности заместителя Председателя Правления Банка Еременко Юрия Ивановича 12 января 2007 года в связи с переходом на выборную должность в Рязанскую областную Думу и вывести его из состава Правления Банка.\r\n<br>2.5. Дополнительные сведения: Фамилия, имя, отчество лица, освобожденного от должности заместителя Председателя Правления Банка: \r\n<br>Еременко Юрий Иванович,\r\n<br>доля участия данного лица в уставном капитале Банка: доли не имеет,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: доли не имеет.\r\n<br>\r\n<br>3. Подпись\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         М.В. Волков 3.2. Дата “ 12 ” января 2007 г.                              М.П.\r\n<br>\r\n<br>'),
(51, '1', '2007-04-02', 'Изменение доли членов Совета и Правления\r\n<br>\r\n\r\nСообщение о сведениях,\r\n<br>которые могут оказать существенное влияние на стоимость ценных бумаг\r\n<br>акционерного общества \r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Об изменении размере доли участия лиц, являющихся членами совета директоров и членами коллегиального исполнительного органа.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Черкашина Татьяна Арсентьевна,\r\n<br>должность данного лица: член Совета директоров- заместитель начальника операционного управления,\r\n<br>размер доли данного лица изменился в уставном капитале Прио-Внешторгбанка (открытое акционерное общество), место нахождения: 390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) до изменения: 0,017 %,\r\n<br>а также размер доли принадлежавших данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) до изменения: 0,017 %,\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) после изменения: 0,00 %,\r\n<br>а также размер доли принадлежащих данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) после изменения: 0,00 %,\r\n<br>дата в которую эмитент узнал об изменении доли указанного лица в уставном капитале “02” апреля 2007г. \r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Силкина Елена Николаевна,\r\n<br>должность данного лица: член Правления, заместитель Председателя Правления – начальник операционного управления, \r\n<br>размер доли данного лица изменился в уставном капитале Прио-Внешторгбанка (открытое акционерное общество), место нахождения: 390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) до изменения: 0,04 %,\r\n<br>а также размер доли принадлежавших данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) до изменения: 0,04 %,\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) после изменения: 0,00 %,\r\n<br>а также размер доли принадлежащих данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) после изменения: 0,00 %,\r\n<br>дата в которую Банк узнал об изменении доли указанного лица в уставном капитале “02” апреля 2007г.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Ларионов Николай Михайлович,должность данного лица: член Совета директоров, Заместитель Председателя Совета директоров Прио-Внешторгбанка (ОАО);\r\n<br>размер доли данного лица изменился в уставном капитале Прио-Внешторгбанка (открытое акционерное общество), место нахождения: 390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) до изменения: 19,292 %,\r\n<br>а также размер доли принадлежавших данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) до изменения: 19,300 %,\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) после изменения: 19,367 %,\r\n<br>а также размер доли принадлежащих данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) после изменения: 19,375 %,\r\n<br>дата в которую Банк узнал об изменении доли указанного лица в уставном капитале “02” апреля 2007г.\r\n<br>\r\n<br>3. Подпись\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         М.В. Волков 3.2. Дата “ 02” апреля 2007г.                              М.П.\r\n<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                          \r\n<br>'),
(52, '1', '2007-04-05', 'Увеличение стоимости активов\r\n<br>\r\nСообщение о существенном факте\r\n<br>“Сведения о фактах, повлекших разовое увеличение стоимости активов эмитента более чем на 10 процентов”\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Факты, повлекшие разовое увеличение стоимости активов эмитента более чем на 10 процентов: \r\n<br>-	увеличение остатков денежных средств на счетах в Банке России и рост кредитного портфеля, что обусловлено ростом привлеченных средств клиентов;\r\n<br>-	увеличение стоимости основных средств в результате проведенной переоценки.\r\n<br>2.2. Дата появления фактов, повлекших разовое увеличение стоимости активов эмитента более чем на 10 процентов: “05” апреля 2007 г.\r\n<br>2.3. Стоимость активов эмитента на дату окончания отчетного периода (01.01.2007 г.), предшествующего отчетному периоду, в котором появились соответствующие факты: \r\n<br>4 549 595 тыс. руб.                                          \r\n<br>2.4. Стоимость активов эмитента на дату окончания отчетного периода (01.04.2007 г.), в котором появились соответствующие факты:     \r\n<br>5 054 426 тыс. руб.\r\n<br>2.5. Изменение стоимости активов эмитента в абсолютном и процентном отношении: увеличение на 504 831 тыс. руб. или 11,1 %.\r\n<br>\r\n<br>3. Подписи\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “ 05 ” апреля 2007г.                              М.П.\r\n<br>3.3. Главный бухгалтер       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         В. И. Коробко 3.4. Дата “ 05 ” апреля 2007г.                              \r\n<br>\r\n<br>'),
(53, '1', '2007-04-11', 'Снижение чистой прибыли\r\n<br>Сообщение о существенном факте\r\n<br>“Сведения о фактах, повлекших разовое уменьшение чистой\r\n<br>прибыли  эмитента более чем на 10 процентов”\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Факты, повлекшие разовое снижение чистой прибыли более чем на 10 процентов:\r\n<br>-	рост административно-управленческих расходов, связанный с повышением заработной платы в 1 квартале и выплатой премии по итогам года. \r\n<br>2.2. Дата появления факта, повлекшего за собой разовое снижение чистой прибыли эмитента более чем на 10 процентов: “11” апреля 2007 г.\r\n<br>2.3. Значение чистой прибыли эмитента за отчетный период, предшествующий отчетному периоду, в котором появился соответствующий факт (IV квартал 2006 г.):  36 715 тыс. руб.                                         \r\n<br>2.4. Значение чистой прибыли эмитента за отчетный период, в котором появился соответствующий факт (I кв. 2007 г.): 17 135 тыс. руб.\r\n<br>2.5. Изменение чистой прибыли эмитента в абсолютном и процентном отношении: снижение на 19 580 тыс. руб., или на 53,3 %.\r\n<br>\r\n<br>3. Подписи\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         М.В. Волков 3.2. Дата “ 11 ”апреля 2007г.                              М.П.\r\n<br>3.3. Главный бухгалтер       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         В. И. Коробко 3.4. Дата “ 11 ” апреля 2007г.                              \r\n<br>\r\n<br>'),
(54, '1', '2007-05-03', 'Изменение доли членов Совета директоров\r\n<br>\r\nСообщение о сведениях, \r\n<br>которые могут оказать существенное влияние на стоимость ценных бумаг\r\n<br> акционерного общества\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес страницы в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>Об изменении размера доли участия лиц, являющихся членами Совета директоров.\r\n<br>Фамилия, имя, отчество: Ганишин Виктор Алексеевич;\r\n<br>должность данного лица: член Совета директоров, Председатель Совета директоров Прио-Внешторгбанка(ОАО);\r\n<br>размер доли данного лица изменился в уставном капитале Прио-Внешторгбанка (открытое акционерное общество) место нахождения: 390023, г. Рязань, ул. Есенина, д.82/26;\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) до изменения:18,813%\r\n<br>а также размер доли принадлежавших данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) до изменения: 18,822%\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) после изменения:18,877%\r\n<br>а также размер доли принадлежащих данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) после изменения:18,885%\r\n<br>дата, в которую эмитент узнал об изменении доли указанного лица в уставном капитале: 03.05.2007г.\r\n<br>Фамилия, имя, отчество: Ларионов Николай Михайлович;\r\n<br>должность данного лица: член Совета директоров, заместитель Председателя Совета директоров Прио-Внешторгбанка(ОАО);\r\n<br>размер доли данного лица изменился в уставном капитале Прио-Внешторгбанка (открытое акционерное общество) место нахождения: 390023, г. Рязань, ул. Есенина, д.82/26;\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) до изменения: 19,367%\r\n<br>а также размер доли принадлежавших данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) до изменения: 19,375%\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) после изменения:19,401%\r\n<br>а также размер доли принадлежащих данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) после изменения: 19,409%\r\n<br>дата, в которую эмитент узнал об изменении доли указанного лица в уставном капитале: 03.05.2007г. \r\n<br>\r\n<br>3. Подписи\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “03” мая 2007г.                                     М.П.                                                      \r\n<br>\r\n<br>'),
(55, '1', '2007-05-30', 'Решение Совета директоров о созыве годового собрания\r\n\r\n<br>\r\nСообщение о сведениях, \r\n<br>которые могут оказать существенное влияние на стоимость ценных бумаг акционерного общества\r\n<br>\r\n<br>1. Общие сведения\r\n<br>1.1. Полное фирменное наименование эмитента (для некоммерческой организации – наименование)	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д.82/26\r\n<br>1.4. ОГРН эмитента	1 026 200 000 111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес страницы в сети Интернет, используемой эмитентом для раскрытия информации	www.priovtb.com\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>Информация о принятых Советом директоров Прио-Внешторгбанка (открытое акционерное общество) решениях: о созыве годового общего собрания, утверждении повестки дня годового общего собрания акционеров Прио-Внешторгбанка (ОАО), о рекомендациях по размеру выплачиваемого дивиденда по акциям.\r\n<br>Дата проведения заседания совета директоров эмитента, на котором принято соответствующее решение: 30.05.2007г.\r\n<br>Дата составления и номер протокола заседания совета директоров эмитента, на котором принято соответствующее решение: № 5 от 30.05.2007г.\r\n<br>Содержание решений, принятых советом директоров эмитента:\r\n<br>1.	Провести годовое общее собрание акционеров Банка 30 июня 2007 года. \r\n<br>Место проведения собрания: г. Рязань, ул. Есенина, д. 82/26, 7 этаж конференцзал. \r\n<br>Начало регистрации 10-00, начало собрания 11-00.\r\n<br>2.	Утвердить следующую повестку годового общего собрания акционеров:\r\n<br>1.	Утверждение годового отчета, годовой бухгалтерской отчетности, в том числе отчета о прибылях и убытках (счетов прибылей и убытков) Банка. \r\n<br>2.	Утверждение устава Банка в новой редакции.\r\n<br>3.	Поручение Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией новой редакции устава Банка.\r\n<br>4.	Утверждение  «Положения о Совете директоров Прио-Внешторгбанка (открытое акционерное общество)» в новой редакции.\r\n<br>5.	Избрание членов Совета директоров Банка: \r\n<br>-	Ганишин Виктор Алексеевич;\r\n<br>-	Ганишин Роман Викторович;\r\n<br>-	Мазаев Владимир Александрович;\r\n<br>-	Маслова Наталья Владимировна;\r\n<br>-	Кукушкин Сергей Александрович.\r\n<br>6.	Предоставление Председателю Правления Банка право подписания уведомления об избрании членов Совета директоров Банка.\r\n<br>7.	Утверждение стратегии Банка.\r\n<br>8.	Утверждение «Положения о размерах вознаграждения членов Совета директоров Прио-Внешторгбанка (открытое акционерное общество) за период исполнения ими своих обязанностей и компенсации расходов, связанных с исполнением ими функций членов Совета директоров»\r\n<br>9.	Утверждение «Порядка определения размера вознаграждения и его выплаты членам Совета директоров Прио-Внешторгбанка (открытое акционерное общество), выполняющими свои обязанности по трудовому договору (контракту)».\r\n<br>10.	Установление коэффициентов, предусмотренных «Положением о размерах вознаграждения членов Совета директоров Прио-Внешторгбанка (открытое акционерное общество) за период исполнения ими своих обязанностей и компенсации расходов, связанных с исполнением ими функций членов Совета директоров».\r\n<br>11.	 Определение количественного состава и избрание членов Ревизионной комиссии Банка – три человека:  \r\n<br>-	Нечипоренко Мария Степановна – начальник отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r\n<br>-	Куличкова Галина Михайловна - заместитель начальника отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r\n<br>-	Ковзан Юлия Борисовна - главный бухгалтер отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»\r\n<br>12.	Определение размера выплачиваемых членам Ревизионной комиссии вознаграждений. \r\n<br>13.	Утверждение аудитора Банка: аудиторско - консультационная фирма «МИАН» г. Москва.\r\n<br>14.	Распределение прибыли, в том числе выплата (объявление) дивидендов по результатам финансового года. \r\n<br>15.	Выплата вознаграждения членам Совета директоров Банка, исполнявшим свои обязанности с 01.01.2006 г. по 30.06.2007 г.\r\n<br>3. Предложить годовому общему собранию акционеров:  считать нецелесообразным выплату дивидендов за 2006 год по обыкновенным акциям Банка, по привилегированным акциям Банка выплатить 15 процентов от номинальной стоимости.\r\n<br>\r\n<br>3. Подпись\r\n<br>3.1. Председатель Правления   Прио-Внешторгбанка(ОАО)                      ____________________             М.В. Волков          \r\n<br>3.2. Дата «30» мая 2007 г.                                      М.П.\r\n<br>\r\n<br>\r\n<br>	\r\n<br>\r\n<br>'),
(56, '1', '2007-05-30', 'Сведения о дате закрытия реестра акционеров эмитента\r\n\r\n<br>Сообщение о существенном факте\r\n<br>“Сведения о дате закрытия реестра акционеров эмитента”\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес страницы в сети “Интернет”, используемой эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Категория (тип) акций Прио-Внешторгбанка (ОАО), в отношении которых составляется список их владельцев:\r\n<br>обыкновенные бездокументарные именные акции Прио-Внешторгбанка (ОАО), государственный регистрационный номер 10200212В; \r\n<br>привилегированные бездокументарные именные акции Прио-Внешторгбанка (ОАО), государственный регистрационный номер 20100212В.\r\n<br>2.2  Цель, для которой составляется список владельцев акций прио-Внешторгбанка (ОАО): участие в годовом общем собрании акционеров Прио-Внешторгбанка (ОАО) и выплата дивидендов за 2006г.\r\n<br>2.3.  Дата на которую составляется список владельцев акций Прио-Внешторгбанка(ОАО): 31.05.2007 г.\r\n<br>2.4. Дата составления протокола заседания Совета директоров Прио-Внешторгбанка (ОАО) №5 на котором принято решение о дате составления списка владельцев акций Прио-Внешторгбанка (ОАО): 30.05.2007г.\r\n<br>\r\n<br>3. Подписи\r\n<br>3.1. Председатель Правления       Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков \r\n<br>3.2. Дата “ 30 ” мая 2007г.                              М.П.                                                      \r\n<br>\r\n<br>'),
