в которую эмитент узнал об изменении доли указанного лица в уставном капитале: 05.06.2007г.\r\n<br>Фамилия, имя, отчество: Язев Алексей Алексеевич;\r\n<br>должность данного лица: член Правления, первый заместитель Председателя Правления Прио-Внешторгбанка(ОАО);\r\n<br>размер доли данного лица изменился в уставном капитале Прио-Внешторгбанка (открытое акционерное общество) место нахождения: 390023, г. Рязань, ул. Есенина, д.82/26;\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) до изменения: 0,752 %.\r\n<br>а также размер доли принадлежавших данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) до изменения: 0,752 %.\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) после изменения: 0 %.\r\n<br>а также размер доли принадлежащих данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) после изменения: 0 %.\r\n<br>дата, в которую эмитент узнал об изменении доли указанного лица в уставном капитале: 05.06.2007г. \r\n<br>Фамилия, имя, отчество: Ларионов Николай Михайлович;\r\n<br>должность данного лица: член Совета директоров, заместитель Председателя Совета директоров Прио-Внешторгбанка(ОАО);\r\n<br>размер доли данного лица изменился в уставном капитале Прио-Внешторгбанка (открытое акционерное общество) место нахождения: 390023, г. Рязань, ул. Есенина, д.82/26;\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) до изменения: 19,401%.\r\n<br>а также размер доли принадлежавших данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) до изменения: 19,409%.\r\n<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) после изменения:19,701%\r\n<br>а также размер доли принадлежащих данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) после изменения: 19,710%\r\n<br>дата, в которую эмитент узнал об изменении доли указанного лица в уставном капитале: 05.06.2007г. \r\n<br>\r\n<br>3. Подписи\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-