(58, '1', '2007-06-05', 'Изменение доли 5-процентника\r\n<br>\r\n\r\nСообщение о существенном факте\r\n<br>"Сведения о включении в реестр акционеров эмитента акционера, владеющего не менее чем 5 процентами обыкновенных акций эмитента, а также о любом изменении, в результате которого доля принадлежащих этому акционеру таких акций стала более или менее 5, 10, 15, 20, 25, 30, 50 или 75 процентов размещенных обыкновенных акций"\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Полное фирменное наименование: Общество с ограниченной ответственностью «ВАГ».\r\n<br>2.2. Доля принадлежавших указанному лицу обыкновенных акций эмитента до изменения – 14,697 %.\r\n<br>2.3. Доля принадлежащих указанному лицу обыкновенных акций эмитента после изменения – 15, 449 %. \r\n<br>2.4. Дата, в которую эмитент узнал об изменении доли принадлежащих указанному лицу обыкновенных акций эмитента: 05.06.2007г.\r\n<br>2.5. Основание для изменения доли принадлежащих указанному лицу обыкновенных акций эмитента – приобретение лицом обыкновенных акций эмитента.\r\n<br>2.6. Дата внесения соответствующей записи по лицевому счету указанного лица  24.05.2007г.\r\n<br>\r\n<br>3. Подписи\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “05” июня 2007 г.                              М.П.                                                      \r\n<br>\r\n<br>');
