(59, '1', '2007-07-02', 'Решения годового собрания\r\n<br>\r\nСообщение о существенном факте “Сведения о решениях общих собраний”\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1.  Вид общего собрания: годовое.\r\n<br>2.2. Форма проведения общего собрания: очная.\r\n<br>2.3. Дата и место проведения общего собрания: 30 июня 2007г., г. Рязань, ул Есенина, д. 82/26.\r\n<br>2.4. Кворум общего собрания: 34 342 871 голос, что составляет 98,2629 % от общего количества обыкновенных акций. \r\n<br>2.5. Вопросы, поставленные на голосование и итоги голосования по ним:\r\n<br>1. Утвердить годовой отчет, годовую бухгалтерскую отчетность, в том числе отчет о прибылях и убытках (счета прибылей и убытков) Банка. \r\n<br>В подсчете результатов голосования по первому вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим образом: \r\n<br>- «ЗА» подан 34 342 871 голос, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет; \r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>2.  Утвердить устав Банка в новой редакции. \r\n<br>В подсчете результатов голосования по второму вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим образом:\r\n<br>- «ЗА» подано 25 621 284 голоса, что составляет 74, 604 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций; \r\n<br>- «ПРОТИВ» подано 8 721 587 голосов, что составляет 25, 396 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.	\r\n<br>Для принятия решения по данному вопросу повестки дня требуется три четверти голосов.\r\n<br>3. Поручить Председателю Совета директоров Банка Ганишину Виктору Алексеевичу подписать ходатайства и другие документы, связанные с регистрацией изменений и дополнений, вносимых в устав Банка.\r\n<br>В подсчете результатов голосования по третьему вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим образом:\r\n<br>- «ЗА» подано 25 621 284 голоса, что составляет 74, 604 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» подано 8 721 587 голосов, что составляет 25, 396 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>4. Утвердить  «Положение о Совете директоров Прио-Внешторгбанка (открытое акционерное общество)» в новой редакции. \r\n<br>В подсчете результатов голосования по четвертому вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим образом:\r\n<br>- «ЗА» подано 25 621 284 голоса, что составляет 74, 604 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» подано 8 721 587 голосов, что составляет 25, 396 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций; \r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>5. Избрать в члены Совета директоров Банка:\r\n<br>- Ганишина Виктора Алексеевича,\r\n<br>- Ганишина Романа Викторовича,\r\n<br>- Мазаева Владимира Александровича,\r\n<br>- Кукушкина Сергея Александровича,\r\n<br>- Маслову Наталью Владимировну. \r\n<br>В подсчете результатов голосования по пятому вопросу принимали участие 5 бюллетеней, количество голосов: 128 106 420, голоса распределились следующим образом:\r\n<br>- Ганишин Виктор Алексеевич – подано 25 621 284 голоса;\r\n<br>- Ганишин Роман Викторович - подано 25 621 284 голоса;\r\n<br>- Мазаев Владимир Александрович - 25 621 284 голоса;\r\n<br>- Кукушкин Сергей Александрович – 25 621 284 голоса;\r\n<br>- Маслова Наталья Владимировна – 25 621 284 голоса.\r\n<br>6. Предоставить Председателю Правления Банка право подписания уведомления об избрании членов Совета директоров Банка. \r\n<br>В подсчете результатов голосования по шестому вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим образом:\r\n<br>- «ЗА» подан 34 342 871 голос, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. \r\n<br>7. Утвердить стратегию Банка.\r\n<br>В подсчете результатов голосования по седьмому вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим образом:\r\n<br>- «ЗА» подан 34 342 871 голос, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>8. Утвердить «Положение о размерах вознаграждения членов Совета директоров Прио-Внешторгбанка (открытое акционерное общество) за период исполнения ими своих обязанностей и компенсации расходов, связанных с исполнением ими функций членов Совета директоров». \r\n<br>В подсчете результатов голосования по восьмому вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим образом:\r\n<br>- «ЗА» подано 25 621 284 голоса, что составляет 74, 604 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» подано 8 721 587 голосов, что составляет 25, 396 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>9. Утвердить «Порядок определения размера вознаграждения и его выплаты членам Совета директоров Прио-Внешторгбанка (открытое акционерное общество), выполняющими свои обязанности по трудовому договору (контракту)».\r\n<br>В подсчете результатов голосования по девятому вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим образом: \r\n<br>- «ЗА» подано 25 621 284 голоса, что составляет 74, 604 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» подано 8 721 587 голосов, что составляет 25, 396 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. \r\n<br>10. Установить следующие коэффициенты, предусмотренные «Положением о размерах вознаграждения членов Совета директоров Прио-Внешторгбанка (открытое акционерное общество) за период исполнения ими своих обязанностей и компенсации расходов, связанных с исполнением ими функций членов Совета директоров»: коэффициент базового размера вознаграждения члена Совета директоров Банка (К1) - 0,00175; коэффициент дополнительного размера вознаграждения члена Совета директоров Банка (К2):10 – для Председателя Совета директоров Банка;9,5 – для заместителя Председателя Совета директоров Банка;5 – для Председателя Комитета Совета директоров Банка;4,5 – для заместителя Председателя Комитета Совета директоров Банка; 1 – для члена Совета директоров Банка.\r\n<br>В подсчете результатов голосования по десятому вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим  образом:\r\n<br>- «ЗА» подано 25 621 284 голоса, что составляет 74, 604 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» подано 8 721 587 голосов, что составляет 25, 396 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>11. Определить количественный состав членов Ревизионной комиссии Банка – три человека и избрать:\r\n<br>Нечипоренко Мария Степановна – начальник отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r\n<br>Куличкова Галина Михайловна - заместитель начальника отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r\n<br>Ковзан Юлия Борисовна - главный бухгалтер отдела ведения бухгалтерского учета и отчетности ООО «Амальгата».\r\n<br>Голоса, принадлежащие членам Совета директоров Банка, членам Правления Банка, Председателю Правления Банка, не участвовали в подсчете голосов при подведении итогов голосования по одиннадцатому опросу.\r\n<br>В подсчете результатов голосования по одиннадцатому вопросу принимали участие 4 бюллетеня, количество голосов 13867289, голоса распределились следующим образом: \r\n<br>Нечи поренко Мария Степановна\r\n<br>- «ЗА» подано 13 867 289 голосов, что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет;\r\n<br>Куличкова Галина Михайловна\r\n<br>- «ЗА» подано 13 867 289 голосов, что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет;\r\n<br>Ковзан Юлия Борисовна\r\n<br>- «ЗА» подано 13 867 289 голосов, что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет; \r\n<br>12. Определить размер выплачиваемых членам Ревизионной комиссии вознаграждений: членам Ревизионной комиссии – три тысячи пятьсот рублей в год, Председателю Ревизионной комиссии пять тысяч пятьсот рублей в год. \r\n<br>В подсчете результатов голосования по двенадцатому вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим  образом:\r\n<br>- «ЗА» подано 34 342 871 голос, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>-  «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>13. Утвердить аудитором Банка: аудиторско-консультационную фирму "МИАН" г. Москва.\r\n<br>В подсчете результатов голосования по тринадцатому вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим  образом:\r\n<br>- «ЗА» подано 34 342 871 голос, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» - нет;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. \r\n<br>14. Утвердить  следующее предложение по распределению прибыли Банка за 2006 год: по результатам работы за 2006 год получена прибыль в сумме  91 173 973,73 рублей. После уплаты налогов нераспределенная прибыль составила 63 607 132,73  рубля.\r\n<br>Распределить прибыль  в сумме 63 607 132,73  рубля следующим образом:- на выплату дивидендов по привилегированным акциям в размере 15% от номинала в сумме  2 250,00  рублей, по обыкновенным акциям выплату дивидендов за 2006 год не осуществлять;- на пополнение фонда материального поощрения и социально-производственного развития в сумме 3 600 000,00 рублей;оставшуюся после распределения часть прибыли в сумме 60 004 882,73  рублей направить в фонд накопления.\r\n<br>В подсчете результатов голосования по четырнадцатому вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим  образом: \r\n<br>- «ЗА» подано 25 621 284 голоса, что составляет 74, 604 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» подано 8 721 587 голосов, что составляет 25, 396 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. \r\n<br>15. Определить общую сумму вознаграждения членам Совета директоров, исполнявшим свои обязанности  с 1 января 2006 по 30 июня 2007 г., в размере 35 400 000 (Тридцать пять миллионов четыреста тысяч ) рублей. Определить  следующий размер вознаграждений членам Совета:\r\n<br>- Ганишин В.А.	 –  15 300 000 (Пятнадцать миллионов триста тысяч) рублей.\r\n<br>- Ларионов Н.М.	–  5 600 000 (Пять миллионов шестьсот тысяч) рублей.\r\n<br>- Мазаев В.А. 	–  14 500 000 (Четырнадцать миллионов пятьсот тысяч) рублей. Выплату вознаграждений произвести с учетом  вычета сумм,  полученных членами Совета директоров от Прио-Внешторгбанк (ОАО) в период с 1 января 2006 г. по 30 июня 2007 г.  \r\n<br>В подсчете результатов голосования по пятнадцатому вопросу принимали участие 7 бюллетеней, количество голосов 34 342 871, голоса распределились следующим  образом:\r\n<br>- «ЗА» подано 25 621 284 голоса, что составляет 74, 604 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ПРОТИВ» подано 8 721 587 голосов, что составляет 25, 396 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r\n<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r\n<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r\n<br>2.6. Формулировки решений, принятых общим собранием:\r\n<br>- Утвердить годовой отчет, годовую бухгалтерскую отчетность, в том числе отчет о прибылях и убытках (счета прибылей и убытков) Банка.\r\n<br>- Поручить Председателю Совета директоров Банка Ганишину Виктору Алексеевичу подписать ходатайства и другие документы, связанные с регистрацией изменений и дополнений, вносимых в устав Банка. \r\n<br>- Утвердить  «Положение о Совете директоров Прио-Внешторгбанка (открытое акционерное общество)» в новой редакции.\r\n<br>- Избрать в члены Совета директоров Банка:\r\n<br>- Ганишина Виктора Алексеевича,\r\n<br>- Ганишина Романа Викторовича,\r\n<br>- Мазаева Владимира Александровича,\r\n<br>- Кукушкина Сергея Александровича,\r\n<br>- Маслову Наталью Владимировну. \r\n<br>-  Предоставить Председателю Правления Банка право подписания уведомления об избрании членов Совета директоров Банка . \r\n<br>- Утвердить стратегию Банка. \r\n<br>- Утвердить «Положение о размерах вознаграждения членов Совета директоров Прио-Внешторгбанка (открытое акционерное общество) за период исполнения ими своих обязанностей и компенсации расходов, связанных с исполнением ими функций членов Совета директоров».\r\n<br>- Утвердить «Порядок определения размера вознаграждения и его выплаты членам Совета директоров Прио-Внешторгбанка (открытое акционерное общество), выполняющими свои обязанности по трудовому договору (контракту)».  \r\n<br>- Установить следующие коэффициенты, предусмотренные «Положением о размерах вознаграждения членов Совета директоров Прио-Внешторгбанка (открытое акционерное общество) за период исполнения ими своих обязанностей и компенсации расходов, связанных с исполнением ими функций членов Совета директоров»: коэффициент базового размера вознаграждения члена Совета директоров Банка (К1) - 0,00175; коэффициент дополнительного размера вознаграждения члена Совета директоров Банка (К2):10 – для Председателя Совета директоров Банка;9,5 – для заместителя Председателя Совета директоров Банка;5 – для Председателя Комитета Совета директоров Банка;4,5 – для заместителя Председателя Комитета Совета директоров Банка; 1 – для члена Совета директоров Банка.\r\n<br> - В члены Ревизионной комиссии Банка избраны следующие лица:\r\n<br>Нечипоренко Мария Степановна;\r\n<br>Куличкова Галина Михайловна;\r\n<br>Ковзан Юлия Борисовна. \r\n<br>-  Определить размер выплачиваемых членам Ревизионной комиссии вознаграждений: членам Ревизионной комиссии – три тысячи пятьсот рублей в год, Председателю Ревизионной комиссии пять тысяч пятьсот рублей в год.\r\n<br>- Утвердить аудитором Банка: аудиторско-консультационную фирму "МИАН" г. Москва.  \r\n<br>- Утвердить  следующее предложение по распределению прибыли Банка за 2006 год: по результатам работы за 2006 год получена прибыль в сумме  91 173 973,73 рублей. После уплаты налогов нераспределенная прибыль составила 63 607 132,73  рубля.Распределить прибыль  в сумме 63 607 132,73  рубля следующим образом:- на  выплату дивидендов по привилегированным акциям  в размере 15% от номинала в сумме  2 250,00  рублей, по обыкновенным акциям выплату дивидендов за 2006 год не осуществлять; - на пополнение фонда материального поощрения и социально-производственного развития в сумме 3 600 000,00 рублей; - оставшуюся после распределения часть прибыли в сумме 60 004 882,73  рублей направить в фонд накопления .  \r\n<br>- Определить общую сумму вознаграждения членам Совета директоров, исполнявшим свои обязанности  с 1 января 2006 по 30 июня 2007 г., в размере 35 400 000 (Тридцать пять миллионов четыреста тысяч ) рублей. Определить  следующий размер вознаграждений членам Совета:	\r\n<br>- Ганишин В.А.	 –