(60, '1', '2007-07-02', 'Принятие решения о выплате дивидендов\r\n<br>\r\nСообщение о существенном факте\r\n<br>“Сведения о начисленных и (или) выплаченных доходах по ценным бумагам эмитента”\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Вид, категория (тип), серия и иные идентификационные признаки ценных бумаг: акции привилегированные именные бездокументарные.\r\n<br>2.2.	Государственный регистрационный номер выпуска ценных бумаг: 20100212В, дата государственной регистрации: 25.12.1992г. зарегистрирован выпуск в объеме 5000 руб. и 29.03.1996г. зарегистрирован выпуск в объеме 10000 руб.\r\n<br>2.3.	Наименование регистрирующего органа, осуществившего государственную регистрацию выпуска ценных бумаг: Главное управление Центрального Банка Российской Федерации по Рязанской области.\r\n<br>2.4.	Орган управления, принявший решение о выплате дивидендов по акциям: годовое общее собрание акционеров Прио-Внешторгбанка (ОАО).\r\n<br>2.5.	Дата принятия решения о выплате дивидендов по акциям: 30.06.2007г.\r\n<br>2.6.	Дата составления протокола годового общего собрания акционеров Прио-Внешторгбанка (ОАО), на котором принято решение о выплате дивидендов по акциям  02.07.2007г.\r\n<br>2.7.	Общий размер дивидендов, начисленных на акции привилегированные именные бездокументарные: 2250 рублей; размер дивиденда, начисленного на одну акцию привилегированную именную бездокументарную: 15 % от номинальной стоимости или 15 копеек на одну акцию.\r\n<br>2.8.	Форма выплаты доходов по ценным бумагам: денежные средства.\r\n<br>2.9.	Дата окончания срока, в течение которого обязательство по выплате дивидендов по акциям должно быть исполнено: 29.08.2007г.                                      \r\n<br>\r\n<br>3. Подпись\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)          \r\n<br>_________________         М. В. Волков                              \r\n<br>3.2. Дата “02” июля 2007г.                              М.П.\r\n<br>\r\n<br>'),
(61, '1', '2007-07-06', 'Решение Совета директоров об образовании единоличного и коллегиального исполнительных органов\r\n\r\n<br>Сообщение о сведениях,\r\n<br> которые могут оказать существенное влияние на стоимость ценных бумаг\r\n<br>акционерного общества\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Информация о принятом Советом директоров Прио-Внешторгбанка (ОАО)решении: об образовании единоличного и/или коллегиального исполнительных органов.\r\n<br>2.2. Дата проведения заседания Совета директоров Банка, на котором принято соответствующее решение	06 июля 2007 г.\r\n<br>2.3. Дата составления и номер протокола заседания Совета директоров Банка, на котором принято соответствующее решение	06 июля 2007г. № 6\r\n<br>2.4. Содержание решений, принятых Советом директоров Банка: \r\n<br>п. 4. Избрать Председателем Правления Банка Волкова Михаила Владимировича; п. 5. Определить численный состав Правления Банка в количестве семи членов; \r\n<br>п. 6. Утвердить следующий состав Правления Банка: \r\n<br>1.	Волков М.В.\r\n<br>2.	Язев А.А.\r\n<br>3.	Силкина Е.Н.         \r\n<br>4.	Анашкина Л.М.\r\n<br>5.	Мясников А.А.\r\n<br>6.	Терентьева Н.Г.\r\n<br>7.	Мельников С.В.;\r\n<br>Назначить первым заместителем Председателя Правления Банка Язева А.А., заместителями Председателя Правления Банка Силкину Е.Н., Анашкину Л.М., Мясникова А.А.\r\n<br>2.5. Дополнительные сведения: \r\n<br>1. Фамилия, имя, отчество лица, утвержденного членом Правления Банка, избранного Председателем Правления Банка: \r\n<br>Волков Михаил Владимирович,\r\n<br>доля участия данного лица в уставном капитале Банка: 0,0002 %,  \r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0 %.\r\n<br>2. Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного первым заместителем Председателя Правления Банка: \r\n<br>Язев Алексей Алексеевич,\r\n<br>доля участия данного лица в уставном капитале Банка: 0 %, \r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка 0 %.\r\n<br>3. Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка:\r\n<br>Силкина Елена Николаевна,\r\n<br>доля участия данного лица в уставном капитале Банка: 0 %, \r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка 0 %.\r\n<br>4. Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка: \r\n<br>Анашкина Людмила Михайловна,\r\n<br>доля участия данного лица в уставном капитале Банка: 0%, \r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0%.\r\n<br>5. Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка: \r\n<br>Мясников Алексей Александрович,\r\n<br>доля участия данного лица в уставном капитале Банка: 0, 00043 %, \r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,00043 %.\r\n<br>6. Фамилия, имя, отчество лица, утвержденного членом Правления Банка:\r\n<br>Терентьева Наталья Григорьевна,\r\n<br>доля участия данного лица в уставном капитале Банка: 0,00008 %, \r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,00005%.\r\n<br>7. Фамилия, имя, отчество лица, утвержденного членом Правления Банка:\r\n<br>Мельников Сергей Владимирович,\r\n<br>доля участия данного лица в уставном капитале Банка: 0%., \r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0%. \r\n<br>Доля участия указанных лиц в уставном капитале дочерних и зависимых обществ акционерного общества, а в случае, когда такими дочерними и /или зависимыми обществами являются акционерные общества, -также доля принадлежащих указанным лицам обыкновенных акций дочерних и /или зависимых обществ акционерного общества: \r\n<br>дочерние и/или зависимые общества Банка отсутствуют.\r\n<br>Доля обыкновенных акций акционерного общества и/или его дочерних и зависимых обществ, которая может быть приобретена указанными лицами в результате осуществления прав по предоставленным указанным лицам опционам эмитента и/или его дочерних и зависимых обществ: \r\n<br>опционы Банка и/или его дочерних и зависимых обществ отсутствуют.\r\n<br>\r\n<br>3. Подпись\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         М.В. Волков 3.2. Дата “ 06 ” июля 2007г.                              М.П.\r\n<br>\r\n<br>');
