(62, '1', '2007-07-06', 'Истечение срока полномочий Правления\r\n<br>\r\nСообщение о сведениях, которые могут оказать существенное влияние на стоимость ценных бумаг акционерного общества\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>1.8. Название периодического печатного издания (изданий), используемого эмитентом для опубликования информации	“Рязанские ведомости”“Приложение к Вестнику ФСФР”\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Об истечении срока полномочий единоличного и/или членов коллегиального исполнительных органов.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Волков Михаил Владимирович,\r\n<br>должность данного лица: Председатель Правления, \r\n<br>доля участия данного лица в уставном капитале Банка: 0,0002 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0 %,\r\n<br>дата истечения полномочий данного лица “06” июля 2007г. \r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Язев Алексей Алексеевич,\r\n<br>должность данного лица: член Правления, Первый заместитель Председателя Правления, \r\n<br>доля участия данного лица в уставном капитале Банка: 0 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0 %,\r\n<br>дата истечения полномочий данного лица “06” июля 2007г.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Силкина Елена Николаевна,\r\n<br>должность данного лица: член Правления, заместитель Председателя Правления – начальник операционного управления, \r\n<br>доля участия данного лица в уставном капитале Банка: 0 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0 %,\r\n<br>дата истечения полномочий данного лица “06” июля 2007г.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Анашкина Людмила Михайловна,\r\n<br>должность данного лица: член Правления, заместитель Председателя Правления, директор Московского филиала, \r\n<br>доля участия данного лица в уставном капитале Банка: 0%,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0%,\r\n<br>дата истечения полномочий данного лица “06” июля 2007г.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Мясников Алексей Александрович,\r\n<br>должность данного лица: член Правления, заместитель Председателя Правления – начальник управления международных операций, \r\n<br>доля участия данного лица в уставном капитале Банка: 0,00043 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,00043 %,\r\n<br>дата истечения полномочий данного лица “06” июля 2007г.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Терентьева Наталья Григорьевна,\r\n<br>должность данного лица: член Правления – начальник управления ценных бумаг и пассивных операций,\r\n<br>доля участия данного лица в уставном капитале Банка: 0,00008 %,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,00005 %.\r\n<br>дата истечения полномочий данного лица “06” июля 2007г.\r\n<br>Фамилия, имя, отчество соответствующего лица: \r\n<br>Мельников Сергей Владимирович,\r\n<br>должность данного лица: член Правления – начальник управления финансового планирования и анализа,\r\n<br>доля участия данного лица в уставном капитале Банка: 0%,\r\n<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0%.\r\n<br>дата истечения полномочий данного лица “06” июля 2007г.\r\n<br>\r\n<br>3. Подпись\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         М.В. Волков 3.2. Дата “ 06” июля 2007г.                              М.П.\r\n<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                          \r\n<br>'),
(63, '1', '2007-08-07', 'Изменение доли члена Совета директоров\r<br>                                                                          Cообщение о сведениях, \r<br>которые могут оказать существенное влияние на стоимость ценных бумаг\r<br> акционерного общества\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес страницы в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>Об изменении размера доли участия лица, являющегося членом Совета директоров в уставном капитале Прио-Внешторгбанка (ОАО) и об изменении размера доли принадлежащих указанному лицу обыкновенных акций Прио-Внешторгбанка(ОАО).\r<br>Фамилия, имя, отчество: Ганишин Виктор Алексеевич;\r<br>должность данного лица: Председатель Совета директоров Прио-Внешторгбанка(ОАО);\r<br>размер доли данного лица изменился в уставном капитале Прио-Внешторгбанка (открытое акционерное общество) место нахождения: 390023, г. Рязань, ул. Есенина, д.82/26;\r<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) до изменения: 18,877 %.\r<br>а также размер доли принадлежавших данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) до изменения: 18,885 %.\r<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) после изменения: 19,571 %.\r<br>а также размер доли принадлежащих данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) после изменения: 19,579 %.\r<br>дата, в которую эмитент узнал об изменении доли указанного лица в уставном капитале: 07.08.2007г.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “07” августа 2007г.                                     М.П.                                                      \r<br>\r<br>'),
(64, '1', '2007-08-12', 'Решение совета директоров о созыве внеочередного собрания\r\n<br>\r\n<br>Сообщение о сведениях, \r\n<br>которые могут оказать существенное влияние на стоимость ценных бумаг акционерного общества\r\n<br>\r\n<br>1. Общие сведения\r\n<br>1.1. Полное фирменное наименование эмитента (для некоммерческой организации – наименование)	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д.82/26\r\n<br>1.4. ОГРН эмитента	1 026 200 000 111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес страницы в сети Интернет, используемой эмитентом для раскрытия информации	www.priovtb.com\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>Информация о принятых Советом директоров Прио-Внешторгбанка (открытое акционерное общество) решениях: о созыве внеочередного общего собрания, утверждении повестки дня внеочередного общего собрания акционеров Прио-Внешторгбанка (ОАО).\r\n<br>Дата проведения заседания совета директоров эмитента, на котором принято соответствующее решение: 12.08.2007г.\r\n<br>Дата составления и номер протокола заседания совета директоров эмитента, на котором принято соответствующее решение: № 8 от 12.08.2007г.\r\n<br>Содержание решений, принятых советом директоров эмитента:Созвать внеочередное общее собрание акционеров Прио-Внешторгбанка (ОАО) в форме собрания; определить дату проведения внеочередного общего собрания акционеров Прио-Внешторгбанка (ОАО) – 15 сентября 2007 года; определить время проведения внеочередного общего собрания акционеров Прио-Внешторгбанка (ОАО) - 11 часов 00 минут; определить место проведения внеочередного общего собрания акционеров Прио-Внешторгбанка (ОАО) - г. Рязань, ул. Есенина, д. 82/26, 7 этаж конференцзал; определить время начала регистрации лиц, участвующих во внеочередном общем собрании акционеров Прио-Внешторгбанка (ОАО) – 10 часов 00 минут; утвердить следующую повестку годового общего собрания акционеров:\r\n<br>1.	Утверждение новой редакции устава Прио-Внешторгбанка (ОАО).\r\n<br>2.	Определение количественного состава Совета директоров Прио-Внешторгбанка (ОАО) – 7 членов.\r\n<br>3.	Поручение Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией новой редакции устава Банка.\r\n<br>\r\n<br>3. Подпись\r\n<br>3.1. И.о. Председателя Правления\r\n<br>Прио-Внешторгбанка (ОАО)-      \r\n<br>заместитель Председателя Правления       \r\n<br>Прио-Внешторгбанка (ОАО) ________________      Е.Н. Силкина          \r\n<br>3.2. Дата «12» августа 2007 г.                                      М.П.\r\n<br>\r\n<br>\r\n<br>	\r\n<br>\r\n<br>'),
