(68, '1', '2007-08-29', 'Исполнение обязательств по выплате дивидендов\r<br>\r<br>Сообщение о существенных фактах\r<br>“Сведения о начисленных и/или выплаченных доходах по ценным бумагам эмитента”\r<br>“Сведения о сроках исполнения обязательств эмитента перед владельцами ценных бумаг эмитента”\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>2.1. Вид, категория (тип), серия и иные идентификационные признаки ценных бумаг: акции привилегированные именные бездокументарные.\r<br>2.2.	Государственный регистрационный номер выпуска ценных бумаг: 20100212В, дата государственной регистрации: 25.12.1992г. зарегистрирован выпуск в объеме 5000 руб. и 29.03.1996г. зарегистрирован выпуск в объеме 10000 руб.\r<br>2.3.	Наименование регистрирующего органа, осуществившего государственную регистрацию выпуска ценных бумаг: Главное управление Центрального Банка Российской Федерации по Рязанской области.\r<br>2.4.	Орган управления, принявший решение о выплате дивидендов по акциям: годовое общее собрание акционеров Прио-Внешторгбанка (ОАО).\r<br>2.5.	Дата принятия решения о выплате дивидендов по акциям: 30.06.2007г.\r<br>2.6.	Дата составления протокола годового общего собрания акционеров Прио-Внешторгбанка (ОАО), на котором принято решение о выплате дивидендов по акциям: 02.07.2007 г.\r<br>2.7.	Содержание обязательства: выплата дивидендов по привилегированным именным бездокументарным акциям Прио-Внешторгбанка (ОАО) за 2006 год;  размер обязательства в денежном выражении: 2250 рублей.\r<br>2.8.	Общий размер дивидендов, начисленных на акции привилегированные именные бездокументарные: 2250 рублей; размер дивиденда, начисленного на одну акцию привилегированную именную бездокументарную: 15 % от номинальной стоимости или 15 копеек на одну акцию.\r<br>2.9.	Форма выплаты доходов по ценным бумагам: денежные средства.\r<br>2.10.	Дата окончания срока, в течение которого обязательство по выплате дивидендов по акциям должно быть исполнено: 29.08.2007 г.\r<br>2.11.	Общий размер дивидендов, выплаченных по привилегированным именным бездокументарным акциям Прио-Внешторгбанка (ОАО): 2250 рублей.\r<br>2.12.	Факт исполнения обязательства: обязательство по выплате дивидендов по привилегированным бездокументарным именным акциям Прио-Внешторгбанка (ОАО) за 2006 год  исполнено в полном объеме.                                      \r<br>\r<br>\r<br>3. Подпись\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО) _________________   М.В.Волков                                                                                          (подпись)\r<br>3.2. Дата “ 29 ” августа 2007г.                              М.П.\r<br>\r<br>'),
(71, '1', '2007-10-04', 'Увеличение стоимости активов\r<br>\r<br>Сообщение о существенном факте\r<br>“Сведения о фактах, повлекших разовое увеличение стоимости активов эмитента более чем на 10 процентов”\r<br>\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>2.1. Факты, повлекшие разовое увеличение стоимости активов эмитента более чем на 10 процентов: \r<br>-	рост кредитного портфеля, обусловленный ростом привлеченных средств клиентов;\r<br>-	рост остатков на счетах межфилиальных оборотов, связанный с перераспределением ресурсов между филиалами.\r<br>2.2. Дата появления фактов, повлекших разовое увеличение стоимости активов эмитента более чем на 10 процентов: “04” октября 2007 г.\r<br>2.3. Стоимость активов эмитента на дату окончания отчетного периода (01.07.2007 г.), предшествующего отчетному периоду, в котором появились соответствующие факты: \r<br>5 103 167 тыс. руб.                                          \r<br>2.4. Стоимость активов эмитента на дату окончания отчетного периода (01.10.2007 г.), в котором появились соответствующие факты:     \r<br>5 638 677 тыс. руб.\r<br>2.5. Изменение стоимости активов эмитента в абсолютном и процентном отношении: увеличение на 535 510 тыс. руб. или 10,5 %.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “ 04 ” октября 2007г.                              М.П.\r<br>3.3. Главный бухгалтер       \r<br>Прио-Внешторгбанка (ОАО)           _________________         В. И. Коробко 3.4. Дата “ 04 ” октября 2007г.                              \r<br>\r<br>'),
(72, '1', '2007-10-09', 'Изменение доли 5-процентников\r<br>\r<br>Сообщение о существенном факте\r<br>"Сведения о включении в реестр акционеров эмитента акционера, владеющего не менее чем 5 процентами обыкновенных акций эмитента, а также о любом изменении, в результате которого доля принадлежащих этому акционеру таких акций стала более или менее 5, 10, 15, 20, 25, 30, 50 или 75 процентов размещенных обыкновенных акций"\r<br>\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>\r<br>2. Содержание сообщения\r<br>2.1. Фамилия, имя, отчество: Логинов Владимир Валерьевич.\r<br>2.2. Доля принадлежавших указанному лицу обыкновенных акций эмитента до изменения – 5,244 %. \r<br>2.3. Доля принадлежащих указанному лицу обыкновенных акций эмитента после изменения – 0 %.\r<br>2.4. Дата, в которую эмитент узнал об изменении доли принадлежащих указанному лицу обыкновенных акций эмитента: 09.10.2007г.\r<br>2.5. Основание для изменения доли принадлежащих указанному лицу обыкновенных акций эмитента – продажа лицом обыкновенных акций эмитента.\r<br>2.6. Дата внесения соответствующей записи по лицевому счету указанного лица 27.09.2007г.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “09” октября 2007 г.                              М.П.                                                      \r<br>\r<br>'),
(70, '1', '2007-09-19', 'Решения внеочередного собрания\r<br>\r<br>Сообщение о существенном факте\r<br>“Сведения о решениях общих собраний”\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>2.1.  Вид общего собрания: внеочередное общее собрание акционеров.\r<br>2.2. Форма проведения общего собрания: очная.\r<br>2.3. Дата и место проведения общего собрания: 15 сентября 2007г., г. Рязань, ул Есенина, д. 82/26.\r<br>2.4. Кворум общего собрания: 32 556 207 голосов, что составляет 93,15 % от общего количества обыкновенных акций. \r<br>2.5. Вопросы, поставленные на голосование и итоги голосования по ним:\r<br>1. Утвердить новую редакцию устава Прио-Внешторгбанка (ОАО). \r<br>В подсчете результатов голосования по первому вопросу принимали участие 6 бюллетеней, количество голосов 32 556 207, голоса распределились следующим образом: \r<br>- «ЗА» подано 32 556 207 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» - нет; \r<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r<br>Для принятия решения по данному вопросу повестки дня требуется три четверти голосов. \r<br>2.  Определить количественный состав Совета директоров Прио-Внешторгбанка (ОАО) – 7 членов. \r<br>В подсчете результатов голосования по второму вопросу принимали участие 6 бюллетеней, количество голосов 32 556 207, голоса распределились следующим образом: \r<br>- «ЗА» подано 6 888 673 голоса, что составляет 21, 16 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций; \r<br>- «ПРОТИВ» подано 25 667 534 голоса, что составляет 78, 84 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.	\r<br>Для принятия решения по данному вопросу повестки дня требуется  простое большинство голосов.\r<br>3. Поручить Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией новой редакции устава Банка.\r<br>В подсчете результатов голосования по третьему вопросу принимали участие 6 бюллетеней, количество голосов 32 556 207, голоса распределились следующим образом:\r<br>- «ЗА» подано 32 556 207 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» - нет; \r<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. \r<br>2.6. Формулировки решений, принятых общим собранием:\r<br>–	Утвердить новую редакцию устава Прио-Внешторгбанка (ОАО).\r<br>–	Поручить Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией новой редакции устава Банка.\r<br>2.7. Дата составления протокола общего собрания 19 сентября 2007г.\r<br>\r<br>3. Подпись\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)          \r<br> _________________  \r<br>М. В. Волков                                                              (подпись)\r<br>3.2. Дата “19” сентября 2007г.                              \r<br>М.П.\r<br>\r<br>'),
