(75, '1', '2007-12-10', 'Изменение доли членов Совета директоров и Правления\r<br>\r<br>Сообщение о сведениях, \r<br>которые могут оказать существенное влияние на стоимость ценных бумаг\r<br> акционерного общества\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес страницы в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>Об изменении размера доли участия лиц, являющихся членами Совета директоров и Правления в уставном капитале Прио-Внешторгбанка (ОАО) и об изменении размера доли принадлежащих указанным лицам обыкновенных акций Прио-Внешторгбанка(ОАО).\r<br>Фамилия, имя, отчество: Ганишин Роман Викторович;\r<br>должность данного лица: Член Совета директоров Прио-Внешторгбанка(ОАО);\r<br>размер доли данного лица изменился в уставном капитале Прио-Внешторгбанка (открытое акционерное общество) место нахождения: 390023, г. Рязань, ул. Есенина, д.82/26;\r<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) до изменения: 0 %.\r<br>а также размер доли принадлежавших данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) до изменения: 0 %.\r<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) после изменения: 0,000029 %.\r<br>а также размер доли принадлежащих данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) после изменения: 0,000029 %.\r<br>дата, в которую эмитент узнал об изменении доли указанного лица в уставном капитале: 10.12.2007г.\r<br>Фамилия, имя, отчество: Терентьева Наталья Григорьевна;\r<br>должность данного лица: Член Правления Прио-Внешторгбанка(ОАО);\r<br>размер доли данного лица изменился в уставном капитале Прио-Внешторгбанка (открытое акционерное общество) место нахождения: 390023, г. Рязань, ул. Есенина, д.82/26;\r<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) до изменения: 0,000049 %.\r<br>а также размер доли принадлежавших данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) до изменения: 0,000049 %.\r<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) после изменения: 0,000020 %.\r<br>а также размер доли принадлежащих данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) после изменения: 0,000020 %.\r<br>дата, в которую эмитент узнал об изменении доли указанного лица в уставном капитале: 10.12.2007г.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “10” декабря 2007г.                                     М.П.                                                      \r<br>\r<br>'),
(76, '1', '2008-01-14', 'Увеличение активов более чем на 10%\r\n<br>\r\n<br>Сообщение о существенном факте\r\n<br>“Сведения о фактах, повлекших разовое увеличение или уменьшение\r\n<br>стоимости активов эмитента более чем на 10 процентов”\r\n<br>\r\n<br>1.Общие сведения.\r\n<br>1.1. Полное фирменное наименование эмитента 	\r\n<br>Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	\r\n<br>Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r\n<br>1.4. ОГРН эмитента	1026200000111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Факты, повлекшие разовое увеличение стоимости активов эмитента более чем на 10 процентов: \r\n<br>-	рост кредитного портфеля;\r\n<br>-	рост торгового портфеля ценных бумаг.\r\n<br>Данные факты  обусловлены ростом привлеченных средств клиентов и собственных средств банка.\r\n<br>2.2. Дата появления фактов, повлекших разовое увеличение стоимости активов эмитента более чем на 10 процентов: “14” января 2008 г.\r\n<br>2.3. Стоимость активов эмитента на дату окончания отчетного периода (01.01.2007 г.), предшествующего отчетному периоду, в котором появились соответствующие факты: \r\n<br>4 549 595 тыс. руб.                                          \r\n<br>2.4. Стоимость активов эмитента на дату окончания отчетного периода (01.01.2008 г.), в котором появились соответствующие факты:     \r\n<br>6 108 503 тыс. руб.\r\n<br>2.5. Изменение стоимости активов эмитента в абсолютном и процентном отношении: увеличение на 1 558 908 тыс. руб. или на  34,3 %.\r\n<br>\r\n<br>3. Подписи\r\n<br>3.1. Председатель Правления       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “ 14 ” января 2008г.                              М.П.\r\n<br>3.3. Главный бухгалтер       \r\n<br>Прио-Внешторгбанка (ОАО)           _________________         В. И. Коробко 3.4. Дата “ 14 ” января 2008г.                              \r\n<br>\r\n<br>'),
(77, '1', '2008-01-17', 'Увеличение прибыли  более, чем на 10 %\r<br>\r<br>Сообщение о существенном факте\r<br>“Сведения о фактах, повлекших разовое увеличение (уменьшение) чистой\r<br>прибыли или чистых убытков эмитента более чем на 10 процентов”\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>2.1. Факты, повлекшие разовое увеличение чистой прибыли более чем на 10 процентов:\r<br>- рост чистой прибыли связан главным образом с пересчетом (снижением) налога на прибыль в связи с изменением налогооблагаемой базы.\r<br>2.2. Дата появления факта, повлекшего за собой разовое увеличение чистой прибыли эмитента более чем на 10 процентов: “17” января 2008 г.\r<br>2.3. Значение чистой прибыли эмитента за отчетный период, предшествующий отчетному периоду, в котором появился соответствующий факт (3 квартал 2007 г.):  18 785 тыс. руб.                                         \r<br>2.4. Значение чистой прибыли эмитента за отчетный период, в котором появился соответствующий факт (4 квартал 2007 г.): 57 631 тыс. руб.\r<br>2.5. Изменение чистой прибыли эмитента в абсолютном и процентном отношении: увеличение на 38 846 тыс. руб., или на 206,8 %.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М.В. Волков 3.2. Дата “ 17 ” января 2008г.                              М.П.\r<br>3.3. Главный бухгалтер       \r<br>Прио-Внешторгбанка (ОАО)           _________________         В. И. Коробко 3.4. Дата “ 17 ” января 2008г.                              \r<br>\r<br>'),
(78, '1', '2008-01-17', 'Увеличение годовой прибыли более, чем на 10%\r<br>\r<br>Сообщение о существенном факте\r<br>“Сведения о фактах, повлекших разовое увеличение (уменьшение) чистой\r<br>прибыли или чистых убытков эмитента более чем на 10 процентов”\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>2.1.Факты, повлекшие разовое увеличение чистой прибыли более чем на 10 процентов:\r<br>-	рост процентных доходов, обусловленный ростом кредитного портфеля,\r<br>-	получение разовых доходов от переуступки права требования.\r<br>2.2. Дата появления факта, повлекшего за собой разовое уменьшение чистой прибыли эмитента более чем на 10 процентов: “17” января  2008 г.\r<br>2.3. Значение чистой прибыли эмитента за отчетный период, предшествующий отчетному периоду, в котором появился соответствующий факт (2006 г.):  \r<br>72 486 тыс. руб.                                         \r<br>2.4. Значение чистой прибыли эмитента за отчетный период, в котором появился соответствующий факт (2007 г.): 111 676 тыс. руб.\r<br>2.5. Изменение чистой прибыли эмитента в абсолютном и процентном отношении: снижение на 39 190 тыс. руб., или на 54,1 %.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М.В. Волков 3.2. Дата “ 17 ” января 2008г.                              М.П.\r<br>3.3. Главный бухгалтер       \r<br>Прио-Внешторгбанка (ОАО)           _________________         В. И. Коробко 3.4. Дата “ 17 ” января 2008г.                              \r<br>\r<br>'),
