.04.2008г.\r<br>Основание для изменения доли принадлежащих указанному лицу обыкновенных акций эмитента – отчуждение лицом обыкновенных акций эмитента. \r<br>Дата внесения соответствующей записи по лицевому счету указанного лица  28.03.2008г.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “03” апреля  2008 г.                              М.П.                                                      \r<br>\r<br>'),
