я изменения доли принадлежащих указанному лицу обыкновенных акций эмитента – приобретение лицом обыкновенных акций эмитента.\r<br>Дата внесения соответствующей записи по лицевому счету указанного лица  18.04.2008г.\r<br>Наименование: общество с ограниченной ответственностью «ГВЛ».\r<br>Доля принадлежавших указанному лицу обыкновенных акций эмитента до изменения – 6,966 %\r<br>Доля принадлежащих указанному лицу обыкновенных акций эмитента после изменения – 0 %. \r<br>Дата, в которую эмитент узнал об изменении доли принадлежащих указанному лицу обыкновенных акций эмитента: 04.05.2008г.\r<br>Основание для изменения доли принадлежащих указанному лицу обыкновенных акций эмитента – отчуждение лицом обыкновенных акций эмитента. \r<br>Дата внесения соответствующей записи по лицевому счету указанного лица  29.04.2008г.\r<br>Наименование: общество с ограниченной ответственностью «ВАГ».\r<br>Доля принадлежавших указанному лицу обыкновенных акций эмитента до изменения – 15,449 %\r<br>Доля принадлежащих указанному лицу обыкновенных акций эмитента после изменения – 0 %. \r<br>Дата, в которую эмитент узнал об изменении доли принадлежащих указанному лицу обыкновенных акций эмитента: 04.05.2008г.\r<br>Основание для изменения доли принадлежащих указанному лицу обыкновенных акций эмитента – отчуждение лицом обыкновенных акций эмитента. \r<br>Дата внесения соответствующей записи по лицевому счету указанного лица  18.04.2008г.- 10,401%, 30.04.2008г.-5,048%\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “04” мая  2008 г.                              М.П.                                                      \r<br>\r<br>'),
(84, '1', '2008-05-28', 'Решения Совета директоров (о созыве годового общего собрания акционеров)\r<br>\r<br>\r<br>Сообщение о сведениях, \r<br>которые могут оказать существенное влияние на стоимость ценных бумаг\r<br> акционерного общества\r<br>\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес страницы в сети “Интернет”, используемой эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>Информация о принятых Советом директоров Прио-Внешторгбанка (открытое акционерное общество) решениях: о созыве годового общего собрания акционеров, утверждении повестки дня годового общего собрания акционеров Прио-Внешторгбанка (ОАО), о рекомендациях по размеру выплачиваемого дивиденда по акциям.\r<br>Дата проведения заседания совета директоров эмитента, на котором принято соответствующее решение: 28.05.2008 г.\r<br>Дата составления и номер протокола заседания совета директоров эмитента, на котором принято соответствующее решение: № 4 от 28.05.2008 г.\r<br>Содержание решений, принятых советом директоров эмитента:\r<br>1. Провести годовое общее собрание акционеров Банка «28» июня 2008 года. Место проведения собрания: г. Рязань, ул.Есенина, д.82/26. Начало регистрации 10-00, начало собрания - 11-00.\r<br>2. Утвердить следующую повестку годового общего собрания акционеров:\r<br>1.	Утверждение годового отчета, годовой бухгалтерской отчетности, в том числе отчета о прибылях и убытках (счетов прибылей и убытков) Банка.\r<br>2.	Утверждение изменений, вносимых в устав Банка.\r<br>3.	Поручение Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией изменений, вносимых в устав Банка.\r<br>4.	Утверждение «Положения о Правлении и Председателе Правления Прио-Внешторгбанка (ОАО)» в новой редакции.\r<br>5.	Утверждение  «Положения о Ревизионной комиссии Прио-Внешторгбанка (ОАО)» в новой редакции.\r<br>6.	Избрание членов Совета директоров Банка.\r<br>7.	Предоставление Председателю Правления Банка право подписания уведомления об избрании членов Совета директоров Банка.\r<br>8.	Избрание членов Счетной комиссии Банка.\r<br>9.	Избрание членов Ревизионной комиссии Банка.\r<br>10.	Определение размера выплачиваемых членам Ревизионной комиссии Банка вознаграждений.\r<br>11.	Утверждение аудитора Банка.\r<br>12.	Распределение прибыли, в том числе выплата (объявление) дивидендов по результатам финансового года.\r<br>13.	Определение печатного издания для публикования сообщений акционерам Банка\r<br>3. Предложить годовому общему собранию акционеров: считать нецелесообразным выплату дивидендов за 2007 год по обыкновенным акциям Банка, по привилегированным акциям Банка выплатить 15 процентов от номинальной стоимости.\r<br>\r<br>\r<br>3. Подписи\r<br>3.1. И.о. Председателя Правления-        \r<br>первый заместитель Председателя Правления       \r<br>Прио-Внешторгбанка (ОАО)    _________________         А.А. Язев \r<br>3.2. Дата “ 28 ” мая 2008г.                              М.П.                                                      \r<br>\r<br>'),
(85, '1', '2008-05-28', 'О дате закрытия реестра\r<br>\r<br>\r<br>Сообщение о существенном факте\r<br>“Сведения о дате закрытия реестра акционеров эмитента”\r<br>\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк(открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес страницы в сети “Интернет”, используемой эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>\r<br>2. Содержание сообщения\r<br>2.1. Категория (тип) акций Прио-Внешторгбанка (ОАО), в отношении которых составляется список их владельцев:обыкновенные бездокументарные именные акции Прио-Внешторгбанка (ОАО), государственный регистрационный номер 10200212В; привилегированные бездокументарные именные акции Прио-Внешторгбанка (ОАО), государственный регистрационный номер 20100212В.\r<br>2.2  Цель, для которой составляется список владельцев акций прио-Внешторгбанка (ОАО): участие в годовом общем собрании акционеров Прио-Внешторгбанка (ОАО) и выплата дивидендов за 2007г.\r<br>2.3.  Дата на которую составляется список владельцев акций Прио-Внешторгбанка(ОАО): 30 мая.2008 г.\r<br>2.4. Дата составления протокола заседания Совета директоров Прио-Внешторгбанка (ОАО) №4 на котором принято решение о дате составления списка владельцев акций Прио-Внешторгбанка (ОАО):    28 мая 2008г.\r<br>\r<br>3. Подписи\r<br>3.1. И.о. Председателя Правления-        \r<br>первый заместитель Председателя Правления       \r<br>Прио-Внешторгбанка (ОАО)       _________________         А.А. Язев \r<br>3.2. Дата “28” мая 2008г.                      М.П.                                                      \r<br>\r<br>'),
(86, '1', '2008-06-04', 'Изменение доли 5-процентника\r<br>\r<br>Сообщение о существенном факте\r<br>"Сведения о включении в реестр акционеров эмитента акционера, владеющего не менее чем 5 процентами обыкновенных акций эмитента, а также о любом изменении, в результате которого доля принадлежащих этому акционеру таких акций стала более или менее 5, 10, 15, 20, 25, 30, 50 или 75 процентов размещенных обыкновенных акций"\r<br>\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>\r<br>2. Содержание сообщения\r<br>Фамилия, имя, отчество: Ганишина Марина Николаевна.\r<br>Доля принадлежавших указанному лицу обыкновенных акций эмитента до изменения – 10,401 %.\r<br>Доля принадлежащих указанному лицу обыкновенных акций эмитента после изменения – 13,262 %.\r<br>Дата, в которую эмитент узнал об изменении доли принадлежащих указанному лицу обыкновенных акций эмитента: 04.06.2008г.\r<br>Основание для изменения доли принадлежащих указанному лицу обыкновенных акций эмитента – приобретение лицом обыкновенных акций эмитента.\r<br>Дата внесения соответствующей записи по лицевому счету указанного лица  23.05.2008г.\r<br>Фамилия, имя, отчество: Ганишин Виктор Алексеевич.\r<br>Доля принадлежавших указанному лицу обыкновенных акций эмитента до изменения – 19,579 %.\r<br>Доля принадлежащих указанному лицу обыкновенных акций эмитента после изменения – 16,718 %.\r<br>Дата, в которую эмитент узнал об изменении доли принадлежащих указанному лицу обыкновенных акций эмитента: 04.06.2008г.\r<br>Основание для изменения доли принадлежащих указанному лицу обыкновенных акций эмитента – отчужлдение лицом обыкновенных акций эмитента.\r<br>Дата внесения соответствующей записи по лицевому счету указанного лица  23.05.2008г.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “04” июня  2008 г.                              М.П.                                                      \r<br>\r<br>');
