(87, '1', '2008-06-04', 'Изменение доли члена Совета директоров.\r<br>\r<br>\r<br>Сообщение о сведениях, \r<br>которые могут оказать существенное влияние на стоимость ценных бумаг\r<br> акционерного общества\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес страницы в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>Об изменении размера доли участия лица, являющегося членом Совета директоров в уставном капитале Прио-Внешторгбанка (ОАО) и об изменении размера доли принадлежащих указанному лицу обыкновенных акций Прио-Внешторгбанка(ОАО).\r<br>Фамилия, имя, отчество: Ганишин Виктор Алексеевич;\r<br>должность данного лица: Член Совета директоров Прио-Внешторгбанка(ОАО), Председатель Совета директоров Прио-Внешторгбанка(ОАО);\r<br>размер доли данного лица изменился в уставном капитале Прио-Внешторгбанка (открытое акционерное общество) место нахождения: 390023, г. Рязань, ул. Есенина, д.82/26;\r<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) до изменения: 19,571 %.\r<br>а также размер доли принадлежавших данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) до изменения: 19,579 %.\r<br>размер доли участия данного лица в уставном капитале Прио-Внешторгбанка (ОАО) после изменения: 16,714 %.\r<br>а также размер доли принадлежащих данному лицу обыкновенных акций Прио-Внешторгбанка (ОАО) после изменения: 16,718 %.\r<br>дата, в которую эмитент узнал об изменении доли указанного лица в уставном капитале: 04.06.2008г.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М. В. Волков 3.2. Дата “04”июня 2008г.                                     М.П.                                                      \r<br>\r<br>'),
(88, '1', '2008-06-30', 'Решения годового собрания\r<br>\r<br>Сообщение о существенном факте\r<br>“Сведения о решениях общих собраний”\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>2.1.  Вид общего собрания: годовое.\r<br>2.2. Форма проведения общего собрания: очная.\r<br>2.3. Дата и место проведения общего собрания: 28 июня 2008г., г. Рязань, ул Есенина, д. 82/26.\r<br>2.4. Кворум общего собрания: 34 453 676 голосов, что составляет 98,5799 % от общего количества обыкновенных акций. \r<br>2.5. Вопросы, поставленные на голосование и итоги голосования по ним:\r<br>1. Утвердить годовой отчет, годовую бухгалтерскую отчетность, в том числе отчет о прибылях и убытках (счета прибылей и убытков) Банка. \r<br>В подсчете результатов голосования по первому вопросу принимали участие 9 бюллетеней, количество голосов 34 453 676, голоса распределились следующим образом:\r<br>- «ЗА» подано 25 696 839 голосов, что составляет 74, 584 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» подано 8 756 837 голосов, что составляет 25, 416 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r<br>2. Утвердить изменения, вносимые в устав Банка. \r<br>В подсчете результатов голосования по второму вопросу принимали участие 9 бюллетеней, количество голосов 34 453 676, голоса распределились следующим образом:\r<br>- «ЗА» подано 34 453 676 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» - нет;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r<br>Для принятия решения по данному вопросу повестки дня требуется три четверти голосов. \r<br>3. Поручить Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией изменений, вносимых в устав Банка. \r<br>В подсчете результатов голосования по третьему вопросу принимали участие 9 бюллетеней, количество голосов 34 453 676, голоса распределились следующим образом:\r<br>- «ЗА» подано 34 453 676 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» - нет;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r<br>4.Утвердить «Положение о Правлении и Председателе Правления Прио-Внешторгбанка (ОАО)» в новой редакции.\r<br>В подсчете результатов голосования по четвертому вопросу принимали участие 9 бюллетеней, количество голосов 34 453 676, голоса распределились следующим образом:\r<br>- «ЗА» подано 34 453 676 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» - нет;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r<br>5. Утвердить «Положение о Ревизионной комиссии Прио-Внешторгбанка (ОАО)» в новой редакции.\r<br>В подсчете результатов голосования по пятому вопросу принимали участие 9 бюллетеней, количество голосов 34 453 676, голоса распределились следующим образом:\r<br>- «ЗА» подано 34 453 676 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» - нет;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r<br>6.Избрать в члены Совета директоров Банка:\r<br>-Ганишин Виктор Алексеевич (паспорт серии 6105 № 319452 выдан Советским РОВД г. Рязани 18.05.2006 г.) - Председатель Совета директоров Прио-Внешторгбанка (открытое акционерное общество);\r<br>-Кукушкин Сергей Александрович (паспорт серии 6100 № 247860 выдан Советским РОВД г. Рязани 17.08.2001 г.) - генеральный директор ОАО «Поликонд»;\r<br>-Ларионова Татьяна Алексеевна (паспорт серии 6103 № 841959 выдан Советским РОВД г. Рязани 07.04.2003 г.) - директор ООО «Ангелла»;\r<br>-Ларионов Николай Михайлович (паспорт серии 6106 № 407539 выдан ОУФМС России по Рязанской области в Советском районе г. Рязани 10.05.2007 г.) - на 28.01.2008 г. не работает;\r<br>-Мазаев Владимир Александрович (паспорт серии 6106 № 349993 выдан Советским РОВД г. Рязани 13.09.2006 г.) - заместитель Председателя Совета директоров Прио- Внешторгбанка (открытое акционерное общество);\r<br>-Маслова Наталья Владимировна (паспорт серии 6101 № 317548 выдан Железнодорожным РОВД г. Рязани 27.11.2001 г.) - советник по работе с клиентами аппарата Правления Прио-Внешторгбанка (открытое акционерное общество)\r<br>В подсчете результатов кумулятивного голосования по шестому вопросу принимали участие 9 бюллетеней, количество голосов 172 268 380, голоса распределились следующим образом:\r<br>- Ганишин Виктор Алексеевич – подано 32 121 036 голосов;\r<br>- Кукушкин Сергей Александрович - подано  32 121 035 голосов;\r<br>- Ларионова Татьяна Алексеевна - подано 8 784 189 голосов;\r<br>- Ларионов Николай Михайлович - подано 35 000 002 голоса;\r<br>- Мазаев Владимир Александрович -  подано 32 121 089 голосов;\r<br>- Маслова Наталья Владимировна –  подано 32 121 029 голосов. \r<br>7. Предоставить Председателю Правления Банка право подписания уведомления об избрании членов Совета директоров Банка.\r<br>В подсчете результатов голосования по седьмому вопросу принимали участие 9 бюллетеней, количество голосов 34 453 676, голоса распределились следующим образом:\r<br>- «ЗА» подано 34 453 676 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» - нет;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. \r<br>8.Избрать в члены Счетной комиссии Банка следующие кандидатуры:\r<br>- Гусева Юлия Викторовна (серии 61 06 № 332298 выдан Железнодорожным РОВД г. Рязани 14.06.2006 г.) – заместитель начальника кредитного управления Прио-Внешторгбанка (ОАО),\r<br>- Лядова Елена Ивановна (паспорт серии 61 00 № 060882 выдан Советским РОВД г. Рязани 29.06.2000 г.) - главный юрист юридического отдела Прио-Внешторгбанка (ОАО),\r<br>- Маркова Наталия Аркадьевна (паспорт серии 61 06 № 378588 выдан Советским РОВД г. Рязани 14.03.2007 г.) - начальник БЭК-офиса главной бухгалтерии Прио-Внешторгбанка (ОАО), \r<br>- Орехова Ирина Васильевна (паспорт серии 61 04 № 070802 выдан Октябрьским РОВД г. Рязани 17.11.2003 г.) - главный экономист сектора ценных бумаг управления ценных бумаг и пассивных операций Прио-Внешторгбанка (ОАО).\r<br>В подсчете результатов голосования по восьмому вопросу принимали участие 9 бюллетеней, количество голосов 34 453 676, голоса распределились следующим образом:\r<br>- «ЗА» подано 34 453 676 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» - нет;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r<br>9. Избрать членов Ревизионной комиссии Банка:\r<br>- Нечипоренко Мария Степановна (паспорт серии 61 04 № 031326 выдан Октябрьским РОВД г. Рязани 29.09.2003 г.) – начальник отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r<br>- Куличкова Галина Михайловна (паспорт серии 61 00 № 236226 выдан Рязанским РОВД Рязанской области 11.07.2001 г.) - заместитель начальника отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»;\r<br>- Ковзан Юлия Борисовна (паспорт серии 61 02 № 579728 выдан Советским РОВД г. Рязани 16.08.2002 г.) - главный бухгалтер отдела ведения бухгалтерского учета и отчетности ООО «Амальгата».\r<br>Голоса, принадлежащие членам Совета директоров Банка, членам Правления Банка, Председателю Правления Банка, не участвовали в подсчете голосов при подведении итогов голосования по девятому вопросу.В подсчете результатов голосования по девятому вопросу принимали участие 6 бюллетеней, количество голосов  9 375 875, голоса распределились следующим образом: 	\r<br>- Нечипоренко Мария Степановна (паспорт серии 61 04 № 031326 выдан Октябрьским РОВД г. Рязани 29.09.2003 г.) – начальник отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»\r<br>- «ЗА» подано  9 375 875 голосов, что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r<br>- «ПРОТИВ» - нет;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.	\r<br>- Куличкова Галина Михайловна (паспорт серии 61 00 № 236226 выдан Рязанским РОВД Рязанской области 11.07.2001г.) - заместитель начальника отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»\r<br>- «ЗА» подано  9 375 875 голосов, что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r<br>- «ПРОТИВ» - нет;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.	\r<br>- Ковзан Юлия Борисовна (паспорт серии 61 02 № 579728 выдан Советским РОВД г. Рязани 16.08.2002 г.) - главный бухгалтер отдела ведения бухгалтерского учета и отчетности ООО «Амальгата»\r<br>- «ЗА» подано  9 375 875 голосов,  что составляет 100 % от общего количества голосов владельцев обыкновенных акций, принимающих участие в голосовании по данному вопросу повестки дня;\r<br>- «ПРОТИВ» - нет;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет. \r<br>10.  Определить размер выплачиваемых членам Ревизионной комиссии вознаграждений: членам Ревизионной комиссии – десять тысяч рублей в год, Председателю Ревизионной комиссии двадцать тысяч рублей в год.	\r<br>В подсчете результатов голосования по десятому вопросу принимали участие 9 бюллетеней, количество голосов 34 453 676, голоса распределились следующим образом:\r<br>- «ЗА» подано 25 696 839 голосов, что составляет 74, 584 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» - нет;\r<br>- «ВОЗДЕРЖАЛСЯ» - подано 8 756 837 голосов, что составляет 25, 416 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций.\r<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r<br>11. Утвердить аудитором Банка: ЗАО «Аудиторско-консультационную фирму «МИАН» г. Москва.	\r<br>В подсчете результатов голосования по одиннадцатому вопросу принимали участие  9 бюллетеней, количество голосов 34 453 676, голоса распределились следующим образом:\r<br>- «ЗА» подано 25 696 839 голосов, что составляет 74, 584 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» -подано 8 756 837 голосов, что составляет 25, 416 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. \r<br>12. Утвердить  следующее предложение по распределению прибыли Банка за 2007 год: По результатам работы за 2007 год получена прибыль в сумме 73 421 017,66 рублей.После уплаты налогов нераспределенная прибыль составила 41 251 164,66 рубля.Предлагается распределить прибыль в сумме 41 251 164,66 рубля следующим образом:- направить на выплату дивидендов за 2007 год по привилегированным акциям в размере 15 % от номинала в сумме 2 250,00 рублей;- на пополнение фонда материального поощрения и социально-производственного развития в сумме 7 340 000,00 рублей;- оставшуюся после распределения часть прибыли в сумме 33 908 914,66 рублей направить в фонд накопления.Считать нецелесообразным выплату дивидендов за 2007 год по обыкновенным акциям Банка, по привилегированным акциям Банка выплатить 15 процентов от номинальной стоимости.	\r<br>В подсчете результатов голосования по двенадцатому вопросу принимали участие 9 бюллетеней, количество голосов 34 453 676, голоса распределились следующим образом:\r<br>- «ЗА» подано 25 696 839 голосов, что составляет 74, 584 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» -подано 8 756 837 голосов, что составляет 25, 416 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов.\r<br>13.Определить печатное издание для сообщения информации акционерам Банка: газета «Рязанские ведомости», в случае прекращения ее деятельности  -  газета «Экономика и жизнь. Русь».	\r<br>В подсчете результатов голосования по тринадцатому вопросу принимали участие 9 бюллетеней, количество голосов 34 453 676, голоса распределились следующим образом:\r<br>- «ЗА» подано 34 453 676 голосов, что составляет 100 % от общего количества голосов присутствующих на собрании владельцев обыкновенных акций;\r<br>- «ПРОТИВ» - нет;\r<br>- «ВОЗДЕРЖАЛСЯ» - нет.\r<br>Для принятия решения по данному вопросу повестки дня требуется простое большинство голосов. \r<br>2.6. Формулировки решений, принятых общим собранием:\r<br>-Утвердить годовой отчет, годовую бухгалтерскую отчетность, в том числе отчет о прибылях и убытках (счета прибылей и убытков) Банка. \r<br>-  Утвердить изменения, вносимые в устав Банка.  \r<br>- Поручить Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией изменений, вносимых в устав Банка. \r<br>- Утвердить «Положение о Правлении и Председателе Правления Прио-Внешторгбанка (ОАО)» в новой редакции.\r<br>- Утвердить «Положение о Ревизионной комиссии Прио-Внешторгбанка (ОАО)» в новой редакции.\r<br>- В члены Совета директоров Банка избраны следующие лица: \r<br>Ганишин Виктор Алексеевич, \r<br>Кукушкин Сергей Александрович, \r<br>Ларионов Николай Михайлович, \r<br>Мазаев Владимир Александрович, \r<br>Маслова Наталья Владимировна. \r<br>-Предоставить Председателю Правления Банка право подписания уведомления об избрании членов Совета директоров Банка . \r<br>- Избрать в члены Счетной комиссии Банка следующие кандидатуры:\r<br>Гусева Юлия Викторовна (серии 61 06 № 332298 выдан Железнодорожным РОВД г. Рязани 14.06.2006 г.) – заместитель начальника кредитного управления Прио-Внешторгбанка (ОАО),\r<br>Лядова Елена Ивановна (паспорт серии 61 00 № 060882 выдан Советским РОВД г. Рязани 29.06.2000 г.) - главный юрист юридического отдела Прио-Внешторгбанка (ОАО),\r<br>Маркова Наталия Аркадьевна (паспорт серии 61 06 № 378588 выдан Советским РОВД г. Рязани 14.03.2007 г.) - начальник БЭК-офиса главной бухгалтерии Прио-Внешторгбанка (ОАО), \r<br>Орехова Ирина Васильевна (паспорт серии 61 04 № 070802 выдан Октябрьским РОВД г. Рязани 17.11.2003 г.) - главный экономист сектора ценных бумаг управления ценных бумаг и пассивных операций Прио-Внешторгбанка (ОАО).\r<br>-  В члены Ревизионной комиссии Банка избраны следующие лица:\r<br>Нечипоренко Мария Степановна;\r<br>Куличкова Галина Михайловна;\r<br>Ковзан Юлия Борисовна. \r<br>- Определить размер выплачиваемых членам Ревизионной комиссии вознаграждений: членам Ревизионной комиссии – десять тысяч рублей в год, Председателю Ревизионной комиссии двадцать тысяч рублей в год .\r<br>-Утвердить аудитором Банка: ЗАО «Аудиторско-консультационную фирму «МИАН» г. Москва. \r<br>- Утвердить  следующее предложение по распределению прибыли Банка за 2007 год: По результатам работы за 2007 год получена прибыль в сумме 73 421 017,66 рублей.После уплаты налогов нераспределенная прибыль составила 41 251 164,66 рубля.Предлагается распределить прибыль в сумме 41 251 164,66 рубля следующим образом:- направить на выплату дивидендов за 2007 год по привилегированным акциям в размере 15 % от номинала в сумме 2 250,00 рублей;- на пополнение фонда материального поощрения и социально-производственного развития в сумме 7 340 000,00 рублей;- оставшуюся после распределения часть прибыли в сумме 33 908 914,66 рублей направить в фонд накопления.Считать нецелесообразным выплату дивидендов за 2007 год по обыкновенным акциям Банка, по привилегированным акциям Банка выплатить 15 процентов от номинальной стоимости.\r<br>- Определить печатное издание для сообщения информации акционерам Банка: газета «Рязанские ведомости», в случае прекращения ее деятельности  -  газета «Экономика и жизнь. Русь».\r<br>2.7. Дата составления протокола общего собрания 30 июня 2008г.\r<br>3. Подпись\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           \r<br>_________________М.В.Волков                                                        (подпись)\r<br>3.2. Дата “30” июня 2008г.                              М.П.\r<br>\r<br>'),
