(92, '1', '2008-07-15', 'Решение Совета директоров: об образовании единоличного и/или коллегиального исполнительных органов.\r<br>\r<br>\r<br>Сообщение о сведениях,\r<br> которые могут оказать существенное влияние на стоимость ценных бумаг\r<br>акционерного общества\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>\r<br>2. Содержание сообщения\r<br>2.1. Информация о принятом Советом директоров Прио-Внешторгбанка (ОАО) решении: об образовании единоличного и/или коллегиального исполнительных органов.\r<br>2.2. Дата проведения заседания Совета директоров Банка, на котором принято соответствующее решение	15 июля 2008 г.\r<br>2.3. Дата составления и номер протокола заседания Совета директоров Банка, на котором принято соответствующее решение	15 июля 2008г. № 6\r<br>2.4. Содержание решений, принятых Советом директоров Банка: \r<br>п. 1. Избрать Председателем Правления Банка Волкова Михаила Владимировича; п. 2. Определить численный состав Правления Банка в количестве восемь членов; \r<br>п. 3.1 По предложению Председателя Правления Банка утвердить следующий состав Правления Банка: \r<br>1.	Волков М.В.\r<br>2.	Язев А.А.\r<br>3.	Силкина Е.Н.         \r<br>4.	Анашкина Л.М.\r<br>5.	Мясников А.А.\r<br>6.	Терентьева Н.Г.\r<br>7.	Мельников С.В.;\r<br>п. 3.3. Назначить первым заместителем Председателя Правления Банка Язева А.А., заместителями Председателя Правления Банка Силкину Е.Н., Анашкину Л.М., Мясникова А.А.\r<br>2.5. Дополнительные сведения: \r<br>1. Фамилия, имя, отчество лица, утвержденного членом Правления Банка, избранного Председателем Правления Банка: \r<br>Волков Михаил Владимирович,\r<br>доля участия данного лица в уставном капитале Банка: 0,0002 %,  \r<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0 %.\r<br>2. Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного первым заместителем Председателя Правления Банка: \r<br>Язев Алексей Алексеевич,\r<br>доля участия данного лица в уставном капитале Банка: 0 %, \r<br>доля принадлежащих данному лицу обыкновенных акций Банка 0 %.\r<br>3. Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка:\r<br>Силкина Елена Николаевна,доля участия данного лица в уставном капитале Банка: 0,00027 %, \r<br>доля принадлежащих данному лицу обыкновенных акций Банка 0 %.\r<br>4. Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка: \r<br>Анашкина Людмила Михайловна,\r<br>доля участия данного лица в уставном капитале Банка: 0%, \r<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0%.\r<br>5. Фамилия, имя, отчество лица, утвержденного членом Правления Банка, назначенного заместителем Председателя Правления Банка: \r<br>Мясников Алексей Александрович,доля участия данного лица в уставном капитале Банка: 0, 00043 %, \r<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,00043 %.\r<br>6. Фамилия, имя, отчество лица, утвержденного членом Правления Банка:\r<br>Терентьева Наталья Григорьевна,\r<br>доля участия данного лица в уставном капитале Банка: 0,00005 %, \r<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,00002%.\r<br>7. Фамилия, имя, отчество лица, утвержденного членом Правления Банка:\r<br>Мельников Сергей Владимирович,\r<br>доля участия данного лица в уставном капитале Банка: 0%., \r<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0%. \r<br>\r<br>Доля участия указанных лиц в уставном капитале дочерних и зависимых обществ акционерного общества, а в случае, когда такими дочерними и /или зависимыми обществами являются акционерные общества, -также доля принадлежащих указанным лицам обыкновенных акций дочерних и /или зависимых обществ акционерного общества: \r<br>дочерние и/или зависимые общества Банка отсутствуют.\r<br>Доля обыкновенных акций акционерного общества и/или его дочерних и зависимых обществ, которая может быть приобретена указанными лицами в результате осуществления прав по предоставленным указанным лицам опционам эмитента и/или его дочерних и зависимых обществ: опционы \r<br>Банка и/или его дочерних и зависимых обществ отсутствуют.\r<br>\r<br>3. Подпись\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М.В. Волков 3.2. Дата “ 15 ” июля 2008г.                              М.П.\r<br>\r<br>'),
(93, '1', '2008-08-27', '"Исполнение обязательств по выплате дивидендов"\r<br>\r<br>\r<br>Сообщение о существенных фактах\r<br>“Сведения о начисленных и/или выплаченных доходах по ценным бумагам эмитента”\r<br>“Сведения о сроках исполнения обязательств эмитента перед владельцами ценных бумаг эмитента”\r<br>\r<br>1.   Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом 00212В\r<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2.  Содержание сообщения.\r<br>2.1 Вид, категория (тип), серия и иные идентификационные признаки ценных бумаг: акции привилегированные именные бездокументарные.\r<br>2.2.Государственный регистрационный номер выпуска ценных бумаг: 20100212В, дата государственной регистрации: 25.12.1992г. зарегистрирован выпуск в объеме 5000 руб. и 29.03.1996г. зарегистрирован выпуск в объеме 10000 руб.\r<br>2.3.Наименование регистрирующего органа, осуществившего государственную регистрацию выпуска ценных бумаг: Главное управление Центрального Банка Российской Федерации по Рязанской области.\r<br>2.4.Орган управления, принявший решение о выплате дивидендов по акциям: годовое общее собрание акционеров Прио-Внешторгбанка (ОАО).\r<br>2.5. Дата принятия решения о выплате дивидендов по акциям: 28.06.2008г. 2.6. Дата составления протокола годового общего собрания акционеров Прио-Внешторгбанка (ОАО), на котором принято решение о выплате дивидендов по акциям: 30.06.2008г.\r<br>2.7. Содержание обязательства: выплата дивидендов по привилегированным именным бездокументарным акциям Прио-Внешторгбанка (ОАО) за 2007год;  размер обязательства в денежном выражении: 2250 рублей.\r<br>2.8. Общий размер дивидендов, начисленных на акции привилегированные именные бездокументарные: 2250 рублей; размер дивиденда, начисленного на одну акцию привилегированную именную бездокументарную: 15 % от номинальной стоимости или 15 копеек на одну акцию.\r<br>2.9. Форма выплаты доходов по ценным бумагам: денежные средства.\r<br>2.10.Дата окончания срока, в течение которого обязательство по выплате дивидендов по акциям должно быть исполнено: 27.08.2008г.\r<br>2.11.Общий размер дивидендов, выплаченных по привилегированным именным бездокументарным акциям Прио-Внешторгбанка (ОАО): 2250 рублей.\r<br>2.12.Факт исполнения обязательства: обязательство по выплате дивидендов по привилегированным бездокументарным именным акциям Прио-Внешторгбанка (ОАО) за 2007 год  исполнено в полном объеме.                                     \r<br>\r<br>\r<br>3.   Подпись\r<br>3.1. Председатель Правления  \r<br>     Прио-Внешторгбанка (ОАО) ___________М.В. Волков\r<br>                               (подпись)\r<br>                                  М.П.\r<br>3.2. Дата “ 27 ” августа 2008г.  \r<br>'),
(94, '1', '2008-09-12', 'Решение Совета директоров об изменении в Составе Правления\r<br>\r<br>Сообщение о сведениях,\r<br> которые могут оказать существенное влияние на стоимость ценных бумаг\r<br>акционерного общества\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>\r<br>2. Содержание сообщения\r<br>2.1. Информация о принятом Советом директоров Прио-Внешторгбанка (ОАО)  решении: об изменении в составе коллегиального исполнительного органа.\r<br>2.2. Дата проведения заседания Совета директоров Банка, на котором принято соответствующее решение	10 сентября 2008 г.\r<br>2.3. Дата составления и номер протокола заседания Совета директоров Банка, на котором принято соответствующее решение	\r<br>12 сентября 2008г. № 8\r<br>2.4. Содержание решений, принятых Советом директоров Банка: \r<br>п. 1. Перевести Терентьеву Наталью Григорьевну на должность заместителя Председателя Правления Банка - начальника управления ценных бумаг и пассивных операций; \r<br>Ввести в состав Правления Банка Мишуткину Ирину Владимировну – начальника управления кредитования Банка.\r<br>2.5. Дополнительные сведения: \r<br>1. Фамилия, имя, отчество лица, назначенного заместителем Председателя Правления Банка: Терентьева Наталья Григорьевна,\r<br>доля участия данного лица в уставном капитале Банка: 0,00005 %, \r<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0,00002%.\r<br>2. Фамилия, имя, отчество лица, утвержденного членом Правления Банка: Мишуткина Ирина Владимировна,\r<br>доля участия данного лица в уставном капитале Банка: 0%,  \r<br>доля принадлежащих данному лицу обыкновенных акций Банка: 0 %.\r<br>Доля участия указанных лиц в уставном капитале дочерних и зависимых обществ акционерного общества, а в случае, когда такими дочерними и /или зависимыми обществами являются акционерные общества, -также доля принадлежащих указанным лицам обыкновенных акций дочерних и /или зависимых обществ акционерного общества: дочерние и/или зависимые общества Банка отсутствуют.Доля обыкновенных акций акционерного общества и/или его дочерних и зависимых обществ, которая может быть приобретена указанными лицами в результате осуществления прав по предоставленным указанным лицам опционам эмитента и/или его дочерних и зависимых обществ: опционы Банка и/или его дочерних и зависимых обществ отсутствуют.\r<br>\r<br>3. Подпись\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М.В. Волков 3.2. Дата “ 12” сентября 2008г.                              М.П.\r<br>\r<br>'),
(95, '1', '2008-10-06', 'Увеличение активов более чем на 10%\r<br>\r<br>Сообщение о существенном факте\r<br>“Сведения о фактах, повлекших разовое увеличение или уменьшение\r<br>стоимости активов эмитента более чем на 10 процентов”\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>2.1. Факты, повлекшие разовое увеличение стоимости активов эмитента более чем на 10 процентов:\r<br>-	рост расходов банка на 508 120 тыс. руб. (в том числе расходы по созданию резерва на возможные потери 273 485 тыс руб.). Данный факт обусловлен спецификой бухгалтерского учета доходов и расходов  в течение года (нарастающим итогом без сворачивания на финансовый результат);\r<br>-	рост ссудной и приравненной к ней задолженности на 370 437 тыс. руб., обусловленный ростом привлеченных средств клиентов. \r<br>2.2. Дата появления фактов, повлекших разовое увеличение стоимости активов эмитента более чем на 10 процентов: “06” октября 2008г.\r<br>2.3. Стоимость активов эмитента на дату окончания отчетного периода (01.07.2008г.), предшествующего отчетному периоду, в котором появились соответствующие факты: 6 804 223 тыс. руб.                                          \r<br>2.4. Стоимость активов эмитента на дату окончания отчетного периода (01.10.2008г.), в котором появились соответствующие факты: 7 765 816 тыс. руб.\r<br>2.5. Изменение стоимости активов эмитента в абсолютном и процентном отношении: увеличение на 961 593 тыс. руб. или на14,1 %.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________     М. В. Волков 3.2. Дата “ 06 ” октября 2008г.                              М.П.\r<br>3.3. Исполняющий обязанности главного бухгалтера       \r<br>Прио-Внешторгбанка (ОАО)           _________________     Т. В. Касаткина\r<br>3.4. Дата “ 06 ” октября 2008г.                              \r<br>\r<br>'),
(96, '1', '2008-10-08', 'Решение Совета директоров о созыве внеочередного собрания\r<br>\r<br>Сообщение о сведениях, \r<br>которые могут оказать существенное влияние на стоимость ценных бумаг\r<br> акционерного общества\r<br>\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес страницы в сети “Интернет”, используемой эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>Информация о принятых Советом директоров Прио-Внешторгбанка (открытое акционерное общество) решениях: о созыве внеочередного общего собрания акционеров, утверждении повестки дня внеочередного общего собрания акционеров Прио-Внешторгбанка (ОАО):\r<br>Дата проведения заседания совета директоров эмитента, на котором принято соответствующее решение: 06 октября 2008 г.\r<br>Дата составления и номер протокола заседания совета директоров эмитента, на котором принято соответствующее решение: 08.10.2008г., № 10. \r<br>Содержание решений, принятых советом директоров эмитента:\r<br>-	Провести внеочередное общее собрание акционеров Банка «20» декабря 2008 года. \r<br>Место проведения собрания: 390023    г. Рязань, ул.Есенина, д.82/26, 7 этаж, конференцзал. \r<br>Начало регистрации 10-00,  начало собрания - 11-00. \r<br>Форма проведения собрания- совместное присутствие.\r<br>-	Утвердить следующую повестку дня внеочередного общего собрания акционеров:\r<br>1.Утверждение изменений, вносимых в устав Банка.\r<br>2. Поручение Председателю Совета директоров Банка подписать ходатайства и другие документы, связанные с регистрацией изменений, вносимых в устав Банка. \r<br>3. Утверждение новой редакции «Положения о Совете директоров Прио-Внешторгбанка (открытое акционерное общество)».\r<br>4. О вознаграждении членам Совета директоров Банка. \r<br>5. Об использовании прибыли Банка. \r<br>6. Досрочное прекращение полномочий членов Совета директоров Банка.\r<br>7. Определение количественного состава Совета директоров Банка.\r<br>8. Избрание членов Совета директоров Банка.\r<br>9. Предоставление Председателю Правления Банка права подписания уведомления об избрании членов Совета директоров Банка.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)                                        _________________         М.В. Волков \r<br>3.2. Дата “ 08 ” октября 2008г.                              М.П.                                                      \r<br>\r<br>'),
(97, '1', '2008-10-08', 'Сведения о дате закрытия реестра к внеочередному собранию\r<br>\r<br>\r<br>Сообщение о существенном факте\r<br>“Сведения о дате закрытия реестра акционеров эмитента”\r<br>\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк(открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес страницы в сети “Интернет”, используемой эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>\r<br>2. Содержание сообщения\r<br>2.1. Категория (тип) акций Прио-Внешторгбанка (ОАО), в отношении которых составляется список их владельцев:\r<br>обыкновенные бездокументарные именные акции Прио-Внешторгбанка (ОАО), государственный регистрационный номер 10200212В; \r<br>привилегированные бездокументарные именные акции Прио-Внешторгбанка (ОАО), государственный регистрационный номер 20100212В.\r<br>2.2  Цель, для которой составляется список владельцев акций прио-Внешторгбанка (ОАО): участие во внеочередном общем собрании акционеров Прио-Внешторгбанка (ОАО).\r<br>2.3.  Дата на которую составляется список владельцев акций Прио-Внешторгбанка(ОАО): 07 октября 2008 г.\r<br>2.4. Дата составления протокола заседания Совета директоров Прио-Внешторгбанка (ОАО) № 10 на котором принято решение о дате составления списка владельцев акций Прио-Внешторгбанка (ОАО):       08 октября 2008г.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)           _________________         М.В. Волков 3.2. Дата “08” октября 2008г.                      М.П.                                                      \r<br>\r<br>'),
(98, '1', '2008-10-10', 'Увеличение прибыли более чем на 10%\r<br>\r<br>Сообщение о существенном факте\r<br>“Сведения о фактах, повлекших разовое увеличение (уменьшение) чистой\r<br>прибыли или чистых убытков эмитента более чем на 10 процентов”\r<br>\r<br>1.Общие сведения.\r<br>1.1. Полное фирменное наименование эмитента 	\r<br>Прио-Внешторгбанк (открытое акционерное общество)\r<br>1.2. Сокращенное фирменное наименование эмитента	\r<br>Прио-Внешторгбанк (ОАО)\r<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д. 82/26\r<br>1.4. ОГРН эмитента	1026200000111\r<br>1.5. ИНН эмитента	6227001779\r<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r<br>1.7. Адрес странице в сети “Интернет”, используемый эмитентом для раскрытия информации	Www.priovtb.com\r<br>\r<br>2. Содержание сообщения\r<br>2.1. Факты, повлекшие разовое увеличение чистой прибыли более чем на 10 процентов:\r<br>-	Уменьшение налога на прибыль в 3 квартале 2008 года  по расчету за первое полугодие.\r<br>-	Рост чистых процентных доходов.\r<br>2.2. Дата появления факта, повлекшего за собой разовое увеличение чистой прибыли эмитента более чем на 10 процентов: “10” октября 2008 г.\r<br>2.3. Значение чистой прибыли эмитента за отчетный период, предшествующий отчетному периоду, в котором появился соответствующий факт (2 кв. 2008 г.):  7 738 тыс. руб.                                         \r<br>2.4. Значение чистой прибыли эмитента за отчетный период, в котором появился соответствующий факт (3 кв. 2008 г.): 47 980 тыс. руб.\r<br>2.5. Изменение чистой прибыли эмитента в абсолютном и процентном отношении: увеличение  на 40 242 тыс. руб., или на 520 %.\r<br>\r<br>3. Подписи\r<br>3.1. Председатель Правления       \r<br>Прио-Внешторгбанка (ОАО)      _________________         М.В. Волков \r<br>3.2. Дата “ 10 ” октября 2008г.                              М.П.\r<br>3.3. Исполняющий обязанности главного бухгалтера       \r<br>Прио-Внешторгбанка (ОАО)       _________________         Т. В. Касаткина 3.4. Дата “ 10 ” октября 2008г.                              \r<br>\r<br>'),
(99, '1', '2008-11-11', 'О размещении ежеквартального отчета    \r\n<br>\r\n<br>   \r\n<br>                          Сообщение \r\n<br>          о порядке доступа к информации, содержащейся \r\n<br>                     в ежеквартальном отчете\r\n<br>\r\n<br>1. Общие сведения\r\n<br>1.1. Полное фирменное наименование эмитента (для некоммерческой организации – наименование)	Прио-Внешторгбанк (открытое акционерное общество)\r\n<br>1.2. Сокращенное фирменное наименование эмитента	Прио-Внешторгбанк (ОАО)\r\n<br>1.3. Место нахождения эмитента	390023, г. Рязань, ул. Есенина, д.82/26\r\n<br>1.4. ОГРН эмитента	1 026 200 000 111\r\n<br>1.5. ИНН эмитента	6227001779\r\n<br>1.6. Уникальный код эмитента, присвоенный регистрирующим органом	00212В\r\n<br>1.7. Адрес страницы в сети Интернет, используемой эмитентом для раскрытия информации	www.priovtb.com\r\n<br>\r\n<br>2. Содержание сообщения\r\n<br>2.1. Ежеквартальный отчет по ценным бумагам за 3 квартал 2008 года. 2.2. Опубликован 11.11.2008.2.3. Электронная версия отчета доступна на сайте Прио-Внешторгбанка. Банк предоставляет бумажную копию ежеквартального отчета владельцам ценных бумаг и другим заинтересованным лицам в срок не более 7 дней с даты предъявления соответствующего требования за плату, не превышающую расходы по изготовлению этой копии.  Банковские реквизиты расчетного счета эмитента для оплаты расходов по изготовлению копии документа и размер таких расходов опубликованы на сайте Прио-Внешторгбанка (ОАО)  в разделе «Порядок предоставления копий документов».\r\n<br>\r\n<br>3. Подпись\r\n<br>3.1. Председатель Правления                                \r\n<br>Прио-Внешторгбанка           __________________      М.В. Волков          \r\n<br>\r\n<br>3.2. Дата «11» ноября 2008 г.         М.П.\r\n<br>\r\n<br>\r\n<br>	\r\n<br>\r\n<br>\r\n<br>');
INSERT INTO `faq` (`id`, `theme`, `qvestion`, `answer`) VALUES
(1, 1, 'Как правильно заполнить платежное поручение?', 'Порядок заполнения платежного поручения определен в Положении ЦБ РФ "О безналичных расчетах в РФ", № 2-П от 03.10.2002 г., также Вы можете найти его <a href=blanki.php> здесь </a>.'),
(2, 2, 'Могу ли я подгружать в программу Клиент-банк платежные поручения из моей бухгалтерской программы?', 'Программа Клиент-банк имеет функцию обмена документами с бухгалтерскими программами. Но, возможно, для этого Вам потребуется настроить свою бухгалтерскую программу. Структура файла обмена приведена в руководстве пользователя по системе "Клиент-банк". '),
(3, 2, 'Можно ли вести обмен платежными документами с банком от лица нескольких организаций на одном компьютере?', 'Да, это возможно. Для это Вам нужно заключить дополнительное соглашение к договору банковского счета этих организаций, дать заявку на подключение к системе "Клиент-банк" и получить комплект средств защиты передаваемой информации. Число обслуживаемых организаций неограничено.'),
(4, 2, 'Насколько быстро будет обработан документ, отправленный в банк с использованием системы "Клиент-банк"?', 'Вы отправили документ в банк, и завершили сеанс связи. Через несколько минут он поступает к Вашему ответственному исполнителю, который обрабатывает его в зависимости от наличия средств на Вашем счете.\r\nТакая технология позволяет сократить время на время поездки в Банк и на ввод документа в банковскую систему.'),
(5, 3, 'Как заполнить валютное платежное поручение?', ''),
(6, 4, 'Сколько монет можно купить в одни руки?', ''),
(7, 5, 'Можно ли взять кредит под честное слово и не отдавать?', ''),
(8, 6, 'Защищен ли вексель Прио-Внешторгбанка от подделок?', ''),
(9, 7, 'Сколько времени занимает процедура получения карты?', ''),
(10, 7, 'Какое различие между VISA или MasterCard?', ''),
(12, 9, 'Будет ли задолженность за коммунальные услуги считаться погашенной сразу после оплаты в Прио-Внешторгбанке или требуется более длительное  время, по сравнению с оплатой услуг на почте?', 'Ваша задолженность по оплате коммунальных услуг считается погашенной сразу после оплаты в наших Операционных кассах.'),
(13, 9, 'Какую комиссию берет Банк с меня за оплату коммунальных услуг?', 'За оплату коммунальных услуг Банк не берет с Вас комиссии.'),
(14, 10, 'Принимает ли банк неплатежные банкноты?', ''),
(15, 10, 'Можно ли обменять монеты достоинством меньше доллара?', ''),
(16, 10, 'Зачем нужна справка о покупке валюты?', '');
INSERT INTO `faq_question` (`id`, `on`, `theme`, `question`, `answer`) VALUES
