(2, '1', 2, 'Могу ли я подгружать в программу Клиент-банк платежные поручения из моей бухгалтерской программы?', 'Программа Клиент-банк имеет функцию обмена документами с бухгалтерскими программами. Но, возможно, для этого Вам потребуется настроить свою бухгалтерскую программу. Структура файла обмена приведена в руководстве пользователя по системе "Клиент-банк".'),
(3, '1', 2, 'Можно ли вести обмен платежными документами с банком от лица нескольких организаций на одном компьютере?', 'Да, это возможно. Для это Вам нужно заключить дополнительное соглашение к договору банковского счета этих организаций, дать заявку на подключение к системе "Клиент-банк" и получить комплект средств защиты передаваемой информации. Число обслуживаемых организаций неограничено.'),
(4, '1', 2, 'Насколько быстро будет обработан документ, отправленный в банк с использованием системы "Клиент-банк"?', 'Вы отправили документ в банк, и завершили сеанс связи. Через несколько минут он поступает к Вашему ответственному исполнителю, который обрабатывает его в зависимости от наличия средств на Вашем счете.\r\nТакая технология позволяет сократить время на время поездки в Банк и на ввод документа в банковскую систему.'),
(5, '1', 3, 'Как заполнить валютное платежное поручение?', ''),
(6, '1', 4, 'Сколько монет можно купить в одни руки?', ''),
(7, '1', 5, 'Можно ли взять кредит под честное слово и не отдавать?', ''),
(8, '1', 6, 'Защищен ли вексель Прио-Внешторгбанка от подделок?', ''),
(9, '1', 7, 'Сколько времени занимает процедура получения карты?', 'Изготовление и выпуск локальных карт \\"Прио\\" занимает 2 рабочих дня, срок изготовления международной пластиковой карты Master Card составит 10 дней. При необходимости возможно изготовление карты Master Card за 3-4 рабочих дня за отдельную плату в размере 60$'),
(10, '1', 7, 'Какое различие между VISA или MasterCard?', 'Принципиальным отличчием данных систем можно считать лишь принадлежность к различным финансовым ассоциациям, являющимися их совладельцами.'),
(12, '1', 9, 'Будет ли задолженность за коммунальные услуги считаться погашенной сразу после оплаты в Прио-Внешторгбанке или требуется более длительное  время, по сравнению с оплатой услуг на почте?', 'Ваша задолженность по оплате коммунальных услуг считается погашенной сразу после оплаты в наших Операционных кассах.'),
(13, '1', 9, 'Какую комиссию берет Банк с меня за оплату коммунальных услуг?', 'За оплату коммунальных услуг Банк не берет с Вас комиссии.'),
