(34, '1', '2009-08-20 11:34:29', '150 лет первой российской марке', 'Пруф', 'AG-925 / AU-999', '31,10 / 1,55', '9 января 2008', NULL);
INSERT INTO `news` (`id`, `on`, `date`, `title`, `preview`) VALUES
(1, '1', '2003-09-24 00:00:00', 'Банкиры оказывают помощь', 'Прио-Внешторгбанк начал с 24 сентября обслуживать безналичные денежные вклады в новой общеевропейской валюте - евро.'),
(2, '1', '2003-10-05 00:00:00', 'Расширяется филиальная сеть', 'Прио-Внешторгбанком вновь начал обслуживание предприятий и организаций Сасовского района.\r\nПрио-Внешторгбанк следует своей традиционной стратегии'),
(3, '1', '2004-01-01 00:00:00', 'С новым годом!!!!', 'Прио-Внешторгбанк поздравляет всех своих клиентов с Новым годом!\r\nСчастья и удачи вам в наступившем году!!!'),
(4, '1', '2003-12-13 00:00:00', 'Карты IP-телефонии и доступа к сети Интернет', 'Прио-Внешторгбанк предлагает своим клиентам сервисные карты IP-телефонии и доступа к сети Интернет, которые все желающие смогут приобрести в кассах Центрального офиса.'),
(5, '1', '2003-11-11 00:00:00', 'Договор о с<b>отрудничестве</b> с ЦентрТрансТелеКом', 'Прио-<B>Внешторгбанк заключил </B>договор о сотрудничестве с ЦентрТрансТелеКом, направленный на продвижение в регионе одной из самых качественных услуг связи.Прио-Внешторгбанк заключил договор о сотрудничестве с ЦентрТрансТелеКом, направленный на продвиже'),
(6, '1', '2004-01-23 00:00:00', 'Новый взгляд банка.', 'Прио-Внешторгбанк повысил процентные ставки по вкладам в иностранной валюте.'),
(7, '1', '2004-02-20 00:00:00', 'поздравляет Вас с Масленицей', 'Прио-Внешторгбанк от всей души поздравляет Вас с Масленицей и приглашает принять участие в традиционных общегородских гуляниях'),
(8, '1', '2004-02-26 00:00:00', 'Участие в Региональном Форуме Предпринимателей', 'В конце февраля Прио-Внешторгбанк принял участие в Первом Региональном Форуме Предпринимателей «Пути развития».'),
(9, '1', '2004-03-22 00:00:00', 'Вступление Прио-Внешторгбанка в систему S.W.I.F.T.', '7 марта 2004 г. Прио-Внешторгбанк в интересах своих клиентов стал членом системы S.W.I.F.T. Сообщество всемирных межбанковских финансовых телекоммуникаций -это высочайший уровень безопасности,надежности и конфиденциальности в международных операциях.'),
(10, '1', '2004-03-24 00:00:00', 'Экскурсия в Прио-Внешторгбанке для студентов РГРТА', 'Прио-Внешторгбанк постоянно работает с молодежью, участвует в подготовке будущих квалифицированных кадров. 24 марта 2004 г. в Прио-Внешторгбанке для студентов РГРТА была организована экскурсия-лекция.'),
(11, '1', '2004-04-26 00:00:00', 'Состоялось годовое собрание акционеров', '24 апреля в Рязани состоялось годовое собрание акционеров  Прио-Внешторгбанка. В ходе собрания были подведены итоги работы в 2003 году, намечены планы дальнейшего развития, приняты важные решения.'),
(12, '1', '2004-05-06 00:00:00', 'Скопин открывает Дни Банка в районах области', 'В Скопинском филиале Прио-Внешторгбанка, в рамках проведения Дней Банка в Скопине, состоялся розыгрыш призов юбилейной викторины. Мероприятие вызвало большой интерес среди жителей города и района.'),
(13, '1', '2004-06-01 00:00:00', 'Детям в подарок', '1 июня в Международный день защиты детей в Рязанском областном театре кукол состоялся благотворительный спектакль для детей-инвалидов и детей из малообеспеченных семей города Рязани и районов области'),
(14, '1', '2004-06-01 00:00:00', 'Избрание Председателя Совета директоров банка', '31 мая 2004 года Председателем Совета директоров вновь избран В.А.ГАНИШИН. Заместителями Председателя Совета Директоров банка избраны Н.М.ЛАРИОНОВ и В.А.МАЗАЕВ.'),
(15, '1', '2004-06-02 00:00:00', 'Назначение Председателя Правления банка', 'С 1 июня 2004 года Председателем Правления Прио-Внешторгбанка (ОАО) назначен Волков Михаил Владимирович'),
(16, '1', '2004-06-02 00:00:00', 'Назначение и.о.главного бухгалтера банка', 'С 1 июня 2004 года и.о. Главного бухгалтера Прио-Внешторгбанка назначена Коробко Вера Ивановна'),
(17, '1', '2004-06-21 00:00:00', 'Назначение Главного бухгалтера банка', '18 июня 2004 года Главным бухгалтером Прио-Внешторгбанка (ОАО) назначена Коробко Вера Ивановна.'),
(18, '1', '2004-06-30 00:00:00', 'Дни Банка в Сасовском районе Рязанской области', 'В год 15-летия Прио-Внешторгбанка в районах Рязанской области проходят мероприятия основной целью которых является знакомство рязанцев с историей развития и повседневной деятельностью банка'),
(19, '1', '2004-07-08 00:00:00', 'О вступлении Банка в систему страхования вкладов', 'Прио-Внешторгбанк получил заключительный акт проверки Центрального Банка РФ для участия в системе страхования.'),
(20, '1', '2004-08-18 00:00:00', 'На злобу дня', 'В ГУ ЦБ РФ по Рязанской области состоялась пресс-конференция посвященная вопросам вступления региональных банков в систему страхования банковских вкладов.'),
(21, '1', '2004-09-21 00:00:00', '<B>Приобанк принят в систему страхования вкладов</B>', '<B>21 сентября 2004 года Центральный Банк России принял решение о вынесении положительного заключения о соответствии требованиям к участию в системе страхования вкладов в отношении ОАО Прио-Внешторгбанк</B>'),
(22, '1', '2004-09-17 00:00:00', 'Юбилейные мероприятия в Пронском районе', 'В Пронском районе подведены итоги викторины, посвященной 15-летию крупнейшего регионального банка Прио-Внешторгбанка. Победители юбилейной викторины получили призы из драгоценного металла.'),
(23, '1', '2004-09-30 00:00:00', 'Рабочая встреча руководства банка в Скопине', 'В конце сентября в г.Скопине прошла рабочая встреча руководителей Прио- Внешторгбанка с деловой общественностью Скопинского и Милославского районов Рязанской области'),
(24, '1', '2004-10-06 00:00:00', 'Совместное совещание руководства области и банков', '6 октября, в Прио-Внешторгбанке состоялась рабочая встреча председателя правительства Рязанской области А.В. Ярина с руководителями банковских учреждений, работающих на территории Рязанской области'),
(25, '1', '2004-10-08 00:00:00', 'Прио-Внешторгбанк принял участие в бизнес-форуме', 'На завершившемся  7 октября 2-м региональном форуме предпринимателей «Пути развития: взаимодействие малого и крупного бизнеса» Прио-Внешторгбанк представил новую программу, ориентированную на потребно'),
(26, '1', '2004-10-11 00:00:00', 'Назначен новый начальник управления кредитования', '11 октября 2004 года на должность начальника Управления кредитования Банка назначена Мишуткина Ирина Владимировна'),
(27, '1', '2004-10-25 00:00:00', 'Прио-Внешторгбанк болеет за рязанцев', 'Прио-Внешторгбанк выступил спонсором четвертого национального фестиваля-конкурса традиционного народного творчества молодежи «Есенинская Русь».'),
(28, '1', '2004-11-17 00:00:00', 'Экскурсия в будущее', 'На этой неделе студенты банковского отделения Рязанского государственного технологического колледжа пришли в Прио-Внешторгбанк на день открытых дверей, посвященный 15-летию банка'),
(29, '1', '2004-11-10 00:00:00', 'Состоялась бизнес – встреча в Касимове', '10 ноября г.Касимове прошла рабочая встреча руководителей Прио- Внешторгбанка с деловой общественностью Касимовского района Рязанской области.'),
(30, '1', '2004-12-06 00:00:00', 'Музыкальная сказка', 'Прио-Внешторгбанк провел ежегодный концерт для детей с ограниченными физическими возможностями'),
(31, '1', '2004-12-05 00:00:00', 'Праздник спорта', 'Настоящий праздник для поклонников спортивных бальных танцев устроил Прио-банк в преддверии своего 15-летия: 4 декабря более 150 танцевальных пар съехались со всей России на традиционный межрегиональный турнир «Зимняя карусель»'),
(32, '1', '2005-01-24 00:00:00', '«Контакт» в Прио-Внешторгбанке', 'Прио-Внешторгбанк приступил к осуществлению операций по системе денежных переводов «Контакт».'),
(33, '1', '2005-01-26 00:00:00', 'Встреча в Прио-Внешторгбанке', '25 января в Прио-Внешторгбанке состоялась встреча руководителей банковских учреждений, работающих в регионе, с председателем правительства области А.В. Яриным по вопросам ипотечного кредитования.'),
(34, '1', '2005-01-31 00:00:00', 'Вклад на миллиард', 'Сумма средств на вкладах физических лиц в Прио-Внешторгбанке превысила миллиард рублей'),
(35, '1', '2005-02-08 00:00:00', 'Подведены итоги года', 'Прио-Внешторгбанк принял участие в традиционной  пресс-конференции  прошедшей в Главном управлении ЦБ РФ по Рязанской области'),
(36, '1', '2005-02-10 00:00:00', 'Концерт Б.Гребенщикова', '9 февраля 2005 года в г.Рязани при поддержке Прио-Внешторгбанка состоялся концерт Б.Гребенщикова'),
(37, '1', '2005-03-15 00:00:00', 'ЗИМУ ПРОВОДИЛИ – ПОДАРКИ ПОЛУЧИЛИ!', 'В субботу при поддержке Прио-Внешторгбанка на Соборной площади прошло празднование широкой Масленицы.'),
(38, '1', '2005-04-04 00:00:00', 'Город для детей', 'В Прио-Внешторгбанке открылась выставка проектов по строительству игровой площадки «Город детства», разработанных юными талантами.'),
(39, '1', '2005-04-01 00:00:00', 'Уроки в Прио-Внешторгбанке', 'Специалисты Прио-Внешторгбанка провели экскурсию для студентов отделения банковских технологий РГРТА'),
(40, '1', '2005-04-14 00:00:00', 'О проведении собрания акционеров', 'Прио-Внешторгбанк (открытое акционерное общество) извещает о проведении годового общего собрания акционеров 21 мая 2005 года по адресу: г. Рязань, пос. Солотча, ул. Монастырская, д. 8.'),
(41, '1', '2005-05-03 00:00:00', 'Прио-Внешторгбанк строит «Город детства»', '29 апреля в центральном офисе Прио-Внешторгбанка состоялась церемония награждения победителей и лауреатов конкурса на лучший проект игровой площадки «Город Детства»'),
(42, '1', '2005-06-02 00:00:00', 'Прио-Внешторгбанк поддержал городской дом ребенка', '1 июня в День защиты детей в городском доме ребенка с подарками побывали представители Прио-Внешторгбанка'),
(43, '1', '2005-06-09 00:00:00', 'Лучший региональный банк', 'Прио-Внешторгбанк признан победителем в номинации «Лучший региональный банк» в ежегодной национальной премии в области банковского бизнеса'),
(44, '1', '2005-06-20 00:00:00', 'Детское новоселье', 'В пятницу в парке на ул. Ленина открылась общедоступная игровая площадка «Город детства». Проект был разработан юными художниками Рязани, а финансовую сторону дела взял на себя Прио-Внешторгбанк.'),
(45, '1', '2005-07-01 00:00:00', 'Вместе к новым вершинам!', '14 июля 2005 года начнется восхождение команды Прио-Внешторгбанка на высочайшую гору Европы – Эльбрус. Проект «Вместе к вершинам!» \r\nбанк реализует совместно со своими клиентами.'),
(46, '1', '2005-07-18 00:00:00', 'Вершина еще впереди', 'Команда Прио-Внешторгбанка приблизилась к Эльбрусу на 4000 метров'),
(47, '1', '2005-07-12 00:00:00', 'Горная болезнь', 'Команда Прио-Внешторгбанка стремится к новым вершинам'),
(48, '1', '2005-07-22 00:00:00', 'Команда Прио-Внешторгбанка на вершине Эльбруса', 'В эти дни шестеро бизнесменов из Рязани совершили восхождение на высочайшую гору Европы – Эльбрус. Таким образом, Прио-Внешторгбанк и его клиенты реализовали проект «Вместе к вершинам!».'),
(49, '1', '2005-09-10 00:00:00', 'Прио-карт', '4 года назад Прио-Внешторгбанк выпустил первую карточку Прио-карт'),
(50, '1', '2005-09-08 00:00:00', '', 'Современный банковский комплекс Прио-Внешторгбанка на улице Есенина в течение четырех лет предоставляет клиентам обслуживание мирового уровня'),
(51, '1', '2005-09-26 00:00:00', 'Всем…всем…всем', 'Семьдесят лет назад в Рязанской области был создан Окский биосферный заповедник. При поддержке Прио-Внешторгбанка о юбилее рязанского заповедника узнали радиолюбители по всему миру'),
(52, '1', '2005-10-04 00:00:00', '', 'Концерт Сергея Никитина в Солотчинском детском доме состоится при поддержке Прио-Внешторгбанка'),
(53, '1', '2005-10-06 00:00:00', '', 'Платежи в Прио-Внешторгбанке'),
(54, '1', '2005-11-21 00:00:00', 'Конкурс подходит к завершению', 'Конкурс среди СМИ, объявленный Прио-Внешторгбанком в прошлом году, подходит к завершению. Конкурсная комиссия приступила к рассмотрению поступивших заявок.'),
(55, '1', '2005-11-30 00:00:00', 'Полезные уроки', 'Лучшие специалисты Прио-Внешторгбанка дают мастер классы студентам рязанских учебных заведений, позволяя самым любопытным из них познакомиться с работой банка изнутри.'),
(56, '1', '2005-12-05 00:00:00', 'С надеждой на лучшее', '2 декабря Прио-Внешторгбанк собрал в концертном зале Муниципального культурного центра тех, кто нуждается в заботе больше, чем кто-либо другой – детей с ограниченными возможностями.'),
(57, '1', '2005-12-07 00:00:00', 'Открылась новая оперкасса Прио-Внешторгбанка', 'Для обслуживания жителей Московского района города Рязани Прио-Внешторгбанк открыл новую операционную кассу, расположенную по адресу: Московское шоссе, 51/2'),
(58, '1', '2005-12-27 00:00:00', 'С Новым годом и Рождеством!', 'Прио-Внешторгбанк поздравляет всех с наступающими праздниками Нового года и Рождества!'),
(59, '1', '2005-12-20 00:00:00', 'Банки оценили работу СМИ', 'Прио-Внешторгбанк подвел итоги конкурса среди СМИ'),
(60, '1', '2006-01-23 00:00:00', 'Новый режим работы', 'Изменен режим работы операционной кассы №2'),
(61, '1', '2006-02-21 00:00:00', 'Изменения в руководстве', 'В Рыбновском отделении сменился руководитель'),
(62, '1', '2006-02-22 00:00:00', 'Поздравляем с Днем защитника Отечества', 'Искренне поздравляем наших клиентов и партнеров с Днем защитника отечества'),
(63, '1', '2006-02-26 00:00:00', 'Все на Масленицу!', 'Прио-Внешторгбанк совместно с администрацией города Рязани устроит для горжан настоящий праздник Масленицы. 4 марта для взрослых и детей будут работать две праздничные площадки.'),
(64, '1', '2006-02-16 00:00:00', 'Подравляем!', 'Прио-Внешторгбанк рад поздравить предприятия и учебные заведения Рязанской области с наградами, полученными на  VI Московском международном салоне инноваций и инвестиций.'),
(65, '1', '2006-02-28 00:00:00', 'Банки подвели итоги 2005 года', '28 февраля в ГУ Центрального банка РФ по Рязанской области состоялась пресс-конференция, посвященная подведению итогов работы банковского сектора региона за 2005 год'),
