(68, '1', '2006-03-10 00:00:00', 'Благодарственное письмо', 'Губернатор направил Председателю Правления Прио-Внешторгбанка Михаилу Волкову благодарственное письмо за подготовку, организацию и финансирование праздника «Душа моя Масленица»'),
