(71, '1', '2006-06-27 00:00:00', 'Рязанские гармонисты – лучшие в России!', 'На всероссийском конкурсе «Играй, гармонь!» рязанские гармонисты, которых традиционно поддерживает Прио-Внешторгбанк, показали класс и завоевали дипломы лауреатов.'),
