INSERT INTO `smi` (`id`, `on`, `date`, `publicate`, `title`, `story`, `file`) VALUES
(20, '1', '2005-06-20', '"Совет директоров"', 'Город детства', '17 июня в парке на улице Ленина открылась общедоступная игровая площадка «Город детства». Проект был разработан юными художниками Рязани, а финансовую сторону дела взял на себя Прио-Внешторгбанк.', '001.zip'),
(2, '1', '2003-12-05', '“Пронская газета” № 145-146(9516-17)', 'Прио-Внешторгбанк: достоинство и бережное отношение к клиенту', 'Наш век по праву можно назвать веком денег. А если есть денежные отношения, существуют и банки. Один из них - “Прио-Внешторгбанк”, филиал которого находится в Новомичуринске, в микрорайоне “Д”', '0030.zip'),
(3, '1', '2003-12-08', '«Экстра-Офис» № 45(270)', 'Прио-Внешторгбанк»: 14 лет непрерывного развития', 'Рождение и становление первого коммерческого банка Рязани пришлись на переходный период в истории страны. Образовавшись в конце восьмидесятых годов в условиях очевидного кризиса', 'ekstra.zip'),
(4, '1', '2003-12-05', '«Рязанские ведомости» № 250(1759)', 'Прио-Внешторгбанк 14 лет сохраняет лидерство', '6 декабря исполняется 14 лет Прио-Внешторгбанку, крупнейшему самостоятельному рязанскому коммерческому банку. Все эти годы его деятельность способствует развитию экономики региона и укреплению.', 'finans.zip'),
(5, '1', '2003-12-05', 'Комсомольская правда - Рязань» № 226/49', 'Имейте дело с надежным партнером!', 'Хотя возраст учреждения  сравнительно молодой, оно заслуживает особого отношения к себе. Появившись на рынке банковских услуг в то время, когда само слово “коммерция” вызывало откровенное раздражение,', 'partner.zip'),
(6, '1', '2003-12-01', '«Рязанский бизнес-журнал» № 23(5)', 'Банк не может жить лучше своих клиентов', '6 декабря исполнилось 14 лет первому рязанскому банку «Прио-Внешторгбанк». 14 лет для российского банка - не просто солидный возраст. Это неоценимый опыт, приобретенный в сложнейших и непредсказуемых', 'priobankbest.zip'),
(17, '1', '2004-02-27', '"Комсомольская Правда"- Рязань №37/9 (23224)', 'Рязанцы от души погуляли на празднике "Душа моя - Масленица"', 'Четвертый год подряд Прио-Внешторгбанк вместе с администрацией города проводит замечательный праздник, ставший за это время хорошей рязанской традицией.', 'maslenitsa2.zip'),
(19, '1', '2004-03-04', '"Рязанские ведомости" - №49 (1829)', 'Свое помещение для малого бизнеса', 'Предприятиям малого бизнеса Прио-Внешторгбанк предлагает уникальную услугу, позволяющую приобрести в собственность нежилые помещения на оптимальных условиях. Преведена схема реализации данной услуги.', 'pomeschenie dly biznesa.zip'),
(27, '0', '2009-04-11', 'asdf asdf111222', 'asdf qwef1122', 'qwf asdfasfq1122', 'правка кодовой страницы.reg'),
(28, '0', '2009-04-10', 'sss', 'ss', 'ss', 'подпись к письмам.txt');
